INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2,304,'2012-02-08T19:45:14.237','Robert Cartaino','2018-02-21T17:54:58.933','null','Palm Bay, FL','<p><a href=\"http://blog.stackoverflow.com/2010/04/welcome-stack-overflow-valued-associate-00005/\">Stack Exchange Valued Associate #00005</a></p>\n\n<p>I am the Director of Community Development for the Stack Exchange Network.</p>\n\n<p>I can be reached at<br>\n<b>&#114;&#99;&#97;&#114;&#116;&#97;&#105;&#110;&#111;&#64;&#115;&#116;&#97;&#99;&#107;&#101;&#120;&#99;&#104;&#97;&#110;&#103;&#101;&#46;&#99;&#111;&#109;</b></p>\n','16','5','6','34933');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (4,101,'2012-02-08T19:49:01.633','Nick Craver','2017-04-16T17:39:34.413','https://nickcraver.com/blog/','Winston-Salem, NC','<p>I am the Architecture Lead for Stack Overflow. My day job consists of being a Developer, Site Reliability Engineer, and DBA. I design and build very fast things in hopes of making life easier for millions of developers.</p>\n\n<p>Blog: <a href=\"https://nickcraver.com/blog/\" rel=\"nofollow noreferrer\">nickcraver.com/blog</a><br>\nTwitter: <a href=\"https://twitter.com/Nick_Craver\" rel=\"nofollow noreferrer\">@Nick_Craver</a><br>\nMy Developer Story: <a href=\"https://stackoverflow.com/story/ncraver\">stackoverflow.com/story/ncraver</a></p>\n\n<p><sub>Disclaimer: I have <em>no idea</em> what I\'m talking about, all my answers are guesses!</sub></p>\n','3','0','0','7598');
