INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (23,1792,'2012-02-08T20:06:00.190','geoffc','2017-08-22T15:04:07.930','http://wiki.novell.com/index.php/Geoffrey_Carmans_personal_collection','Brooklyn, NY, United States','<p>I mostly work with Novell/NetIQ Identity Manager, an XML based product that use XSLT, XPATH, and DirXML Script (its own XML based language).</p>\n\n<p>I have written a <a href=\"http://www.ninja-tools.com/Definitive-Guide-to-NetIQ-IDM-Tokens-Soft-Copy-2001.htm\" rel=\"nofollow noreferrer\">book</a> on the topic of the DirXML Script language. </p>\n\n<p>I have written a <a href=\"https://www.ninja-tools.com/?p=26\" rel=\"nofollow noreferrer\">manual</a> for the Microfocus IDM Validator product. </p>\n\n<p><a href=\"http://stackexchange.com/users/15330/geoffc\"><img src=\"https://stackexchange.com/users/flair/15330.png\" width=\"208\" height=\"58\" alt=\"profile for geoffc on Stack Exchange, a network of free, community-driven Q-Asites\" title=\"profile for geoffc on Stack Exchange, a network of free, community-driven Q-A sites\" /></a></p>\n','30','894','2','15330');
