INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (29,101,'2012-02-08T20:10:40.850','jlarson','2012-07-06T18:34:40.790','http://joewlarson.com/blog/','Bothell, WA','<p>I\'ve been writing programs since I was 7 (Logo at first), though mostly in QBASIC for the first decade or so :).  Now I am a serious programmer at a great little software company, where I do full stack web development, though my true love is front end.</p>\n\n<p><a href=\"http://twitter.com/#!/joelarson4\" rel=\"nofollow\">http://twitter.com/#!/joelarson4</a> - thoughts</p>\n\n<p><a href=\"http://joewlarson.com/blog/\" rel=\"nofollow\">http://joewlarson.com/blog/</a> - longer thoughts</p>\n\n<p><a href=\"http://unicodinator.com\" rel=\"nofollow\">http://unicodinator.com</a> - a visual unicode navigation tool</p>\n','1','4','0','28802');
