INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (32,101,'2012-02-08T20:13:50.877','gabeanderson','2012-02-20T13:39:12.270','http://gabeanderson.com/','Saratoga Springs, NY','Though I\'ve struggled with consumer credit card debt in the past, I\'m now proud to be free of credit card debt. I\'m passionate about personal finance and enjoy encouraging others to save for the future and spend responsibly. \r\n<br><br>\r\nAt 30, I discovered a love for distance running, and have logged more than 3,000 miles, including 4 marathons and 5 half-marathons, since I started running in early 2008. Training for endurance events and saving for the future are a lot alike: Both require focus, sacrifice, discipline, and patience to get to the finish line to meet your goal.','0','0','0','519710');
