INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (35,1954,'2012-02-08T20:20:48.070','pjmorse','2018-02-28T13:56:04.940','http://www.parkermorse.net','Wellesley, MA, United States','<p>Board member and former job creator at <a href=\"http://www.commonmediainc.com/\" rel=\"nofollow\">Common Media, Inc.</a>, longtime web geek currently at <a href=\"http://dmcouncil.org\" rel=\"nofollow\">the District Management Council</a>, former graduate student at <a href=\"http://cs.tufts.edu\" rel=\"nofollow\">Tufts</a>, sometime <a href=\"http://www.tafwa.org/\" rel=\"nofollow\">track</a> <a href=\"http://iaaf.org/\" rel=\"nofollow\">writer</a>, father of twins.</p>\n','33','216','4','116771');
