INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (37,814,'2012-02-08T20:24:50.823','J. Win.','2015-08-23T17:46:53.953','http://www2.jabsom.hawaii.edu/igert/?page_id=453','United States','<p>I use R.</p>\n','4','13','0','278784');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (38,773,'2012-02-08T20:27:33.330','Tonny Madsen','2016-07-01T07:39:31.153','http://tonnymadsen.blogspot.com/','Copenhagen, Denmark','<p>I\'m a software developer from Denmark with many years of experience in a number of software companies - primary in highly technical companies.</p>\n\n<p>My primary interests are in system architecture and development of technical software. In recent years, I have concentrated on the various techniques and facilities provides in the Eclipse ecosystem such as plug-in development, MDD, RCP applications, etc.</p>\n\n<p>I\'m also the chairman of the Danish Eclipse Society, <a href=\"http://eclipse.dk\" rel=\"nofollow\">eclipse.dk</a>, a meeting place for everybody with an interest in Eclipse and the connected tools and technologies.</p>\n\n<p>Lastly, I\'m an avid runner and you can often find me on some road or in some wood trying to do just a little better...</p>\n\n<p>Professional Specialities:</p>\n\n<ul>\n<li>System Architecture</li>\n<li>Eclipse Plug-in and OSGi Bundle Development</li>\n<li>Model Driven Development</li>\n<li>Mentoring, Consultancy and Training</li>\n<li>Test Driven Development</li>\n<li>Many Eclipse Technologies - such as OSGi, RCP, SWT, RAP, EMF, ....</li>\n<li>Java, C++, Python, Perl, ...</li>\n<li>Testing</li>\n<li>Development Tools</li>\n<li>Telecommunication Technologies</li>\n<li>Software Methodologies (SCRUM, RUP and XP)</li>\n</ul>\n','31','134','6','419412');
