INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (41,324,'2012-02-08T20:32:55.353','Robert C. Barth','2016-12-01T22:03:47.567','http://www.norimek.com/blog/','Chandler, AZ','<p>Senior software engineer at New Relic</p>\n','10','7','0','5648');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (42,101,'2012-02-08T20:34:40.610','javamonkey79','2012-02-08T21:27:54.063','null','Spokane, WA','<p>I enjoy clean, object oriented code, simple &amp; powerful api\'s and slick solutions. I try to give back but more often than not I ask more than I answer :)</p>\n\n<p>I work at a silicon coast .com doing back end integration and big-ish data work.</p>\n\n<p>I am primarily interested java, Eclipse and maven. However, I\'ve been known to dink around in Python, Perl, Bash Scripts, Windows Scripts, HTML, javascript, PHP, CSS, C, ASP, VB, C#, OSGi, PDE, RCP...and the list goes on. Lately I\'ve been learning hbase, hadoop and getting really deep in solr.</p>\n\n<p>I occasionally <a href=\"http://monkeyingwithjava.wordpress.com/\" rel=\"nofollow\">blog</a> here and I have contributed open source code &amp; documentation <a href=\"http://code.google.com/p/velocity-maven-plugin/\" rel=\"nofollow\">here</a> and <a href=\"https://github.com/restlet/restlet-framework-java\" rel=\"nofollow\">here</a>.</p>\n','0','0','0','13696');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (43,101,'2012-02-08T20:37:34.640','netadictos','2012-02-08T20:37:34.640','http://www.disenoactivo.es','Seville, Spain','<p><strong>Web / Mobile Apps / Windows Apps Developer.</strong><br/></p>\n\n<p><strong>Technologies:</strong></p>\n\n<ul>\n<li>C# (ASP.NET, MVC, WinForms, Sharepoint), PHP, Objective C (iOS), Android Java, HTML, CSS, javascript (jquery, angularjs, backbone, grunt...),  SQL,  macromedia flash</li>\n</ul>\n\n<p><strong>CMS:</strong></p>\n\n<ul>\n<li>Sharepoint, Wordpress</li>\n</ul>\n\n<p>I like to find difficult questions about programming and solve them!,that\'s why stackoverflow is the perfect site!!! ;-)<br/></p>\n','0','0','0','15179');
