INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (45,101,'2012-02-08T20:41:04.113','Mihaela','2012-02-08T22:26:15.240','http://mihaelamj.com','Croatia','<p>I\'m a long time Delphi developer (from January 1995) and Asterisk integrator (from 2006). My husband and I run a small Asterisk integration shop in Croatia. We also run a software Micro ISV. Our first product is @ www.samcontacts.com, a simple contact manager. Our second product is @ www.samreports.com, Asterisk BI and reporting. We have 3 kids.\nI\'m an Information and Speech Science graduate from Zagreb University. I\'ve been working as a programmer for the last 15 years. He\'s an Electrical Engineer specializing in Mobile Networks Optimization.</p>\n','0','0','0','37091');
