INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (48,101,'2012-02-08T20:43:43.273','Johann Gerell','2015-01-08T08:22:18.710','http://gerell.net','Sweden','<p>Johann spends most of the day\'s sun-lit hours as a Senior Software Engineer in the DICE / Electronic Arts offices in Stockholm, Sweden, where he works on a non-disclosed game title. </p>\n\n<p>When not in the offices, Johann can often be found golfing in the vicinity of Bro, north of Stockholm.</p>\n\n<p>The safest bet on Johann\'s whereabouts is that he\'s just at home with his family, a lovely wife and 2 incredible children.</p>\n','0','0','0','4261');
