INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (52,101,'2012-02-08T21:00:30.543','Nick','2012-02-08T21:00:30.543','http://www.kewney.com','Glasgow, United Kingdom','<p>I\'m a software developer and system designer with eight years of experience designing and developing solutions including <strong>server</strong>, <strong>web</strong>, <strong>desktop</strong> and <strong>mobile</strong> applications.  </p>\n\n<p>I love building technology that helps people.</p>\n\n<p>Areas of expertise include:</p>\n\n<p><strong>Software</strong></p>\n\n<ul>\n<li>C#</li>\n<li>ASP.NET MVC</li>\n<li>.NET Framework</li>\n<li>WCF/Web API</li>\n<li>HTML/CSS/jQuery/Angular.js</li>\n<li>MEAN stack</li>\n</ul>\n\n<p><strong>Data</strong></p>\n\n<ul>\n<li>SQL Server</li>\n<li>Entity Framework</li>\n<li>NoSQL (MongoDB)</li>\n</ul>\n\n<p><strong>Design</strong></p>\n\n<ul>\n<li>Adobe Creative Suite</li>\n</ul>\n\n<p>Visit me at <a href=\"http://kewney.com\" rel=\"nofollow\">kewney.com</a></p>\n','0','1','0','294374');
