INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (90,310,'2012-02-09T06:55:04.290','Henrik','2013-06-24T08:51:58.227','null','null','<p>I am working with operational oceanography and scientific computing in general as well as web developement.</p>\n\n<p>My programming skills include but are not limited to Fortran, R, C# and Ruby.</p>\n\n<p>My favorite language at the moment is Ruby.</p>\n','3','4','0','63926');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (91,219,'2012-02-09T07:33:10.717','David Rönnqvist','2017-03-12T16:06:19.170','http://ronnqvi.st','Stockholm, Sweden','<p>I\'m a graphics and animations development enthusiast from Stockholm, Sweden. </p>\n\n<p>I fell in love with Mac and iOS development with the introduction of OS X 10.5 Leopard and the iPhone SDK. </p>\n\n<p>When I\'m not writing code I practice and teach kung fu.</p>\n\n<p>Did I mention that I\'m currently writing <a href=\"http://scenekitbook.com\" rel=\"nofollow\">a book</a> about <a href=\"/questions/tagged/scenekit\" class=\"post-tag\" title=\"show questions tagged &#39;scenekit&#39;\" rel=\"tag\">scenekit</a>?</p>\n\n<hr>\n\n<p>If you ask me questions over Twitter, be aware that I can\'t really fit much of an answer in just 140 characters.</p>\n\n<hr>\n\n<p>As far as I\'m concerned you are free to do whatever you want with the answers that I\'ve written, both existing and future answers. To <a href=\"http://meta.stackexchange.com/a/12539/184424\">work around</a> the <a href=\"http://meta.stackexchange.com/a/54767/184424\">default</a> <a href=\"http://creativecommons.org/licenses/by-sa/2.5/\" rel=\"nofollow\">CC-BY-SA License</a> I\'m licensing all my original code snippets and explanations (the \"Answer\") on Stack Overflow and all other Stack Exchange sites under <a href=\"http://opensource.org/licenses/mit-license.php\" rel=\"nofollow\">the MIT License</a>.</p>\n','4','4','0','300796');
