INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (157,161,'2012-02-15T21:28:59.500','freiheit','2016-08-20T00:32:28.310','http://eric.eisenhart.name/','Santa Rosa, CA','<p>When I\'m not bicycling, I\'m a Linux <a href=\"http://en.wikipedia.org/wiki/System_administrator\" rel=\"nofollow\">SysAdmin</a>. I\'m on the board of my <a href=\"http://www.bikesonoma.org\" rel=\"nofollow\">local bicycle advocacy group</a>.</p>\n\n<p>Bikes are my primary transportation. A 2009 <a href=\"http://www.surlybikes.com/bikes/long_haul_trucker_complete/\" rel=\"nofollow\">Surly Long Haul Trucker</a>, <a href=\"http://bicycles.blogoverflow.com/files/2011/10/Fondo-Setup-My-Bike.jpg\" rel=\"nofollow\">set up as a commuter</a> and a <a href=\"http://www.trekbikes.com/us/en/bikes/road/cyclocross/ion_cx/ion_cx/\" rel=\"nofollow\">2012 Trek Ion CX</a>. I also take the bus, but do not own a car.</p>\n\n<p><a href=\"http://stackexchange.com/users/29dbf043488c450aaaa5e644ef72de2a\">\n<img src=\"http://stackexchange.com/users/flair/29dbf043488c450aaaa5e644ef72de2a.png\" width=\"208\" height=\"58\" alt=\"profile for freiheit on Stack Exchange\" title=\"profile for freiheit on Stack Exchange\">\n</a></p>\n\n<p><a href=\"http://twitter.com/freiheit\" rel=\"nofollow\">@freiheit</a>, <a href=\"https://plus.google.com/112867404905233224349/\" rel=\"nofollow\">Google+</a>, <a href=\"http://www.facebook.com/eric.eisenhart\" rel=\"nofollow\">Facebook</a>, <a href=\"http://www.linkedin.com/in/freiheit\" rel=\"nofollow\">LinkedIn</a></p>\n','0','3','0','40142');
