INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (171,101,'2012-02-16T04:03:05.740','Sathya','2012-12-11T08:06:33.810','http://sathyabh.at','Bangalore, India','\n\n<p>Currently, DevOps at <a href=\"http://adobe.io\" rel=\"nofollow noreferrer\">Adobe</a>. </p>\n\n<p>I used to write SQL queries, PL/SQL programs or develop UI using Oracle Forms. Former <a href=\"http://techie-buzz.com/author/sathya\" rel=\"nofollow noreferrer\">techie-buzz</a> blogger. Occasionally write a post or two on my own blogs <a href=\"http://sathyabh.at\" rel=\"nofollow noreferrer\">personal</a> and <a href=\"http://sathyasays.com\" rel=\"nofollow noreferrer\">tech</a>. #SOreadytohelp</p>\n\n<p>I used to moderate (the now defunct) <a href=\"http://tech2.in.com/forum/forum.php\" rel=\"nofollow noreferrer\">tech2 forums</a> and was <a href=\"http://blog.stackoverflow.com/2011/02/welcome-our-new-trilogy-moderators-for-2011/\">elected as a ♦ Community Moderator</a> for <a href=\"http://superuser.com/users/4377\">Super User</a> in 2011 and for <a href=\"http://meta.webapps.stackexchange.com/q/1210/310\">Web Applications Stack Exchange in 2012</a>. </p>\n\n<p>Besides SQL, PL/SQL &amp; Oracle Forms, I also know a little bit of Ruby, Python &amp; C#. I love <a href=\"http://last.fm/user/sathyabhat\" rel=\"nofollow noreferrer\">listening to music</a> and I\'m an avid gamer, and can be found on <a href=\"http://raptr.com/sathyabhat\" rel=\"nofollow noreferrer\">Raptr</a>, <a href=\"http://steamcommunity.com/id/sathyabhat\" rel=\"nofollow noreferrer\">Steam</a>.</p>\n\n<p>I have a rather broad social presence and you can catch me on <a href=\"http://twitter.com/sathyabhat\" rel=\"nofollow noreferrer\">twitter</a>, <a href=\"http://facebook.com/sathyabhat\" rel=\"nofollow noreferrer\">facebook</a>, <a href=\"http://linkedin.com/in/sathyabhat\" rel=\"nofollow noreferrer\">LinkedIn</a>,  <a href=\"https://plus.google.com/u/0/102438636933093151901/about\" rel=\"nofollow noreferrer\">Google+</a> <a href=\"http://post.sathyabh.at\" rel=\"nofollow noreferrer\">Posterous</a>, <a href=\"http://tumble.sathyabh.at\" rel=\"nofollow noreferrer\">Tumblr</a>, <a href=\"http://www.google.com/reader/shared/10711434258154108770\" rel=\"nofollow noreferrer\">Google Reader</a>, <a href=\"http://sbhat.me\" rel=\"nofollow noreferrer\">about.me</a> and <a href=\"http://sathya.pro\" rel=\"nofollow noreferrer\">Atticous</a> </p>\n\n<p>I also tend to edit quite a lot of questions and answers - so please don\'t think I\'m targetting you. </p>\n\n<p>BTW - there\'s my <a href=\"http://u.sbhat.me/jK1HHL\" rel=\"nofollow noreferrer\">Amazon Wish List</a> that needs to be fulfilled :)  </p>\n\n<hr>\n','0','0','0','33230');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (172,136,'2012-02-16T04:10:22.460','studiohack','2016-03-23T19:20:16.277','http://studiohack.weebly.com/','US','<p>Windows and Windows Phone/Zune hacker (<a href=\"http://www.bing.com/Dictionary/search?q=define+hacker&amp;FORM=DTPDIA&amp;qpvt=define+hacker\" rel=\"nofollow\">definition #2</a>).   </p>\n\n<p><strong>I\'m a ♦ moderator for <a href=\"http://superuser.com/\">Super User</a> &amp; <a href=\"http://outdoors.stackexchange.com/\">The Great Outdoors</a></strong>.  Questions, concerns, feedback, or to contact studiohack, please either: flag your post, notify me in chat or a comment with @studiohack, or email me <em>studiohack</em> [AT] <em>live</em> [DOT] <em>com</em>.  </p>\n\n<p>When editing your post, it is <em>always</em> my intent to make it clearer, concise, and easier to read.  Please let me know if I have not done so.</p>\n','0','4','0','116920');
