INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (184,101,'2012-02-16T17:27:21.397','voretaq7','2012-08-23T20:38:17.297','http://www.bsd-box.net/~mikeg/blog','New York, United States','<p>Generic sysadmin. Hack coder. Jack of all trades, master of some.<hr />\nPlease Note:<br />\n<br />\nI expect you to read any reference material I link to in my answers. If the answer to your question is contained in said reference material and the reference source is not likely to disappear I will probably not cut and paste it onto SF unless it\'s really cool/interesting/obscure.<br /><i>In return I promise not to link anyone to goatse or tubgirl</i><br />\n<br />\nI expect you to think for yourself and do a little thinking (and mayhaps even some work) to solve your problems. If you aren\'t capable of this, please exit the profession via the door on your left.<br /><i>In return I promise to do my best to aim you in the right direction, and to clarify any points you have trouble with</i></p>\n','0','0','0','95292');
