INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (201,101,'2012-02-18T00:05:56.063','Xonatron','2012-02-23T04:55:28.363','http://xona.com/','Yarmouth, Nova Scotia, Canada','<p><a href=\"http://xona.com/matt/\" rel=\"nofollow noreferrer\">Matthew Doucette</a>, Game Producer of <a href=\"http://xona.com/\" rel=\"nofollow noreferrer\">Xona Games</a>, an <a href=\"http://xona.com/awards.html\" rel=\"nofollow noreferrer\">award-winning</a> Xbox and PlayStation <a href=\"http://xona.com/games/\" rel=\"nofollow noreferrer\">indie games</a> studio known for developing <a href=\"http://xona.com/tagline.html\" rel=\"nofollow noreferrer\">intense retro</a> games, <a href=\"http://xona.com/japan/\" rel=\"nofollow noreferrer\">#1 shmup hits in Japan</a>, and winning <a href=\"http://xona.com/prizes.html\" rel=\"nofollow noreferrer\">$180,000 in awards</a>.</p>\n\n<ul>\n<li>2017: Co-founded <a href=\"http://igniteatlantic.com/\" rel=\"nofollow noreferrer\">Ignite Labs</a></li>\n<li>2016-present: Game Development Instructor, <a href=\"http://www.nscc.ca/explorenscc/campuses/truro/\" rel=\"nofollow noreferrer\">NSCC Truro Campus</a></li>\n<li>2015: Co-founded <a href=\"http://xona.com/kidsmakegames/\" rel=\"nofollow noreferrer\">Kids Make Games</a></li>\n<li>2015-2016: Game Development Instructor, <a href=\"http://brilliantlabs.com/\" rel=\"nofollow noreferrer\">Brilliant Labs</a></li>\n<li>2015: Steering Committee Member, <a href=\"http://brilliantlabs.com/\" rel=\"nofollow noreferrer\">Brilliant Labs</a></li>\n<li>2015: Co-founded <a href=\"http://twitter.com/HubYarmouth\" rel=\"nofollow noreferrer\">The Hub Yarmouth</a></li>\n<li>2014: Co-founded <a href=\"http://lakedoucette.com/\" rel=\"nofollow noreferrer\">Lake Doucette Street Car Challenge</a></li>\n<li>2013-present: Lead Programmer, <a href=\"http://xona.com/\" rel=\"nofollow noreferrer\">Xona Games</a></li>\n<li>2012-2013: Lead Programmer, Marroni Games</li>\n<li>2011-2012: Venture Capitalist, <a href=\"http://xona.com/\" rel=\"nofollow noreferrer\">Xona Games</a> </li>\n<li>2011-2012: Software Development Engineer, <a href=\"http://web.com/\" rel=\"nofollow noreferrer\">Web.com</a></li>\n<li>2010-2011: <a href=\"http://xona.com/xblig/\" rel=\"nofollow noreferrer\">Xbox LIVE Indie Games Advocate</a>: <a href=\"http://xona.com/proposal/\" rel=\"nofollow noreferrer\">Xona Proposal</a></li>\n<li>2010: Co-founded <a href=\"http://xona.com/\" rel=\"nofollow noreferrer\">Xona Games</a></li>\n<li>2008-present: Game Producer, <a href=\"http://xona.com/\" rel=\"nofollow noreferrer\">Xona Games</a></li>\n<li>2004: Coined \"<a href=\"http://en.wikipedia.org/wiki/Domain_hack\" rel=\"nofollow noreferrer\">Domain Hack</a>\"</li>\n<li>2004-2008: Programmer, <a href=\"http://xona.com/escape/\" rel=\"nofollow noreferrer\">eScape</a></li>\n<li>2003: Venture Capitalist, <a href=\"http://xona.com/escape/\" rel=\"nofollow noreferrer\">eScape</a></li>\n<li>2000-2003: Web Developer: Hosting &amp; Scripting</li>\n<li>1999-2000: Co-founded Saw Tooth Distortion</li>\n<li>1995-2003: Music Composer, <a href=\"http://soundcloud.com/xonatron\" rel=\"nofollow noreferrer\">Xonatron</a></li>\n<li>1995-1999: <a href=\"http://cs.acadiau.ca/\" rel=\"nofollow noreferrer\">Bachelor of Computer Science</a>, <a href=\"http://acadiau.ca/\" rel=\"nofollow noreferrer\">Acadia University</a></li>\n</ul>\n','0','1','0','541586');
