INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (224,742,'2012-02-21T17:59:32.707','Chad','2016-08-29T14:05:06.577','null','Peoria, IL','<p>Once Upon a time a magical company called MagicDollars (for the sake of brevity for the rest of the answer we will refer to this company by its stock ticker M$) and this company made the most widely used, operating system, internet browser, office productivity suite, and various other products. M$ had this great idea to just integrate all of its software so that they would all work together seamlessly. This would be great for users of this software since this would make doing things like importing a webpage in a Ward processing (because in magicland we have wards instead of words) document, seemlessly and natively.</p>\n\n<p>But this would evidently make the software too good. And we cant have people getting software that is too good. Because then if another company came along with their own version of good software people will be too dumb to install and use that if they have the already integrated versions that were included. So the Neanderthal Union decreed that M$ was using its magical abilities to make things too difficult for smaller developers to create super complex applications that they must give away for free. And said you will no longer make things work together seemlessly.</p>\n\n<p>And instead of extending their middle wand to the NeU and saying fine we shall no longer make software that can be used in the NeU... M$ bowed before the luddites and said ok. So now you can not rename a file from inside of your office productivity suite in Magicland.</p>\n','15','45','6','368463');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (225,136,'2012-02-21T18:32:37.080','LessPop_MoreFizz','2017-07-06T01:42:39.123','http://www.lesspopmorefizz.com','Europa, the Moon of Jupiter.','<p>Hi. I\'m Keith. I answer questions about video games. I also delete spam. And write opinionated meta posts. And assorted other Moderatorial things.</p>\n\n<p>If you need to reach out to me for any reason, I can always be reached in the following ways:</p>\n\n<p>I am <a href=\"https://twitter.com/lesspopmorefizz\" rel=\"nofollow\">@lesspopmorefizz on Twitter</a>. I am <a href=\"http://steamcommunity.com/id/lesspopmorefizz/\" rel=\"nofollow\">LessPopMoreFizz on Steam</a>.</p>\n\n<p>Keith at lesspopmorefizz dot com is my email address. It also works for Google Talk.</p>\n','5','0','0','69074');
