INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (233,203,'2012-02-22T18:12:19.277','Dharma Kshetri','2017-09-24T02:21:52.603','http://www.prandroid.com','Irving, TX, United States','<blockquote>\n  <p>Hello, I am an android developer using Java and kotlin. Besides work, I loved to post articles on my blog   <a href=\"http://www.PrAndroid.com\" rel=\"nofollow noreferrer\">   PrAndroid</a>,<a href=\"http://www.Codingworkspace.com\" rel=\"nofollow noreferrer\"> CodingWorkspace</a>. \n  I like to watching soccer, movies and traveling.<br/></p>\n</blockquote>\n\n<p><strong>I have my own rule call 6H —\n(<em>Home||Help||Happiness||Health||Humanity||Honesty</em>)</strong></p>\n\n<hr>\n\n<blockquote>\n  <p><strong>You can catch me following:</strong>\n  <br/>\n  <a href=\"https://dharmakshetri.me\" rel=\"nofollow noreferrer\"> Personal Website</a><br/>\n  <a href=\"https://github.com/dharmakshetri\" rel=\"nofollow noreferrer\"> GitHub</a><br/>\n  <a href=\"https://play.google.com/store/apps/developer?id=Er.+Dharma+Kshetri\" rel=\"nofollow noreferrer\"> Google Play Store</a><br/>\n  <a href=\"http://linkedin.com/in/dkshetri\" rel=\"nofollow noreferrer\"> LinkedIn</a><br/>\n  <a href=\"https://angel.co/dharmakshetri\" rel=\"nofollow noreferrer\"> Angle.co</a><br/>\n  <a href=\"https://medium.com/@dharma.kshetri\" rel=\"nofollow noreferrer\">Medium</a><br/></p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <h3>HappyCoding -  #ILoveKotlin #PrAndroid #CodingWorkspace #APT3004</h3>\n</blockquote>\n','22','6','0','450651');
