INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (236,173,'2012-02-23T05:51:02.643','Martin Duys','2015-10-20T03:57:17.240','http://www.martinduys.com','South Africa','<p>I originally trained as an architect; but turned my back on designing buildings and embraced the internet in 2000. I\'ve never looked back and have loved every minute of this world where there is something new to learn every day and things change so fast.</p>\n\n<p>I have worked largely on the non-technical side as a product manager, account manager and project manager; but am fascinated to learn as much as I can about the technical side of things.</p>\n','2','10','0','37873');
