INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (242,101,'2012-02-23T16:46:26.337','Nathan Wheeler','2012-03-12T13:56:26.733','null','Bolivar, MO','<p>I\'m the user formerly known as md5sum, for those who wonder.</p>\n\n<p>Currently, I\'m a developer in the Property & Casualty Insurance division of Accenture Software.</p>\n\n<p>I started playing with GWBASIC on our Commodore Colt at around 5 years old, and it was all downhill from there. I have now been programming professionally since 2005 and have several more years of part-time/freelance programming under my belt as well.</p>\n\n<p>Currently, I\'m specialized in C#, ASP.Net 2.0, and MSSQL, but my work experience is quite broad, including C++, PHP, Javascript, WPF, VB6, VB.Net, ASP.Net, MySQL, and I\'ve dabbled in many others.</p>\n\n<p>~md5sum~</p>\n','1','0','0','66021');
