INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (269,251,'2012-02-27T21:49:07.320','moesef','2016-04-06T23:57:27.033','http://mohammadsamman.brandyourself.com/','San Francisco Bay Area','<p>Mohammad Samman recently earned his B.S. in Bioengineering from UC San Diego, a top ten school for this degree. Now that he has graduated, he is working to gain some good experience in the Biotechnology industry. Mohammad Samman is happy with his current position at iHear medical, but is always open to networking and making industry connections. While not at work, Mohammad Samman is teaching himself various programming languages to have some experience in web and mobile development, which Mohammad feels are necessary skills to for anyone in the technology field, and believes it will help him in pursuing his goals of one day starting his own tech company. Mohammad Samman plans to one day return to school to gain a dual Master\'s in Computer Science and is excited to for a long and fulfilling career.</p>\n','2','2','0','1224569');
