INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (275,101,'2012-02-28T22:52:58.190','Johnny Arizona','2016-10-12T23:52:27.450','http://www.cquest.us','Springfield, IL','<p>I am a Senior Consultant for a IT Consulting Firm. I have used VB6, VB.Net, C# along with various versions of SQL Server. I have used WPF, WinForms, ASP.NET and MVC. </p>\n\n<p>I have also been Admin for a TFS 2008 and TFS 2012 that included the installation, setup and maintenance as well. I have some experience with TFS 2010 as well.</p>\n','2','4','0','247776');
