INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (280,134,'2012-03-01T09:52:36.517','Merlyn Morgan-Graham','2016-08-05T21:23:46.333','null','San Mateo, CA, United States','<ul>\n<li>Python • C++ • C# • Graphics • Game Development</li></li>\n<li>Web Development • Automation (of everything)</li>\n<br/></li>\n<li><a href=\"http://stackoverflow.com/questions/8472678/is-it-a-good-practice-to-have-logger-as-a-singleton/8485625#8485625\">Stay DRY when injecting loggers</a></li>\n<li><a href=\"http://stackoverflow.com/questions/3966809/generate-random-number-between-two-number-with-one-rare-number/3966847#3966847\">Weighted PRNG, with dice tables</a></li>\n<li><a href=\"http://stackoverflow.com/questions/3711487/java-real-time-strategy-game-development/3711744#3711744\">Scoping your indie game</a></li>\n<li><a href=\"http://stackoverflow.com/questions/2887465/c-header-and-implementation-files-what-to-include/2887555#2887555\">C++ headers, what to include</a></li>\n<li><a href=\"http://stackoverflow.com/questions/6204003/kill-a-process-by-looking-up-the-port-being-used-by-it-from-a-bat/6204329#6204329\">How to rock a batch file</a></li>\n<li><a href=\"http://stackoverflow.com/a/8100792/232593\">SRP Example</a></li>\n</ul>\n\n<p><a href=\"http://stackoverflow.com/badges/15/generalist?userid=232593\">256<sup>th</sup> Generalist</a> badge. It really should be gold :)</p>\n','0','0','0','82818');
