INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (283,101,'2012-03-01T20:04:39.433','derekhh','2012-06-29T18:23:51.400','null','Bellevue, WA, United States','<p>Currently I am a software engineer at Snap Inc.</p>\n\n<p>Previously I\'ve been working at Microsoft Bing for almost four years. During my years at Microsoft I was the primary back-end algorithm developer or tech lead for many features related to natural language processing and machine learning. I\'ve designed and implemented many core algorithms that powered Bing\'s conversational experience, question answering and entity carousel.</p>\n\n<p>Prior to joining Microsoft, I\'ve obtained my Ph.D. from the Hong Kong University of Science and Technology. My research was primarily on the theme of sensor-based human activity recognition. Throughout my PhD years, I\'ve published around 20 papers in top conferences and journals. I was also a winner of the Microsoft Research Fellowship in the year 2009.</p>\n\n<p>I also enjoy competitive programming a lot. I was a regular contestant in programming contests like acm/icpc, Google Code Jam and TopCoder Open. I\'ve also won awards and top prizes from these competitions.</p>\n\n<p>Google Scholar Page: <a href=\"https://scholar.google.com/citations?user=Ks81aO0AAAAJ&amp;hl=en\" rel=\"nofollow noreferrer\">https://scholar.google.com/citations?user=Ks81aO0AAAAJ&amp;hl=en</a></p>\n\n<p>Specialties: machine learning, data mining, algorithms, programming</p>\n','0','0','0','317381');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (285,101,'2012-03-02T18:52:08.590','Wayne Werner','2016-09-15T14:32:12.363','https://www.waynewerner.com','Greenwood, AR','<p>I\'m a husband to my beautiful wife, father to our children, Computer Science graduate from University of Central Arkansas. I love my wife, our children, computers, playing guitar (especially singing/playing for my wife and/or kids), bicycling (including taking my kids for rides in my bike trailer), woodworking, airbrushing, digital and traditional artistry, playing games with my family (traditional and digital), my poor Chevette that I had to sell, throwing knives, firearms, knot tying, rope making, whip making, and really just learning new stuff in general. If I don\'t know about it I probably want to learn about it, if only so I can make informed decisions about it.</p>\n\n<p><p>\nMy three favorite programming languages are Python, Lisp, and Assembly (though I\'m not sure about the order of those last two languages...).</p>\n\n<p>I think the CANSPAM act is one of the dumbest pieces of legislation in the history of the universe</p>\n\n<p>I love Python and HTML+Javascript.</p>\n\n<p>I\'m #SOreadytohelp (I really want a t-shirt, what can I say?)</p>\n','0','3','0','138991');
