INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (288,101,'2012-03-05T01:57:02.227','thiagobraga','2013-12-16T00:49:23.377','http://thiagobraga.org','Bauru, Brazil','<p>DevOps at Instituto Soma. Guitarist on <a href=\"http://facebook.com/sociopatabr\" rel=\"nofollow noreferrer\">Sociopata</a>, <a href=\"http://facebook.com/autoboneco\" rel=\"nofollow noreferrer\">Autoboneco</a>, <a href=\"http://facebook.com/venlift\" rel=\"nofollow noreferrer\">Venlift</a> and <a href=\"http://facebook.com/revel.hc\" rel=\"nofollow noreferrer\">Revel</a> from Brazil.</p>\n\n<p>Some of my experiences are:</p>\n\n<pre><code>- PHP, CodeIgniter, Laravel, WordPress\n- JavaScript, jQuery\n- CSS, LESS, SASS, Bootstrap\n- HTML5, SEO\n- Prototyping, Wireframing, UX, UI\n- Grunt, Gulp, Bower, Yeoman\n- MySQL, SQL Server, PostgreSQL\n- Apache, Nginx\n- Git, GitHub, Gitlab\n- Windows, GNU/Linux\n- VirtualBox, XenCenter, Docker\n</code></pre>\n','2','0','0','1104524');
