INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (316,188,'2012-03-15T13:19:26.060','bwDraco','2017-10-13T18:32:10.977','http://www.fierydragonlord.com/','New York, United States','\n\n<p>I\'m a computer and tech enthusiast with a variety of interests ranging from video games to fountain pens.</p>\n\n<p><strong>I stand behind everything I post here.</strong> If you find any problems with my posts, feel free to leave comments, edit them, or let me know in <a href=\"http://chat.stackexchange.com\">chat</a> if you have any questions or concerns.</p>\n\n<p>If you\'re curious about my <strong>answering style</strong>, it\'s inspired by the answers posted by <a href=\"http://scifi.stackexchange.com/users/2765/thaddeus-howze\">Thaddeus Howze ♦</a> at <a href=\"http://scifi.stackexchange.com/\">Science Fiction &amp; Fantasy</a>. <a href=\"http://chat.stackexchange.com/transcript/19572/2014/12/18\">This chat transcript</a> details why I made this change.</p>\n\n<p><strong>I\'m also one of the resident spam fighters on Super User and can catch spam others miss.</strong> If you suspect that one or more posts are spam, bring it up in the <a href=\"http://chat.stackexchange.com/rooms/114/ask-a-super-user-moderator\">Ask a Super User Moderator</a> chat room, and be sure to ping me—I\'m around most of the time. Don\'t forget to flag blatant spam—it takes just six spam flags from the community to delete it.</p>\n\n<blockquote>\n  <p>It sounds like flagging posts as spam isn\'t enough; they need to be flagged specifically to your attention (and what are the odds that you haven\'t already found it). —fixer1234 (<em><a href=\"http://chat.stackexchange.com/transcript/message/19250779#19250779\">source</a></em>)</p>\n</blockquote>\n\n<p>If you\'re wondering about <strong>my name</strong>, it used to be <strong>DragonLord</strong>, but I\'ve had to change it due to a bizarre trademark dispute. Feel free to call me <strong>Draco</strong> or by my real first name <strong>Brian</strong>.</p>\n\n<p>As an aside, I\'m a bit of a photo enthusiast. I shoot with Pentax eqiuipment, and you can find me on <a href=\"http://www.pentaxforums.com/forums/members/28598-dragonlord/\" rel=\"nofollow noreferrer\">Pentax Forums</a>.</p>\n\n<hr>\n\n<p><a href=\"https://stackexchange.com/users/347241\">\n<img src=\"https://stackexchange.com/users/flair/347241.png\" width=\"208\" height=\"58\" alt=\"profile for bwDraco on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for bwDraco on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n','0','3','0','347241');
