INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (321,101,'2012-03-15T20:11:14.663','Nicole','2012-03-15T20:11:14.663','http://nicolechaves.com','United States','<p><strong>Web/server/app software engineer.</strong></p>\n\n<p>Server (Java, PHP) and UI (JS, CSS)</p>\n\n<p>Designer and photographer on the side.</p>\n\n<p>I\'m a serial user of the double <code>__</code> space after a period &mdash; even though people tell me it\'s obsolete in the computer-world, I can\'t shake the habit from my 7th grade typing class.</p>\n\n<p><a href=\"https://stackexchange.com/users/80454853af1a4c75946da39043ee6b44\">\n<img src=\"https://stackexchange.com/users/flair/80454853af1a4c75946da39043ee6b44.png\" width=\"208\" height=\"58\" alt=\"profile for Nicole on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Nicole on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n','0','0','0','48256');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (322,261,'2012-03-15T22:36:51.583','Matt Fenwick','2017-08-28T20:46:20.593','null','USA','<p>Check out some of my work on github:</p>\n\n<ul>\n<li><p><a href=\"https://github.com/mattfenwick/NMRPyStar\" rel=\"nofollow noreferrer\"><strong>NMRPyStar</strong></a>: an API for accessing archived NMR data files in the NMR-Star format used by the BMRB.  </p></li>\n<li><p><a href=\"https://github.com/mattfenwick/Miscue-js\" rel=\"nofollow noreferrer\"><strong>Miscue-js</strong></a>: validation of JSON files to deal with obnoxious and tricky interoperability issues such as number overflows and duplicate keys</p></li>\n</ul>\n\n<p>Some cool technologies that I use:</p>\n\n<ul>\n<li>Python</li>\n<li>git</li>\n<li>Javascript</li>\n<li>Haskell</li>\n<li>Java</li>\n<li>MySQL</li>\n</ul>\n','11','15','2','480822');
