INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (334,101,'2012-03-20T19:05:36.870','jamuraa','2012-03-20T19:05:36.870','http://base0.net','San Francisco, CA, United States','<p>I work to make Bluetooth better at Google.</p>\n\n<p>Previous lives had me working on tiny robots and larger robots. My Ph.D involved working with those as well as Augmented Reality interfaces and simulating a bunch of robots using Qt GUIs, ROS, Player/Stage, and Android.</p>\n\n<p>I also develop Ruby on Rails applications and gems for fun and profit, tinker with electronics and blinky LED things.</p>\n\n<p>My current learning is Elixir &amp; Phoenix.</p>\n','0','1','0','5940');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (335,232,'2012-03-20T23:57:36.787','Refineo','2016-10-06T12:23:01.723','http://www.refineo.com','Warsaw, Poland','<p>Welcome to Refineo!</p>\n\n<p>With more then 8 years of experience in the area, <a href=\"http://www.refineo.com?origin=stackexchange.com\" rel=\"nofollow noreferrer\">Refineo.com</a> focuses on SAP® ERP Human Capital Management business consulting.</p>\n\n<p>Using Drupal for past projects, Refineo also supported and worked with the Drupal Stackexchange open community by:</p>\n\n<ul>\n<li>contributing Drupal patches and translations. </li>\n<li>helping to solve core and contributed modules\' <a href=\"http://drupal.org/user/1398214/track\" rel=\"nofollow noreferrer\">issues</a>.</li>\n<li>helping on drupal.stackexchange.com support forum.</li>\n</ul>\n\n<p>You can find more on <a href=\"http://drupal.stackexchange.com/users/2916/refineo\">Drupal Answers</a> and <a href=\"http://drupal.org/user/1398214/track\" rel=\"nofollow noreferrer\">drupal.org</a>.</p>\n\n<p>Join us on <a href=\"http://www.facebook.com/Refineo\" rel=\"nofollow noreferrer\">Facebook</a> and <a href=\"https://twitter.com/#!/Refineo\" rel=\"nofollow noreferrer\">Twitter</a>.</p>\n\n<p>SAP ERP, SAP ERP Human Capital Management are trademarks or registered trademarks of SAP AG in Germany and in several other countries.</p>\n\n<p>Drupal is a registered trademark of Dries Buytaert.</p>\n','9','17','0','904101');
