INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (344,101,'2012-03-23T09:51:37.947','NullPoiиteя','2013-10-07T05:52:24.380','http://tryonee.com','The Moon','<p>Web Developer for England based firm.</p>\n\n<blockquote>\n  <p><strong><em>All of us do not have equal talent, but all of us should have an equal opportunity to develop those talents.</em> - <em>J.F. Kennedy</em></strong></p>\n</blockquote>\n\n<p>I am <strong>Mayank K. Swami</strong> . You can contact me via my email( mayankkumarSwami(at)gmail.com) address or website and i hope you wont send me spam mail because that just go to spam folder :D</p>\n\n<p><a href=\"https://www.digitalocean.com/?refcode=2567b8948c2a\" rel=\"nofollow\">Digital ocean ref link</a></p>\n\n<blockquote>\n  <p><a href=\"http://i.stack.imgur.com/dGXUO.jpg\" rel=\"nofollow\">A</a> Good advice by <a href=\"http://chat.stackoverflow.com/transcript/message/5565018#5565018\"><strong>Gordon</strong></a> \n  If you want to become an expert programmer, google SOLID, buy GOF, buy POEAA, buy Clean Code, learn Refactoring, lookup GRASP, DDD, CQRS, DCI … but dont ask for PHP books. That\'s the most reasonable suggestion I can give you when you ask for Expert PHP books really.</p>\n  \n  <p>You may start from <a href=\"http://www.ustream.tv/recorded/22783515\" rel=\"nofollow\"><strong>This talk</strong></a> :\n  <a href=\"http://blog.ircmaxell.com/\" rel=\"nofollow\"><em>by</em> Anthony Ferrara</a> (<a href=\"http://stackoverflow.com/users/338665/ircmaxell\">ircmaxell</a>)</p>\n</blockquote>\n\n<p>I don\'t know how to star messages properly. I should be banned from the PHP room and Stack Overflow chat in general. I am a disgrace to myself, and my fellow PHP programmers.(:P:P and don\'t complain me LOL)</p>\n\n<hr>\n\n<blockquote>\n  <p>I am a website developer and a learning super freak. Recently I have been practicing GRASP and SOLID.</p>\n  \n  <p>If anybody want to connect to me, feel free to send me an email - for my email address  ping me in <a href=\"http://chat.stackoverflow.com/rooms/11/php\">PHP chat room</a> or <a href=\"http://chat.stackoverflow.com/rooms/29074/html-css-webdesign\">HTML/CSS/web design room</a> </p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p><a href=\"http://www.git-scm.com/book/en/Getting-Started-A-Short-History-of-Git\" rel=\"nofollow\">Getting Started with Git check this</a></p>\n  \n  <p><a href=\"http://www.vaughns-1-pagers.com/internet/google-ranking-factors.htm\" rel=\"nofollow\">SEO !== Meta tag</a></p>\n  \n  <p><a href=\"http://try.github.io/levels/1/challenges/1\" rel=\"nofollow\">Got 15 minutes and want to learn Git?</a></p>\n</blockquote>\n\n<hr>\n\n<p><a href=\"http://stackexchange.com/users/435935\">\n    <img src=\"http://stackexchange.com/users/flair/435935.png\" width=\"208\" height=\"58\" alt=\"mks\" title=\"Mayank\">\n    </a> </p>\n\n<p><img src=\"http://i.stack.imgur.com/hjtdv.png\" alt=\"enter\">\n<img src=\"http://i.stack.imgur.com/nOsRT.png\" alt=\"enter\">\n<img src=\"http://i.stack.imgur.com/xj99E.png\" alt=\"enter\"></p>\n\n<pre><code>---\n</code></pre>\n\n<p>I would always love to have cat currency</p>\n\n<p>I love <a href=\"http://catoverflow.com/\" rel=\"nofollow\">CatOverflow</a> and Cats.</p>\n\n<p>Useful Things </p>\n\n<ul>\n<li><a href=\"http://phpjs.org/functions/\" rel=\"nofollow\">http://phpjs.org/functions/</a></li>\n<li>awesome html/css/jquery tutorial <a href=\"http://www.codeschool.com/\" rel=\"nofollow\">http://www.codeschool.com/</a></li>\n<li>good php <a href=\"http://www.tuxradar.com/practicalphp\" rel=\"nofollow\">http://www.tuxradar.com/practicalphp</a> (by Gordon)</li>\n</ul>\n\n<hr>\n\n<hr>\n\n<p><a href=\"http://careers.stackoverflow.com/MayankSwami\"><strong>My Career Profile</strong></a> </p>\n\n<hr>\n\n<p><a href=\"http://placekitten.com/\" rel=\"nofollow\"><strong>Placekittan is awesome</strong></a> \n <a href=\"http://lorempizza.com/\" rel=\"nofollow\">http://lorempizza.com/</a></p>\n\n<p>profile image attribute <a href=\"http://greatinspire.com/40-beautiful-baby-images/\" rel=\"nofollow\">http://greatinspire.com/40-beautiful-baby-images/</a></p>\n','0','0','0','435935');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (345,101,'2012-03-23T15:11:29.730','P̲̳x͓L̳','2012-03-23T15:11:29.730','null','null','<h2>Contact</h2>\n\n<ul>\n<li><a href=\"https://www.google.com/recaptcha/mailhide/d?k=01s80ppwF_-P0BQJyXCtQKgQ==&amp;c=yUswkBpJ3Z5rE1CZ_WXY0kd_mmBijPKCfC_aKJG22Vw=\" rel=\"nofollow\">Email</a></li>\n<li><a href=\"https://cse.google.com/cse/publicurl?cx=003244590201325807660:n9e75rzb1aq&amp;q=l\" rel=\"nofollow\">LinkedIn</a></li>\n</ul>\n\n<p><strong>Interests</strong>\n<br />\n<a href=\"/questions/tagged/python\" class=\"post-tag\" title=\"show questions tagged &#39;python&#39;\" rel=\"tag\">python</a> <a href=\"/questions/tagged/linux\" class=\"post-tag\" title=\"show questions tagged &#39;linux&#39;\" rel=\"tag\">linux</a> <a href=\"/questions/tagged/java\" class=\"post-tag\" title=\"show questions tagged &#39;java&#39;\" rel=\"tag\">java</a> <a href=\"/questions/tagged/scala\" class=\"post-tag\" title=\"show questions tagged &#39;scala&#39;\" rel=\"tag\">scala</a><a href=\"/questions/tagged/c\" class=\"post-tag\" title=\"show questions tagged &#39;c&#39;\" rel=\"tag\">c</a>\n<br /> <br />\n<strong>Favourite tag</strong>\n<br />\n<a href=\"/questions/tagged/regex\" class=\"post-tag\" title=\"show questions tagged &#39;regex&#39;\" rel=\"tag\">regex</a></p>\n\n<p><code>#SOreadytohelp</code></p>\n','2','0','0','1347902');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (346,101,'2012-03-23T17:11:11.343','Dustin Kirkland','2012-03-23T17:11:11.343','http://blog.dustinkirkland.com','Austin, TX','<p>Dustin Kirkland is the VP of Product at <a href=\"http://canonical.com\" rel=\"nofollow noreferrer\">Canonical\'s</a>, leading the technical product strategy, road map, and life cycle of the <a href=\"http://ubuntu.com/cloud\" rel=\"nofollow noreferrer\">Ubuntu Cloud</a>, Server, Desktop, and IoT commercial offerings.</p>\n\n<p>Formerly the CTO of <a href=\"http://gazzang.com\" rel=\"nofollow noreferrer\">Gazzang</a>, a venture funded start-up acquired by <a href=\"http://cloudera.com\" rel=\"nofollow noreferrer\">Cloudera</a>, Dustin designed and implemented an innovative key management system for the cloud, called zTrustee, and delivered comprehensive security for cloud and big data platforms with <a href=\"http://ecryptfs.org\" rel=\"nofollow noreferrer\">eCryptfs</a> and other encryption technologies.</p>\n\n<p>Dustin is an active Core Developer of the <a href=\"http://ubuntu.com\" rel=\"nofollow noreferrer\">Ubuntu</a> Linux distribution, maintainer of 20+ open source projects, and the creator of <a href=\"http://byobu.co\" rel=\"nofollow noreferrer\">Byobu</a>, <a href=\"http://divitup.com\" rel=\"nofollow noreferrer\">DivItUp.com</a>, and <a href=\"http://linuxsearch.org\" rel=\"nofollow noreferrer\">LinuxSearch.org</a>.</p>\n\n<p>A Fightin\' Texas <a href=\"http://tamu.edu\" rel=\"nofollow noreferrer\">Aggie</a> Class of 2001 graduate, Dustin lives in Austin, Texas, with his wife Kim, daughters, and his Australian Shepherds, Aggie and Tiger. Dustin is also an avid <a href=\"http://ubrewtu.com\" rel=\"nofollow noreferrer\">home brewer</a>.</p>\n','0','0','0','223263');
