INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (355,1,'2012-03-28T21:18:18.553','Keith T Conroy','2012-03-29T02:10:02.743','null','Keith T Conroy','<p>Keith T Conroy</p>\n\n<p>Spent 2001-2008 buying and selling cigarettes in Fort Walton Beach, FL. Managed a small team promoting trumpets in the financial sector. Spent high school summers testing the market for corncob pipes in the government sector. Have some experience building foreign currency in Mexico. Spent two years selling easy-bake-ovens for the government. Spent 2001-2008 consulting about fried chicken in Suffolk, NY.</p>\n\n<p>Keith T Conroy</p>\n','2','0','0','1362104');
