INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (359,253,'2012-03-29T10:14:09.657','Andrew Grimm','2018-02-27T20:19:13.800','http://andrewjgrimm.wordpress.com/','Sydney, Australia','<p>I work at the University of New South Wales, where I use Ruby to analyze biological data.</p>\n\n<p>In part of my spare time, I work on fun programming projects. One was trying to analyze what underlies Wikipedia\'s <a href=\"http://en.wikipedia.org/wiki/Wikipedia:Get_to_Philosophy\" rel=\"nofollow\">Get to Philosophy</a> game. I also worked on one called the \"Small Eigen Collider\".</p>\n\n<p>I\'m currently learning Japanese, and I\'m an active participant in <a href=\"http://lang-8.com\" rel=\"nofollow\">lang-8.com</a>, a website where you write journal entries in a language you\'re learning, and get corrected by native speakers of that language. In return, you correct people writing entries in your native language. Recently, I\'ve been asking a few questions prompted by slightly incorrect English I\'ve encountered on lang-8.</p>\n','13','13','1','17355');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (360,101,'2012-03-29T10:26:51.607','cchana','2012-06-12T14:49:11.587','http://charanj.it','London, UK','<p>Web developer with an eye for beautiful things. I love UI/UX and code for both the front and back end of web sites and web applications. HTML, CSS, JS (jQuery), PHP &amp; MySQL are my tools.</p>\n\n<p>You can the various things I\'ve worked on below:</p>\n\n<ul>\n<li><a href=\"https://charanj.it\" rel=\"nofollow noreferrer\">Web development portfolio</a></li>\n<li><a href=\"https://thoughts.charanj.it\" rel=\"nofollow noreferrer\">Blog</a></li>\n<li><a href=\"https://charanj.it/cv/\" rel=\"nofollow noreferrer\">CV</a></li>\n</ul>\n','0','9','0','390492');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (362,101,'2012-03-29T11:19:14.973','balpha','2017-11-17T15:04:56.747','http://balpha.de/','Berlin, Germany','<p>My name is Benjamin Dumke-von der Ehe. I am <a href=\"http://blog.stackoverflow.com/2010/06/welcome-stack-overflow-valued-associates-00006-and-00007\">Stack Overflow Valued Associate #00007</a>, which is just a confusing way of saying that I work as a developer for Stack Overflow.</p>\n\n<p>I am <a href=\"http://twitter.com/balpha\" rel=\"nofollow noreferrer\">@balpha</a> on Twitter. My <a href=\"http://balpha.de/about/\" rel=\"nofollow noreferrer\">blog\'s \"about\" page</a> explains the origin of my user name.</p>\n\n<p>I am the creator of <a href=\"https://unicornify.pictures\" rel=\"nofollow noreferrer\"><em>Unicornify</em></a>, the service that gives you these lovable creatures:</p>\n\n<p><img src=\"https://unicornify.pictures/avatar/1?s=64\" alt=\"\"> <img src=\"https://unicornify.pictures/avatar/13?s=64\" alt=\"\"> <img src=\"https://unicornify.pictures/avatar/3?s=64\" alt=\"\"> <img src=\"https://unicornify.pictures/avatar/14?s=64\" alt=\"\"> <img src=\"https://unicornify.pictures/avatar/5?s=64\" alt=\"\"></p>\n\n<p>I also created <a href=\"https://bitbucket.org/balpha/lyfe\" rel=\"nofollow noreferrer\"><em>Lyfe</em></a>, a small library adding <code>yield</code>-based generators to JavaScript, and <a href=\"http://notarealquestion.appspot.com/\" rel=\"nofollow noreferrer\"><em>Not a Real Question</em></a>, a little game that\'s played with data from various Stack Exchange sites.</p>\n\n<p>I sometimes have a <a href=\"http://meta.stackexchange.com/questions/43418\">strange</a> <a href=\"http://stackoverflow.com/questions/2057400\">sense of</a> <a href=\"http://meta.stackexchange.com/questions/122781\">humor</a>,\nbut I also like to <a href=\"http://meta.stackexchange.com/a/74115\">explain</a> <a href=\"http://stackoverflow.com/a/2055144\">things</a> <a href=\"http://meta.stackexchange.com/a/75045\">I fix</a>, <a href=\"http://meta.stackexchange.com/a/128705\">break</a>, <a href=\"http://balpha.de/2012/07/an-unexcited-look-at-browser-sniffing\" rel=\"nofollow noreferrer\">care about</a>, or <a href=\"http://stackoverflow.com/a/11833858\">come up with</a>.</p>\n','0','0','0','40051');
