INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (384,101,'2012-04-09T18:53:19.630','Patrick Scott','2012-04-09T18:53:19.630','null','New York, United States','<p>Currently a senior at Wentworth Institute of Technology. Will graduate in August 2010 with a Bachelor of Science in Computer Science.</p>\r\n\r\n<p>I have also worked as a software engineer building enterprise size web applications using asp.net, c#, vb, jquery, javascript, xml, xslt, and css with a SQL Server backend for AIR-Worldwide.</p>\r\n\r\n<p>I have also worked as a programmer for the MBTA where I worked on their Capital Management System. And as a programmer/IT analyst for the Cole Hersee Co. where I developed internal web applications in asp.net.</p>\r\n\r\n<p>I spend the majority of my free time researching emerging technologies and have begun building a scalable social networking site in ASP.net MVC with several layers of abstraction. Including use of IoC, dependency injection, and ORMs (Entity Framework).</p>\r\n\r\n<p>I am very interested in learning about highly scalable web applications and the use of NOSQL databases.</p>','0','0','0','85182');
