INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (448,483,'2012-05-07T20:42:12.580','E1Suave','2016-01-10T21:53:31.950','http://history.stackexchange.com/users/837/e1suave?tab=answers','null','<h1>Systems Administrator</h1>\n\n<p>School district</p>\n\n<hr>\n\n<p><strong>Custom Macintosh management via BASH, AppleScript/osascript</strong></p>\n\n<ul>\n<li>Fully automated Environment/Template management\n<ul>\n<li>Sync systems based on specific Environment</li>\n<li>Deployment of updates (OS &amp; 3rd party)</li>\n</ul></li>\n<li>Implement restrictions/additions based on\n<ul>\n<li>Network User</li>\n<li>Template</li>\n<li>Environment</li>\n<li>Network</li>\n<li>Hardware</li>\n</ul></li>\n<li>Snapshot management (Server)\n<ul>\n<li>Creating new Environments</li>\n<li>Updating old Environments</li>\n</ul></li>\n</ul>\n\n<p><strong>10,000 + Macintosh machines being managed by CMEM Envi</strong></p>\n\n<ul>\n<li>10.4.x (NO LONGER IN USE)</li>\n<li>10.5.x</li>\n<li>10.6.x</li>\n<li>10.7.x</li>\n<li>10.8.x</li>\n<li>10.9.x (Ported to JAMF)</li>\n</ul>\n\n<p>I have since ported all of my custom scripts, concepts &amp; logic to JAMF as either Extension Attributes, Custom Profile Templates or Policies. It was an awesome run and I am proud to say that my work is still being used elsewhere, but at this point there isn\'t any reason not to use and promote the JAMF product. It truly is an incredible product with no limits.</p>\n\n<hr>\n\n<p><a href=\"http://stackexchange.com/users/1385682/e1suave\"><img src=\"http://stackexchange.com/users/flair/1385682.png\" width=\"208\" height=\"58\" alt=\"profile for E1Suave on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for E1Suave on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n','10','84','28','1385682');
