INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (469,101,'2012-05-15T09:32:13.190','Mahavir Munot','2012-05-15T09:32:13.190','http://www.addedbits.com/','India','<blockquote>\n  <p>I\'m Mahavir, a Web Developer, Blogger, Web Technology Trainer and\n  Website Consultant. Currently working for <a href=\"http://www.persistent.com/\" rel=\"nofollow noreferrer\">Persistent System Ltd</a>\n  at Hinjewadi(Pune), India. I have a genuine passion and enthusiasm for\n  Web development, with particular interests in all elements of Website\n  Usability. I love to help small businesses to improve their online\n  presence with the help of Web Development and Search Engine Optimization (SEO) skills.</p>\n  \n  <p>My area of expertise includes, back end programming (PHP, Python,\n  NodeJs) to front end engineering (HTML, CSS, and\n  jQuery/Javascript/AngularJS), user experience and visual design.</p>\n  \n  <p>Besides web development, I enjoy spending my time with my family and\n  friends.</p>\n  \n  <p>To know more about my profession, click on the below linkedin image:</p>\n</blockquote>\n\n<p><a href=\"https://in.linkedin.com/pub/mahavir-munot/14/372/470\" rel=\"nofollow noreferrer\" title=\"View Mahavir Munot\'s profile on LinkedIn\"><img src=\"https://static.licdn.com/scds/common/u/img/webpromo/btn_myprofile_160x33.png\" alt=\"View Mahavir Munot\'s profile on LinkedIn\"/></a></p>\n','0','0','0','1357178');
