INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (475,123,'2012-05-16T22:59:08.650','Kirk Woll','2017-11-22T01:56:37.910','http://www.xohoops.com','California','<p>Shouldn\'t you be reading something more interesting? :p</p>\n\n<p>Other than hanging out with my cats and flying small airplanes, in my free time I like to work on my fantasy basketball site, XoHoops (if you like a keeper league / simulation-based fantasy basketball site, please <a href=\"http://www.xohoops.com\" rel=\"nofollow noreferrer\">join</a>!).</p>\n\n<p>Currently, I\'m employed as the manager for the Windows team at <a href=\"http://www.plangrid.com/en\" rel=\"nofollow noreferrer\">PlanGrid</a>.  If you want a job at an amazing company programming in C# (who wouldn\'t?) then hit me up! :)</p>\n\n<p>Also, author of <a href=\"https://github.com/kswoll/WootzJs/\" rel=\"nofollow noreferrer\">WootzJs</a>, a C# to Javascript cross-compiler and <a href=\"https://github.com/kswoll/ReactiveUI.Fody\" rel=\"nofollow noreferrer\">ReactiveUI.Fody</a>, a Fody plugin that generates the necessary boiler-plate when using <a href=\"https://github.com/reactiveui/ReactiveUI\" rel=\"nofollow noreferrer\">ReactiveUI</a>.</p>\n\n<p><a href=\"https://twitter.com/kirkwoll\" rel=\"nofollow noreferrer\">@kirkwoll</a> on Twitter.</p>\n\n<p>I also occasionally <a href=\"http://randomencoding.tumblr.com\" rel=\"nofollow noreferrer\">blog</a>.</p>\n','0','2','0','64324');
