ativa pentru modificarea si completarea Legii nr.188/1999 privind Statutul functionarilor publici\nInitiatori:\n<strong>Ovidiu Silaghi</strong>, <strong>Ovidiu Silaghi</strong>, <strong>Ovidiu Silaghi</strong>\nTrimis la Camera pentru dezbatere\nL425/2011\nPropunere legislativa privind cooperarea României cu Oficiul European de Politie (Europol)\nInitiatori:\n<strong>Ovidiu Silaghi</strong>, <strong>Ovidiu Silaghi</strong>, <strong>Ovidiu Silaghi</strong>, <strong>Ovidiu Silaghi</strong></p>\n\n<p><a href=\"http://www.arad-imobiliare.ro/forum/viewtopic.php?f=5&amp;t=209\" rel=\"nofollow\">Ovidiu Silaghi</a></p>\n','1','0','0','1626689');
