INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (699,101,'2012-08-08T06:40:32.603','mrsrinivas','2012-08-08T06:40:32.603','http://mrsrinivas.com','India','<p>I\'m currently working in the <a href=\"/questions/tagged/big-data\" class=\"post-tag\" title=\"show questions tagged &#39;big-data&#39;\" rel=\"tag\">big-data</a> space with technologies such as <a href=\"/questions/tagged/apache-spark\" class=\"post-tag\" title=\"show questions tagged &#39;apache-spark&#39;\" rel=\"tag\">apache-spark</a> <a href=\"/questions/tagged/hadoop\" class=\"post-tag\" title=\"show questions tagged &#39;hadoop&#39;\" rel=\"tag\">hadoop</a> <a href=\"/questions/tagged/hive\" class=\"post-tag\" title=\"show questions tagged &#39;hive&#39;\" rel=\"tag\">hive</a> <a href=\"/questions/tagged/scala\" class=\"post-tag\" title=\"show questions tagged &#39;scala&#39;\" rel=\"tag\">scala</a>. Always eager to learn, and happy to teach what I know. </p>\n\n<p>I\'ve joined the StackExchange network in an effort to improve my knowledge and also help others get the answers they\'re looking for. <strong>Few of my posts which I enjoyed answering them.</strong></p>\n\n<p><a href=\"http://stackoverflow.com/questions/24909958/spark-on-yarn-concept-understanding/38598830#38598830\">Spark on yarn concept of understanding</a> <br>\n<a href=\"http://stackoverflow.com/questions/40510851/what-is-the-relationship-between-hive-and-mapreduce/40510986#40510986\">Hive and MapReduce relation</a> <br>\n<a href=\"http://stackoverflow.com/questions/40732962/spark-rdd-in-memory-is-it-ram/40733821#40733821\">Spark RDD in-memory</a> <br></p>\n\n<p><a href=\"http://stackoverflow.com/questions/26311776/why-iteration-through-double-linked-buckets-in-linkedhashmap-is-faster-than-iter/32815682#32815682\">Java - Why iteration over LinkedHashMap is fast</a> <br>\n<a href=\"http://stackoverflow.com/questions/2423622/volatile-vs-static-in-java/33413884#33413884\">Volatile Vs Static in java</a> </p>\n\n<p><a href=\"http://stackoverflow.com/questions/4948322/fundamental-difference-between-hashing-and-encryption-algorithms/10053109#10053109\">Security: Fundamental difference between Hashing and Encryption</a></p>\n','0','0','0','1366348');
