INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (723,101,'2012-08-16T11:40:11.623','tricasse','2012-08-16T11:40:11.623','http://corbasson.fr/','Paris, France','<p>I\'m an <a href=\"http://en.wikipedia.org/wiki/Enterprise_architecture\" rel=\"nofollow\">enterprise architect</a> working for several years for big companies in France and abroad, with a MS in Information Systems and a MBA.</p>\n\n<p>During my studies, I used to work (among other jobs) as a software engineer, and still have some knowledge I can <a href=\"http://superuser.com/\">put to work</a> and <a href=\"http://stackoverflow.com/\">share</a> :)</p>\n\n<p>In my spare time, I like to <a href=\"http://travel.stackexchange.com/\">travel</a>, learn languages, kayak, and do plenty of other things.</p>\n\n<p><img src=\"http://www.traveltip.org/pix/visited_countries.php?ct=afkgtimotsgpanaubedafifrgmgritlslumnnlrospswszuksatuuzcaus&amp;u=1\" width=\"420\"></p>\n','0','0','0','1525541');
