INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (747,101,'2012-08-26T07:05:38.547','Krease','2015-05-18T20:42:24.893','http://none','Vancouver, Canada','<p>I\'m a Software Developer with experience in (among other things) Java, Eclipse, Crystal Reports, Amazon-AWS (DynamoDB, SWF, S3, SQS, SNS, Kinesis, etc), Javascript, SQL, Ruby/Rails, iOS/Objective-C. </p>\n\n<p>I\'m also \n<li>a parent of 3 young kids,</li>\n<li>a huge NHL fan, </li>\n<li>a Marvel comic nerd, </li>\n<li>into music from Abba to ZZ Top (and everything in between), and </li>\n<li>a strategy game lover</li></p>\n\n<p><a href=\"http://stackexchange.com/users/444416\">\n<img src=\"http://stackexchange.com/users/flair/444416.png\" width=\"208\" height=\"58\" alt=\"profile for Chris on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Chris on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<p>I also have super powers, but that\'s a secret.</p>\n','0','0','0','444416');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (748,101,'2012-08-26T14:54:04.540','Mageek','2012-08-27T08:09:49.730','null','null','<p>Check out my new app: iCan\'t Choose, on the play store.</p>\n\n<p>Languages:</p>\n\n<ul>\n<li>JS</li>\n<li>HTML</li>\n<li>PHP</li>\n<li>CSS</li>\n<li>HTACCESS</li>\n<li>SQL</li>\n<li>Java</li>\n</ul>\n\n<p>Others:</p>\n\n<ul>\n<li>MySQL</li>\n<li>PDO</li>\n<li>AJAX</li>\n</ul>\n\n<p>Learning:</p>\n\n<ul>\n<li>Python</li>\n<li>C++</li>\n<li>Objective C</li>\n</ul>\n\n<p>I hate when someone asks something in javascript without mentionning jQuery and then people give jQuery code: <a href=\"http://i.stack.imgur.com/iT4io.gif\" rel=\"nofollow\">http://i.stack.imgur.com/iT4io.gif</a></p>\n','1','0','0','1420139');
