INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (753,5049,'2012-08-29T05:20:36.517','Sports Fan','2018-03-06T06:24:56.110','http://www.ihavenowebsite.in','Chennai, India','\n\n<p>If India didn\'t get divided in 1947, Indian National team now will be as below,</p>\n\n<p>Shikar Dhawan<br>\nMohammed Hafeez<br>\nVirat Kohli<br>\nMushfiqur Rahim<br>\nMahendra Singh Dhoni*†<br>\nSakib Al Hassan<br>\nRavindra Jadeja<br>\nShahid Afridi<br>\nBhuvneshwar Kumar<br>\nSaeed Ajmal<br>\nMohammad Irfan</p>\n\n<p><strong>Sub</strong><br>\nAjinkya Rahane<br>\nAnamul Haque<br>\nUmar Akmal<br>\nJunaid Khan<br>\nMohammad Shami</p>\n\n<p><strong>Can anyone Predict?</strong> </p>\n\n<blockquote>\n  <p><em>Who will win the match if these two teams meet each other?</em></p>\n</blockquote>\n\n<pre><code>     TEAM A                         TEAM B\n    C Gayle                       G Gambhir\n    M Hafeez                      S Watson\n    M Jayawardane                 V Kholi\n    E Morgan                      B McCullum\n    MS Dhoni(C)                   AB Devillers(C)\n    S Smith                       Y Singh\n    S Al-Hassan                   S Afridi\n    R Jadeja                      K Pollard\n    D Steyn                       M Morkel\n    M Johnson                     L Malinga\n    S Narine                      S Ajmal\n</code></pre>\n','538','930','101','394477');
