INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (759,131,'2012-09-01T17:16:43.147','fommil','2017-10-16T17:53:39.397','http://careers.stackoverflow.com/fommil','London, United Kingdom','<p>Co-founder of the Free High School Science Textbooks: now being taken forwards by Siyavula.com. As of May 2012, the South African government has printed and distributed 4,424,500 of our books to every registered learner in the country between the ages of 13 and 16.</p>\n\n<p>I am also co-founder of ThinkTank Maths Limited: a mathematics research organisation which provides innovative solutions to blue chips.</p>\n\n<p>I have a Ph.D. in mathematical physics, an M.Sc. in theoretical physics and a B.Sc. (with Honours) in Physics with Astrophysics.</p>\n\n<p>I am the author of several open source projects, including: netlib-java and matrix-toolkits-java.</p>\n\n<p>My preferred programming languages are Scala, Java and R and many people comment on the fact that I touch type on a DVORAK keyboard.</p>\n','2','1','0','1033919');
