INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (765,123,'2012-09-04T06:50:06.613','1.21 gigawatts','2016-01-25T00:23:17.683','null','California','<p>How much?  <a href=\"http://www.youtube.com/watch?v=I5cYgRnfFDA\" rel=\"nofollow\">http://www.youtube.com/watch?v=I5cYgRnfFDA</a></p>\n\n<p>Before commenting on a post:  </p>\n\n<p>• Almost all of my questions use fictional scenarios because 90% of the time my questions have much different requirements than normal. </p>\n\n<p>• If it sounds like I\'m asking for a library I\'m asking how to accomplish something. If that\'s with a library or a code snippet. </p>\n\n<p>• Sometimes I\'ll post a question and someone marks the question \"didn\'t research. found on Google\". No, I did research but the answer was insufficient, I couldn\'t find what you found or the answer didn\'t exist on SE. Usually it\'s both insufficient and isn\'t on SE. One day, I visited ten sites in Google search results that were down and I couldn\'t find the information I was looking for. I noticed a pattern. Sites seem to last 5 to 10 years. Some are here one day and gone the next. So occasionally I\'ll post questions for posterity because most likely I\'ll need to reference that answer again ...and I have had to go back to past questions in the past. Yes, the answer may exist somewhere else but in my defense Stack Exchange recommends writing full responses to questions rather than linking to other sites for this exact same reason. </p>\n\n<p>If you\'re going to criticize my questions just move on. Don\'t even comment. </p>\n\n<p>Languages:\nFlex, Flash, AS3, AIR, PHP, JS, ASP, JSP, Java, .NET, etc</p>\n','1','1','0','197142');
