INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (778,101,'2012-09-10T07:15:50.013','Sahil Mahajan Mj','2013-01-30T12:09:19.997','http://sahilmahajanmjprofile.blogspot.in/','Gurgaon, India','<p><a href=\"http://stackexchange.com/users/1785297/sahilmahajanmj\"><img src=\"http://stackexchange.com/users/flair/1785297.png\" width=\"208\" height=\"58\" alt=\"profile for SahilMahajanMj on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for SahilMahajanMj on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a> Check my <a href=\"http://careers.stackoverflow.com/sahilmahajanmj\">CV on Careers</a></p>\n\n<p><strong>Gtalk-</strong> sahilmahajanmj@gmail.com</p>\n\n<p><a href=\"http://www.facebook.com/Sahilmahajanmj\" rel=\"nofollow\">Facebook Profile</a> || <a href=\"http://sahilmahajanmjprofile.blogspot.in/\" rel=\"nofollow\">Something About Me</a> || <a href=\"https://plus.google.com/114392922732864308439\" rel=\"nofollow\">Google+ Profile</a></p>\n\n<p>I have done B.Tech in Computer Science and Engineering. Currently I am working as Assistant System Engineer for Tata Consultancy Services.</p>\n\n<hr>\n\n<p>When I am at work, I Love 3 things-</p>\n\n<p><strong><em>Coding</em></strong>   ||   <strong><em>Cofee</em></strong>   ||   <strong><em>Interacting with Stack Exchange Community</em></strong></p>\n\n<p><em>When I am not coding, I do play cricket, badminton, EA Sports, watch lot of movies. In my free time, I could be found hanging out with friends. I hate getting bored.</em> </p>\n\n<h2>My quotes for life is:</h2>\n\n<ul>\n<li><p>I’d rather live with a good question than with a bad answer.</p></li>\n<li><p>I own me, and therefore, I can engineer me. I am me, and I am okay. I never really look for anything. What God throws my way. I wake up in the morning and whichever way God turns my feet, I go.</p></li>\n<li><p>I would love to help anyone, who might need a concern from me. So if you think, you can get something from my part, you are free to ask.</p></li>\n</ul>\n','0','5','0','1785297');
