INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (816,101,'2012-09-26T14:11:58.030','Steven Drennon','2015-01-07T20:25:00.977','http://www.drennon.com','San Antonio, TX','<p>Steven R. Drennon was born in Lawton, OK, where he first started writing at the age of 15. He published an epic fantasy novel titled \"Rise of the Raven\" in the spring of 2011, and another fantasy novel titled \"Three for Avadar\" was released in the summer of 2011. Since then, Steven has published a total of 37 other titles under different pen names, and he is currently working on a new historical fiction series that will be published under his own name.</p>\n','0','0','0','507978');
