INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (818,101,'2012-09-26T19:02:46.657','Chris Okyen','2012-09-26T23:53:47.963','null','null','<p>Programmer Hobbysist, who\'s decently acquainted with C and C++. Dabbled in SDL and OpenGL with these languages. Experimented with Python. Perfecting Java and getting my feet lightly dipped into Android Development using Java.</p>\n','0','0','0','1565318');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (819,101,'2012-09-27T01:47:30.200','Bill the Lizard','2017-10-29T01:01:23.117','http://www.BillTheLizard.com','Charlotte, NC','<p><strong>Python</strong>, <strong>Java</strong>, <strong>Android</strong>, etc. developer living in Charlotte, NC.<br/></p>\n\n<p>I am the author of <a href=\"https://twitter.com/BountyBot\" rel=\"nofollow noreferrer\"><strong>@BountyBot</strong></a>, a Twitter bot that posts new and interesting bounty questions from Stack Overflow. You can <a href=\"https://github.com/BillCruise/BountyBot\" rel=\"nofollow noreferrer\">view the source on GitHub</a>.</p>\n\n<p><strong>My Android apps on Google Play:</strong></p>\n\n<ul>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.threeofakind&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Three of a Kind</strong></a> - A fun, fast-paced strategy card game. Match any three symbols to win.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.sketchboard&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Sketchboard</strong></a> - Sketch drawings on your mobile device.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.serpent&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Serpent</strong></a> - An Android version of the classic mobile game Snake.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.mathblitz&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Math Blitz!</strong></a> - A fast-paced flashcard game to help students practice their arithmetic skills.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.linearinterpolator&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Linear Interpolator</strong></a> - Fill in the gaps in your data using linear interpolation.</li>\n<li><a href=\"https://play.google.com/store/apps/details?id=com.billthelizard.kitchencalculator&amp;hl=en\" rel=\"nofollow noreferrer\"><strong>Kitchen Calculator</strong></a> - A simple unit converter for common units used in cooking and homebrewing.</li>\n</ul>\n\n<p>If you use any of these apps, please leave me a rating and any feedback for improvement.</p>\n','0','1','0','970');
