INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (874,139,'2012-10-21T19:49:34.957','Soner Gönül','2017-10-27T21:39:37.693','http://www.sonergonul.net','Istanbul, Turkey','<p>If you like my answers, <a href=\"https://www.buymeacoffee.com/sonergonul\" rel=\"nofollow noreferrer\">you can buy me a coffee</a>.</p>\n\n<p><a href=\"https://i.stack.imgur.com/dTsus.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/dTsus.png\" alt=\"enter image description here\"></a></p>\n','3','14','0','200982');
