INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1130,1,'2013-02-22T03:42:38.857','vijay sorathiya','2013-02-22T03:42:38.857','http://vijaysorathiya.blogspot.in/2013/04/1-introduction-how-to-make-online.html','Gondal, India','<p><a href=\"http://vijaysorathiya.blogspot.in/2013/04/1-introduction-how-to-make-online.html\" rel=\"nofollow\">http://vijaysorathiya.blogspot.in/2013/04/1-introduction-how-to-make-online.html</a></p>\n\n<p>Learn almost anything for free.</p>\n\n<p>If you have any skill and like to teach, trust me, someone is wanting to learn from you right now, and in many cases, even willing to pay for it.</p>\n\n<p>Last 1.9 year I made over 4565000rs./ $83,000 US selling one course alone (This One). In this course you\'ll learn with all detail exactly how I made that happen so you can do the same.</p>\n\n<p>I have decided to make this training FREE. So All curious and skilled people can be trainer and say entrepreneur and make money and fame like khan academy, lynda.com, Pinal dave, www.hanselman.com  .Why I do charity because now I am satisfied with this amount of money. and I am planning to make new trainings to sale. </p>\n\n<p>I will teach you how to create your own online course, make it look awesome, promote it, sell it, and make money with it.\nSounds good? </p>\n\n<p>well here is exactly what we will cover:</p>\n\n<p>Getting started: how to break down your course, all the tools you can use to create a course, and how to make it interesting so people actually listen!</p>\n\n<p>Creating a great course: I\'ll teach you how to create a super cool presentation using Keynote</p>\n\n<p>Recording your course: once you create your presentation you need to record it. I\'ll teach you how to use ScreenFlow for Mac to record your computer screen and yourself and how to edit it all together.</p>\n\n<p>How to promote your course: once you have created your course it is time world know it exists! I\'ll teach you the most efficient ways to promote your course and find students.</p>\n\n<p>Making money selling your course: how much to charge for your course? I\'ll teach you how to create a great sales page for your course, how to use PayPal to make money selling your course, finding affiliates, and much more!\nJust like you I have invested zillions of dollars and many years educating myself, learning new skills. It\'s time to share that hard earned knowledge with the world and creating an online course is one of the best ways to do so, reach thousands of people and why not make some money on the side.</p>\n\n<p>Are you ready? Let\'s do it!</p>\n\n<p><a href=\"http://vijaysorathiya.blogspot.in/2013/04/1-introduction-how-to-make-online.html\" rel=\"nofollow\">http://vijaysorathiya.blogspot.in/2013/04/1-introduction-how-to-make-online.html</a></p>\n','1','0','0','2400050');
