INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1134,1,'2013-02-24T06:38:56.573','Online Selenium Trainer','2013-02-24T06:38:56.573','http://onlineseleniumtraining.com/','Adelaide, Australia','<p>Hello QA World</p>\n\n<p>I am going to introdusing new way of learning selenium with expert. We have selenium automation experts who have 6+ year of experience in Automation testing. They work for Australia  based company as Indepened QA. We love to work with our students so they can work with others.</p>\n\n<p>Get fast and cost effective training at a place that is convienient to you. Travelling to a classroom to take a training course takes time and costs money. Learning in a classroom with others means that you have to learn at their pace.Do you want to achieve the BEST training and qualifications? </p>\n\n<p>Now come to the course outline</p>\n\n<ol>\n<li>Selenium IDE basics.</li>\n<li>Learn core JAVA</li>\n<li><p>Learn HTML and JavaScript basics</p></li>\n<li><p>Learn Junit 4 Framework</p></li>\n<li>Learn TestNg Framework </li>\n<li><p>Learn how to work with ANT?</p></li>\n<li><p>Selenium RC basics till Advance Level.</p></li>\n<li><p>Selenium WebDriver basics till Advance Level.</p></li>\n<li><p>Flash (Flex) Testing.</p></li>\n<li><p>Database Testing.</p></li>\n<li><p>Learn Apache Maven</p></li>\n<li>Learn Subversion (SVN)</li>\n<li><p>Continuous integration and build automation</p></li>\n<li><p>Learn Applet Testing with Selenium</p></li>\n<li>Learn Page Object Model (POM)</li>\n<li>Learn Data Driven Framework using TestNG - Selenium WebDriver</li>\n<li>Learn  Hybrid (Keyword+Data) Framework using TestNG - Selenium WebDriver</li>\n<li>Learn Data Driven Framework using jUnit - Selenium WebDriver</li>\n<li><p>Learn  Hybrid (Keyword+Data) Framework using jUnit - Selenium WebDriver</p></li>\n<li><p>Learn Data Driven Framework using TestNG - Selenium RC</p></li>\n<li>Learn  Hybrid (Keyword+Data) Framework using TestNG - Selenium RC</li>\n<li>Learn Data Driven Framework using jUnit - Selenium RC</li>\n<li><p>Learn  Hybrid (Keyword+Data) Framework using jUnit - Selenium RC</p></li>\n<li><p>Selenium GRID</p></li>\n<li><p>Learn How to automate Silverlight applications using Selenium</p></li>\n<li>Learn How to automate jQuery based applications using selenium</li>\n<li><p>Learn How to automate Ajax based application using selenium</p></li>\n<li><p>Learn Testing SAP Portal applications with Selenium</p></li>\n<li><p>Learn Testing Your Oracle ADF Faces Application with Selenium</p></li>\n<li><p>Learn Android Browser Testing with Selenium</p></li>\n<li><p>Test Mobile Webapps with Selenium 2 </p></li>\n<li>Mobile Testing with Selenium 2</li>\n<li>Testing Your Mobile Apps with Selenium 2 </li>\n<li><p>iPhone and iPad Selenium Testing with Webdriver</p></li>\n<li><p>html5 selenium testing</p></li>\n</ol>\n\n<p>Get Full/Detailed course content >> \nWWW.ONLINESELENIUMTRAINING.COM</p>\n\n<p>www.seleniumonlinetrainingexpert.wordpress.com</p>\n\n<p>Contact\nseleniumonlinetrainingexpert@gmail.com</p>\n','0','0','0','1697025');
