INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1188,1,'2013-03-15T17:32:05.270','jay bee','2013-03-27T02:38:54.530','null','Whitehorse, Yukon','<p>I\'m learning how to program and use a Parallax Propeller to implement a boiler control system for my house (outdoor reset with propoportional, integral and derivative control). It may seem like overkill but it will enable me to share my knowledge with my 11 year son.  When I was a kid heathkits were the things to build, now it\'s microprosessor based stuff and the propeller seems like the coolest chip on the block.</p>\n\n<p>Bob Dylan went electric in \'65, I went electric at 55 to keep up with the boy and like all good electric guitar players, tube amps rule so that is another area of interest.</p>\n','0','0','0','2479798');
