INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1192,101,'2013-03-16T12:53:30.587','Anonymous Mohit','2014-09-26T19:37:17.327','null','Allahabad, India','<blockquote>\n  <h3>Know Me, Know Life</h3>\n  \n  <h3>No Me, No Life</h3>\n</blockquote>\n\n<hr>\n\n<p>Working as a <code>ASP.NET</code> and <code>Android Developer</code>, Have reasonable experience with <code>PHP web development.</code></p>\n\n<p><code>Coding is my passion</code>, whether it is hardware or software.</p>\n\n<p>I am for sustainability, trying as best as possible to create and innovate to make how I live productive so the future generations can live without fear of a non sustainable future.</p>\n\n<p>Stack Overflow makes me a better programmer while I can offer my own help to make others better programmers.</p>\n\n<hr>\n\n<p>Last but not the least</p>\n\n<ul>\n<li>I am a common man. Just, another common man. And now, </li>\n<li>I wont sit quiet, I will do whatever I can...</li>\n<li>I cannot reach publications, I will create my own way of publicity, </li>\n<li>I cannot reach their government, I will make sure, my message is reached. </li>\n<li>I cannot make my future anymore but, this is not the future, I will give to my future generation.</li>\n<li>I am a hacker and nothing can compromise me, not any more...</li>\n<li>I will fight, I will destroy, I will hit and hit it hard, where it hurts the most; </li>\n<li>I am not a Warrior with Guns but Brains, I am called, an `Indian Cyber</li>\n</ul>\n','0','0','0','1256349');
