INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1273,101,'2013-04-11T05:30:52.717','Inder Kumar Rathore','2013-04-11T05:30:52.717','https://www.mizcoin.com','Gurgaon, Haryana, India','<p>Develops mobile applications (primarily iOS), manages mobile team at Aspiring Minds.<br><br></p>\n\n<p>Open source work <a href=\"https://github.com/InderKumarRathore\" rel=\"nofollow noreferrer\">https://github.com/InderKumarRathore</a><br>\nLinkedIn profile <a href=\"https://in.linkedin.com/in/InderKumarRathore\" rel=\"nofollow noreferrer\">https://in.linkedin.com/in/InderKumarRathore</a></p>\n\n<p>Email : <strong>rathore619[at]gmail[dot]com</strong><br>\nPlease read <a href=\"http://stackoverflow.com/users/22656/jon-skeet\">Jon Skeet</a>\'s blog post on <a href=\"http://codeblog.jonskeet.uk/2012/08/22/stack-overflow-and-personal-emails/\" rel=\"nofollow noreferrer\">Stack Overflow-related emails</a> first.</p>\n\n<p>Blogs</p>\n\n<ol>\n<li><a href=\"http://objective-c-properties.blogspot.in\" rel=\"nofollow noreferrer\">Property in Objective - C</a>\n<br></li>\n</ol>\n','2','0','0','214637');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1274,101,'2013-04-11T22:52:42.883','Christopher Painter','2017-10-27T14:57:47.063','http://www.iswix.com','Austin, TX','<p>I am an IT Architect with expertise in Application Life Cycle Management.  Specifically, Microsoft TFS, C#, Windows Installer (MSI), InstallShield and WiX technologies.  Additionally I am the author of the <a href=\"http://www.iswix.com/blog\" rel=\"nofollow noreferrer\">ISWIX</a> Blog and the Industrial Strength Windows Installer XML (<a href=\"https://github.com/iswix-llc/iswix\" rel=\"nofollow noreferrer\">IsWiX</a>) project on GitHub.  </p>\n\n<p>Additionally, I have strong skills in Build Automation ( NAnt, MSBuild, TFS, BuildForge ), .NET/C# Development, Network Administration. Systems Administration and Systems Engineering.  Chances are if you can name it, I\'ve done it for many organizations including: </p>\n\n<p>United States Marine Corps</p>\n\n<p>The Home Depot</p>\n\n<p>Electronic Data Sytems</p>\n\n<p>Textron Systems</p>\n\n<p>Continental Airlines</p>\n\n<p>Robbins-Gioia,</p>\n\n<p>McAdams Technologies, </p>\n\n<p>Triangle Technology</p>\n\n<p>Hart InterCivic</p>\n\n<p>Manatron</p>\n\n<p>MultiMedia Games</p>\n\n<p>NoMoreForms</p>\n\n<p>RicherDevelopment</p>\n\n<p>VistaSG</p>\n\n<p>SouceSentry</p>\n\n<p>SANtools </p>\n\n<p>OnnX</p>\n\n<p>KelRad Software</p>\n\n<p>Liveware Publishing</p>\n\n<p>ReHab Documentation</p>\n\n<p>Macheen</p>\n\n<p>IJJC</p>\n\n<p>RatchetSoft</p>\n\n<p>RiskServers SA</p>\n\n<p>WordRake</p>\n\n<p>Dr. Energy Saver</p>\n\n<p>Front Range Solutions</p>\n\n<p>Intelligent Systems Support</p>\n\n<p>EPIS</p>\n\n<p>Event Driven</p>\n\n<p>ExtendASP</p>\n\n<p>...and many other clients who prefer to remain annonymous. </p>\n\n<p>Please feel free to check out my <a href=\"http://www.linkedin.com/in/christopherpainter\" rel=\"nofollow noreferrer\">LinkedIn Profile</a>.</p>\n','0','0','0','68967');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1275,178,'2013-04-12T03:22:09.133','Roflo','2018-03-06T17:13:31.470','http://rpg20.com/','Mexico','<p>I run.</p>\n\n<p>Not because I want to lose weight. Not because I want to be in shape. Not because I\'m good at it (I\'m not). Not because everybody\'s doing it. Not because I want to break records.</p>\n\n<p>I just run.</p>\n\n<p>Maybe because it\'s a time for reflection. Maybe because it helps me relax. Maybe because it just feels good. Maybe because I sleep better at night.</p>\n\n<p>I run.</p>\n','6','67','0','1868721');
