nt with Ant, Maven</p>\n\n<p>●   Experienced with visualize VPS Management (Kloxlo, Webmin, VMware, etc.)</p>\n\n<p><strong>INTERESTS</strong></p>\n\n<p>●   Enterprise Software Architecture</p>\n\n<p>●   Hybrid Electronic Systems Designing</p>\n\n<p>●   Embedded Systems</p>\n\n<p>●   Modelling and Simulation of Electronic Circuits</p>\n\n<p>●   CNC system designing &amp; development</p>\n\n<hr>\n\n<p>CEO/ Software Architect <br />\nFounder of <strong>Hither Tech (Pvt) Ltd</strong>.<br />\n<a href=\"http://www.hithertech.com\" rel=\"nofollow noreferrer\">www.hithertech.com</a></p>\n','0','0','0','1479008');
