INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1380,116,'2013-05-16T17:06:25.250','Jon Ericson','2017-06-27T19:27:49.367','http://jericson.github.io/','Downtown Burbank','<p>Stack Exchange employs me as a <a href=\"http://blog.stackoverflow.com/2013/08/please-welcome-jon-ericson-community-manager/\">Community Manager</a>.  I\'ve been known to respond to <code>jericson@stackexchange.com</code>. Alternatively, I maintain an <a href=\"http://chat.meta.stackexchange.com/rooms/738/jons-java-jitter-joint\">office on chat</a>. (Please ignore the meta cruft.) </p>\n\n<p>I write about my experience as a community manager at <a href=\"http://jericson.github.io/\" rel=\"nofollow noreferrer\">jericson.github.io</a>. You can read about what I\'ve done over the years in my <a href=\"http://careers.stackoverflow.com/jericson\" title=\"Not guaranteed to be current.\"><em>curriculum vitae</em></a>.</p>\n\n<p>On a personal note, I\'m married and have three children.  Our oldest son loves school, friends, games, and music. Two of my children happen to have been born on the same day.  I <a href=\"http://taking1and1.wordpress.com/\" rel=\"nofollow noreferrer\" title=\"Yet another half-assed blog.\">sometimes write</a> about that experience. My wife loves taking care of people as a registered nurse.</p>\n\n<p>Don\'t have time for a full review of something?  Why not try <a href=\"http://fivesecondreview.wordpress.com/\" rel=\"nofollow noreferrer\" title=\"All reviews accurate and helpful or your money back.\">my 5-second reviews</a>?</p>\n\n<p>I once wrote for <a href=\"http://christianity.blogoverflow.com/author/jonericson/\" rel=\"nofollow noreferrer\" title=\"I haven&#39;t been on the rotation for a while, however.\">Eschewmenical</a>, which was an experiment of <a href=\"http://christianity.stackexchange.com/\">Christianity Stack Exchange</a>. For <em>a lot more</em> writing about the Bible, see <a href=\"https://hermeneutics.stackexchange.com/users/68/jon-ericson?tab=summary\">my Biblical Hermeneutics posts</a>.</p>\n\n<p>This is my corner of the company:</p>\n\n<p><a href=\"https://stackoverflow.com/company/team\"><img src=\"https://i.stack.imgur.com/4JlSbm.png\" alt=\"Up and to the right.\"></a></p>\n','3','5','0','1083');
