INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1384,101,'2013-05-18T12:53:37.380','David Manners','2015-01-25T16:11:39.050','http://davidmanners.de','Frankfurt, Germany','<p>I am mainly a PHP developer with Magento experience. I have been working with Magento for nearly 4 years. In my spare time I host a podcast called MageEngage finding out about what developers do in their spare time.:</p>\n\n<ul>\n<li>Magento Certified Developer</li>\n<li>Zend Certified Engineer</li>\n</ul>\n\n<p>Twitter: <a href=\"https://twitter.com/mannersd\" rel=\"nofollow\">@mannersd</a></p>\n\n<p>Podcast: <a href=\"https://t.co/LDkWjUZQFx\">MageEngage</a></p>\n','1','18','0','1161639');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1385,101,'2013-05-19T02:38:49.020','Daisuke Shimamoto','2013-05-19T07:56:59.673','null','Japan','<p>Daisuke is a developer working for a healthcare start-up in Japan. His main work is in React Native and Ruby.</p>\n\n<p>His previous job was at an IT education start-up mainly developing in Ruby on Rails.\nHe has also worked in the finance industry where he mainly used Java 6 and C# (.NET 3.5) with some Perl scripts here and there.</p>\n\n<p>Outside of his daily job, Daisuke looks at random interest looking technologies like:</p>\n\n<ul>\n<li>Haskell</li>\n<li>Smalltalk / Pharo</li>\n<li>Rust</li>\n<li>Clojure</li>\n</ul>\n\n<p>His favourite editor is Vim.</p>\n','0','2','0','2847');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1387,161,'2013-05-20T16:38:17.807','AquaAlex','2015-08-03T09:05:19.527','http://www.facebook.com/aquaalex','Cape Town','<p>IT Generalist, Dissident Developer, IT Heretic, scuba diver, role-player, martial artist, father, son, human being, enthusiastically optimistic realist, ...</p>\n\n<p>\"Do not try and think outside the box. That\'s impossible. Instead... only try to realize the truth. There is no box!\"</p>\n\n<p>Worked and played in in IT industry for a number of years, mostly in the mainframe fields using COBOL, LINC (LDA/EDA), ObjectStar. But have also used some other languages and tools. Also worked in PROGRESS ABL (4GL) and Python 2.7  Now working as Technical Support Specialist in the Pharmacy Whole Sale industry.</p>\n\n<p>PADI Master Instructor, PADI Tec Instructor, Wing Chun Kuen Instructor, JuJitsu Instructor, DAN First Aid Instructor Trainer</p>\n\n<p>=================================================</p>\n\n<p>Why do I call myself a Heretic and Dissident?</p>\n\n<p>A heretic holds ideas that are in fundamental disagreement with the status quo in any practice and branch of knowledge. </p>\n\n<p>A dissident, broadly defined, is a person who actively challenges an established doctrine, policy, or institution.</p>\n','0','2','0','2792225');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1389,101,'2013-05-21T15:51:12.507','Ms. Nobody','2016-01-15T13:37:41.843','null','Internet','<p>Human being with emotions, quite big imagination, loving drama and computers (with connection to the Internet!).</p>\n\n<hr>\n\n<p>English ain\'t my mother tongue so don\'t hate me for my mistakes and not very good grammar.</p>\n\n<hr>\n\n<p>Without you I\'d be lost and making up new solutions for things that others have done already. #SOreadytohelp</p>\n','0','0','0','2655625');
