INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1423,141,'2013-06-01T05:31:14.350','Aiias','2015-04-04T20:52:19.667','http://codingmark.com/','California','<p>I am a professional application developer with a bachelor\'s degree in Computer Science. I enjoy learning about, optimizing, and writing effective <a href=\"/questions/tagged/php\" class=\"post-tag\" title=\"show questions tagged \'php\'\" rel=\"tag\">php</a>, <a href=\"/questions/tagged/mysql\" class=\"post-tag\" title=\"show questions tagged \'mysql\'\" rel=\"tag\">mysql</a>, <a href=\"/questions/tagged/javascript\" class=\"post-tag\" title=\"show questions tagged \'javascript\'\" rel=\"tag\">javascript</a>, <a href=\"/questions/tagged/html\" class=\"post-tag\" title=\"show questions tagged \'html\'\" rel=\"tag\">html</a>, <a href=\"/questions/tagged/css\" class=\"post-tag\" title=\"show questions tagged \'css\'\" rel=\"tag\">css</a>, <a href=\"/questions/tagged/java\" class=\"post-tag\" title=\"show questions tagged \'java\'\" rel=\"tag\">java</a>, and <a href=\"/questions/tagged/c%2b%2b\" class=\"post-tag\" title=\"show questions tagged \'c++\'\" rel=\"tag\">c++</a> code.</p>\n\n<p><a href=\"http://stackexchange.com/\"><code>StackExchange</code></a> interests me because it is fun to help others with a variety of coding situations. You can always learn something new, too.</p>\n\n<p>A great teacher taught me that good code should be <strong>readable</strong>, <strong>writable</strong>, <strong>reliable</strong>, and <strong>low cost</strong>.</p>\n\n<p><a href=\"http://stackexchange.com/users/2126366\">\n<img src=\"http://stackexchange.com/users/flair/2126366.png\" width=\"208\" height=\"58\" alt=\"profile for Aiias on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Aiias on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n','0','5','0','2126366');
