INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1455,1180,'2013-06-10T16:52:37.440','Jacob Jan Tuinstra','2018-02-27T14:56:57.943','http://www.jacobjantuinstra.nl','Netherlands','<p>Hi and welcome to my profile. I\'m <strong><a href=\"http://www.jacobjantuinstra.nl\" rel=\"nofollow noreferrer\">Jacob Jan Tuinstra</a></strong>, born in the northern part of the Netherlands. In my free time, I try to do as much coding in Google Apps Script as possible. See my website for snippets I\'ve made available. See my <strong><a href=\"https://plus.google.com/u/1/+JacobJanTuinstra/about\" rel=\"nofollow noreferrer\">Google+ profile</a></strong> for more info.</p>\n\n<h2>Achievements</h2>\n\n<p>First to earn the <img src=\"https://i.stack.imgur.com/Sp9I0.png\" alt=\"enter image description here\"> badge for the <a href=\"/questions/tagged/google-spreadsheets\" class=\"post-tag\" title=\"show questions tagged &#39;google-spreadsheets&#39;\" rel=\"tag\">google-spreadsheets</a> tag<br>\nFirst to earn the <img src=\"https://i.stack.imgur.com/4fMZc.png\" alt=\"enter image description here\"> badge for the <a href=\"/questions/tagged/google-spreadsheets\" class=\"post-tag\" title=\"show questions tagged &#39;google-spreadsheets&#39;\" rel=\"tag\">google-spreadsheets</a> tag<br>\nFirst to earn the <img src=\"https://i.stack.imgur.com/cpBcQ.png\" alt=\"enter image description here\"> badge for the <a href=\"/questions/tagged/google-spreadsheets\" class=\"post-tag\" title=\"show questions tagged &#39;google-spreadsheets&#39;\" rel=\"tag\">google-spreadsheets</a> tag<br>\nFirst to earn the <img src=\"https://i.stack.imgur.com/Sp9I0.png\" alt=\"enter image description here\"> badge for the <a href=\"/questions/tagged/google-apps-script\" class=\"post-tag\" title=\"show questions tagged &#39;google-apps-script&#39;\" rel=\"tag\">google-apps-script</a> tag<br>\nFirst to earn the <img src=\"https://i.stack.imgur.com/cpBcQ.png\" alt=\"enter image description here\"> badge for first posts<br>\nFirst to earn the <img src=\"https://i.stack.imgur.com/cpBcQ.png\" alt=\"enter image description here\"> badge for close votes<br>\nSecond to earn the <img src=\"https://i.stack.imgur.com/cpBcQ.png\" alt=\"enter image description here\"> badge for suggested edits </p>\n\n<h2>Stack Exchange</h2>\n\n<p><a href=\"http://stackexchange.com/users/1669259\">\nprofile for Jacob Jan Tuinstra on Stack Exchange, a network of free, community-driven Q&amp;A sites http://stackexchange.com/users/flair/1669259.png\n</a></p>\n','92','214','22','1669259');
