INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1462,101,'2013-06-13T05:24:40.263','Gangadhar','2013-06-13T05:24:40.263','http://stackoverflow.com/users/1885193/gangadhar','India','<p>Developer works with C &amp; C++, Unix &amp; Windows and some libraries.</p>\n\n<h2>#SOreadytohelp</h2>\n\n<hr>\n\n<p>“The first 90% of the code accounts for the first 90% of the development time. The remaining 10% of the code accounts for the other 90% of the development time.” – Tom Cargill</p>\n\n<p>“Measuring programming progress by lines of code is like measuring aircraft building progress by weight.” -– Bill Gates</p>\n\n<p>“Any fool can use a computer. Many do.” --Ted Nelson  </p>\n\n<p>“Nine people can’t make a baby in a month.” – Fred Brooks   </p>\n\n<p>“Why do we never have time to do it right, but always have time to do it over?” — anonymous developer  </p>\n\n<p>“Fast. Good. Cheap. Choose any two” — common project mantra  </p>\n\n<p>“What’s the problem?\n That shouldn’t happen.\n That doesn’t happen on my machine.\n Oh, I see what the problem is.\n How did that ever work?”</p>\n\n<hr>\n\n<p><a href=\"http://stackoverflow.com/users/1885193/gangadhar\">\n<img src=\"http://stackoverflow.com/users/flair/1885193.png?theme=dark\" width=\"208\" height=\"58\" alt=\"profile for Gangadhar at Stack Overflow, Q&amp;A for professional and enthusiast programmers\" title=\"profile for Gangadhar at Stack Overflow, Q&amp;A for professional and enthusiast programmers\">\n</a></p>\n','0','0','0','2122159');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1464,101,'2013-06-13T17:04:34.477','aenariel','2013-07-04T16:15:28.137','http://www.microsource.pt/','Porto, Portugal','<p><strong>At work:</strong></p>\n\n<p>Full-time software developer and past-time game designer.</p>\n\n<p>Worked as a game designer for Planetarium Games from 2007 to 2011.<br>\nWorked as a software developer for MicroSource from 2013 to 2014.<br>\nCurrently working as a software and web developer for Leads4Business since 2015.<br></p>\n\n<p>Worked with VB6, classic ASP, PHP, JavaScript, jQuery, MySQL and SQL-Server, ActionScript3, Pascal and C.\nCurrently learning Drupal at a very fast pace!</p>\n\n<p><strong>At home and play:</strong></p>\n\n<p>Firstly, interested in music, mainly 1970s-2000s pop, rock and their sub-genres.<br>\nSecondly, interested in history, mainly 10th to 19th century european history, with special attention to the age of discoveries.<br>\nAlso interested in astronomy and geography.</p>\n','0','0','0','2861607');
