INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1615,101,'2013-08-04T06:10:54.717','kkaosninja','2013-08-04T06:10:54.717','http://kkshetty.tumblr.com','Bangalore, India','<p>Below is some Go code that describes what I try to do everyday. :-)</p>\n\n<pre><code>for {\n    knowledge++\n    programmingSkill++\n    laziness -= 0.01\n\n    for _, question := range stackOverflowQuestions {\n        switch question.difficulty {\n        case Easy:\n            fallthrough\n        case Medium:\n            question.answerWith(myAnswer)\n            question.hopeForUpvote()\n        }\n    }\n}\n</code></pre>\n','0','0','0','3103722');
