INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1697,118,'2013-08-31T15:09:12.277','Pieter Geerkens','2017-08-06T16:25:34.830','https://hexgridutilities.codeplex.com/','Canada','<p>A physicist, accountant (CGA,CPA), and software developer by training, and a professional developer by employment, I wrote my first computer program in <strong>FORTRAN</strong> w/ <strong>WATFOR</strong> in high school. Since then I have written device drivers for a PDP-15, <strong>CAD/CAM</strong> applications in <strong>C</strong>, and <strong>Database</strong> applications in everything from <strong>FORTRAN</strong> (?!) and <strong>C</strong> to <strong>SQL</strong> and <strong>MS-Office</strong>. </p>\n\n<p>I currently build financial and business applications professionally, mostly with <strong>VBA / C# / SQL</strong>, while developing my own Napoleonics game engine in <strong>C#</strong> on weekends and evenings.</p>\n','1','3','0','1781966');
