INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1720,1,'2013-09-09T23:27:53.950','Ichthydion','2013-09-09T23:27:53.950','http://meta.stackoverflow.com/users/1438/jon-ericson','null','<p>I\'m am <a href=\"http://blog.stackoverflow.com/2013/08/please-welcome-jon-ericson-community-manager/\">Jon Ericson</a>\'s benign sock puppet/alter ego.  My primary goal is to give my owner insight into what it\'s like to be a very low-reputation user.  My secondary goal is to explore positions which my owner does not regularly adhere to.  In order to remain benign and serve my primary purpose, I pledge to:</p>\n\n<ol>\n<li>Never vote.</li>\n<li>Never comment except on my own posts.</li>\n<li>Donate all excess reputation back to the community via bounties.  (Jon Ericson, himself, will never get awarded one of my bounties.)</li>\n</ol>\n\n<p>Please contact <a href=\"http://meta.stackoverflow.com/users/1438/jon-ericson\">my owner</a> if you have any complaints about my activities.</p>\n','0','0','0','2184542');
