INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1735,178,'2013-09-13T21:07:35.757','ash','2016-08-09T21:13:36.483','http://puroh.it','Berlin, Germany','<p>Mainly: Backend / distributed systems / machine learning in Go and Python. </p>\n\n<p>I write occassional frontends if I can do them in nice, non-JS abstractions like the FP language, Elm.</p>\n\n<p>I love the diversity of human languages and spend an inordinate amount of time studying them.</p>\n','7','2','0','35386');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1738,2100,'2013-09-16T00:32:14.370','Tom Au','2018-03-08T18:45:24.503','','New York, New York','<p>I like to watch and analyze tennis and baseball, but my real expertise is economics and the stock market.</p>\n\n<p>I have been known to use tennis analogies in writing about the <a href=\"http://www.financialsensearchive.com/editorials/au/2007/0112.html\" rel=\"nofollow\">stock market</a> or stock market analogies in writing about <a href=\"http://bleacherreport.com/articles/263995-pirates-lost-badly-on-stealth-trades\" rel=\"nofollow\">baseball.</a></p>\n','69','104','0','512193');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1739,317,'2013-09-16T04:09:44.527','yuritsuki','2018-01-21T20:11:39.510','http://www.google.com','!','<p>The  intent  is  to  provide  players  with  a  sense  of  pride  and  accomplishment  for  unlocking  different  Arqade benefits.  As  for  cost,  we  selected  initial  values  based  upon  data  from  the  Open  Beta  and  other  adjustments  made  to  reputation  rewards  before  launch.  Among  other  things,  we\'re  looking  at  average  per-user  reputation  earn  rates  on  a  daily  basis,  and  we\'ll  be  making  constant  adjustments  to  ensure  that  users  have  challenges  that  are  compelling,  rewarding,  and  of  course  attainable  via  gameplay. We  appreciate  the  candid  feedback,  and  the  passion  the  community  has  put  forth  around  the  current  topics  here  on  Reddit,  our  forums  and  across  numerous  social  media  outlets. Our  team  will  continue  to  make  changes  and  monitor  community  feedback  and  update  everyone  as  soon  and  as  often  as  we  can.  </p>\n','16','14','0','906366');
