INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1742,101,'2013-09-16T09:07:59.107','Edd','2013-09-16T09:25:18.240','http://eddarmitage.com','London, United Kingdom','<p>I\'m Edd. I\'m a Computer Science graduate from the University of Bath, currently working as a software developer at Ocado, in Hatfield, UK. I\'ve experience working in a number of industries, including military and civil engineering, and working on very different types of project.</p>\n\n<p>I reguarly code in C, C++ and Objective-C, and have experience using Python, Java, PHP  and Ada as well as the basics such as Bash-scripting. I\'m keen to learn C# and the .Net framework in the near future. I\'m happy to work with html and XML, and I typeset the vast majority of my university work using LaTeX.</p>\n\n<p>Outside of work, I\'m a keen photographer. I\'m a Canon user, shooting with a 5D. I\'m interested in landscapes and cityscapes, as well as bits of sports photography. I\'m wanting to learn more about how I can use flash to enhance my photos.</p>\n\n<p>I am #SOreadytohelp</p>\n','0','0','0','26369');
