INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1745,101,'2013-09-17T11:19:40.623','Ferran Salguero','2013-09-17T11:19:40.623','http://ferransalguero.github.io/','null','<p>Experienced multinational corporation software engineer, independent developer on my free time and sports \"aficionado\".</p>\n\n<p>I also build custom projects (websites, apps) on demand, contact me if you are interested. Check my site at <a href=\"http://ferransalguero.github.io/\" rel=\"nofollow noreferrer\">http://ferransalguero.github.io</a> if you are interested in hiring me for details and portfolio.</p>\n\n<p>Some of my public projects:</p>\n\n<ol>\n<li><a href=\"http://motivate.apphb.com/\" rel=\"nofollow noreferrer\">Motivate</a>, a motivational tool for Strava users</li>\n<li><a href=\"http://mtbconfigurator.putinyourbasket.com/\" rel=\"nofollow noreferrer\">MTBConfigurator</a>, a multi-brand MTB components configurator</li>\n<li><a href=\"http://wheretobuy.putinyourbasket.com\" rel=\"nofollow noreferrer\">#WhereToBuy</a>, a price comparison tool site</li>\n<li>Custom Domain manager and reseller, forget about renewals and configuration for only 20€/year</li>\n<li>Co-creator of <a href=\"http://www.windowsphone.com/en-us/store/app/emoji-quest/3fc8eba8-a615-4244-ae2e-07ac6e68c901\" rel=\"nofollow noreferrer\">Emoji Quest</a>, a fun Windows Phone Game App</li>\n<li>Personal webpages: <a href=\"http://ferransalguero.github.io/\" rel=\"nofollow noreferrer\">Ferran Salguero\'s homepage</a></li>\n<li>Professional homepages/Portfolios: <a href=\"http://raquelestrada.apphb.com\" rel=\"nofollow noreferrer\">Raquel Estrada\'s Portfolio</a></li>\n<li>Blog and website customization on any platform: <a href=\"http://www.putinyourbasket.com\" rel=\"nofollow noreferrer\">Put in your basket</a>, <a href=\"http://lamullena.blogspot.com/\" rel=\"nofollow noreferrer\">La Mullena</a></li>\n<li><a href=\"http://ferransalguero.github.io/bootstrap-blog/\" rel=\"nofollow noreferrer\">Bootstrap professional customization for websites</a></li>\n<li><a href=\"http://twitter-stats.apphb.com/\" rel=\"nofollow noreferrer\">Twitter Stats</a></li>\n<li>Designing an RPG/Adventure indie game</li>\n<li><a href=\"http://wmhomepage.apphb.com/\" rel=\"nofollow noreferrer\">Wishlist Manager</a>, a windows price tracking app (deceased)</li>\n<li>Raffello, a smart shopping web community </li>\n</ol>\n','0','0','0','1256906');
