INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1777,101,'2013-09-26T11:00:36.250','Marijn','2013-09-26T11:00:36.250','http://www.serraict.com','Netherlands','<p>I love to guide software teams on their journey to deliver valuable software and becoming a great team. </p>\n\n<p>I am a <a href=\"http://www.serraict.com\" rel=\"nofollow\">freelance Scrum Master/Agile Coach</a>, agile developer, pragmatic student, team player and coach and have been active in the field of software development for well over ten years.</p>\n\n<p>You can reach me by e-mail: marijn <em>at</em> serraict <em>dot</em> com (work) or marijn <em>dot</em> vanderzee <em>at</em> gmail <em>dot</em> com (home).</p>\n\n<p><a href=\"http://stackexchange.com/users/126056\">\n<img src=\"http://stackexchange.com/users/flair/126056.png\" width=\"208\" height=\"58\" alt=\"profile for Marijn on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Marijn on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n','0','0','0','126056');
