INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1780,101,'2013-09-28T09:56:04.270','Sumurai8','2016-09-15T15:12:52.780','http://nl.wikipedia.org/wiki/user:Sumurai8','Netherlands','<p>Look into my eyes and tell me what you see. Does it burn when I look at you like that? Does it? DOES IT?</p>\n\n<p>Undocumented code is the root of all evil. That hardly counts. I mean you even have to multiply it with itself to get all evil. How bad can it be?</p>\n\n<p>Testing is this thing that breaks your code. Don\'t be mean. Don\'t break code. Don\'t test things.</p>\n\n<p>Don\'t write documentation. Write a program instead that implants the required knowledge into someone\'s brain instead. Don\'t write documentation for this program either, but make it run on every human and android you encounter.</p>\n\n<p>Want to contact me about something? If you have an account on Wikipedia and verify your email-address, you can send me an email via <a href=\"https://nl.wikipedia.org/wiki/Special:EmailUser/Sumurai8\" rel=\"nofollow noreferrer\">Wikipedia</a>.</p>\n','0','0','0','2543769');
