INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1851,101,'2013-10-17T22:54:56.957','Aralox','2013-10-17T22:54:56.957','null','null','<p>If I speak in the tongues of men and of angels, but I do not have love, I am a noisy gong or a clanging cymbal. And if I have prophecy, and know all mysteries and all knowledge, and if I have all faith so that I can remove mountains, but do not have love, I am nothing. If I give away everything I own, and if I give over my body in order to boast,1 but do not have love, I receive no benefit. </p>\n\n<p>Love is patient, love is kind, it is not envious. Love does not brag, it is not puffed up. It is not rude, it is not self-serving, it is not easily angered or resentful. It is not glad about injustice, but rejoices in the truth. It bears all things, believes all things, hopes all things, endures all things. </p>\n\n<p>Love never ends. But if there are prophecies, they will be set aside; if there are tongues, they will cease; if there is knowledge, it will be set aside. For we know in part, and we prophesy in part, but when what is perfect comes, the partial will be set aside. When I was a child, I talked like a child, I thought like a child, I reasoned like a child. But when I became an adult, I set aside childish ways. For now we see in a mirror indirectly, but then we will see face to face. Now I know in part, but then I will know fully, just as I have been fully known. And now these three remain: faith, hope, and love. But the greatest of these is love. </p>\n\n<p>1 Corinthians 13</p>\n','0','2','0','1054692');
