INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1900,101,'2013-11-03T16:09:55.900','John Dvorak','2018-01-30T02:55:08.547','null','null','<p><a href=\"http://dystroy.org/miaou/user/25\" rel=\"nofollow noreferrer\">Jan-Dvorak @ Miaou</a><br>\nHonnza @ gmail.com</p>\n\n<blockquote>\n  <p>\"Haven\'t you heard? Crowdsourcing to stackOverflow is the new trend in basic debugging.\"</p>\n</blockquote>\n\n<p>-- John Dvorak</p>\n\n<blockquote>\n  <p>\"There are only two hard things in Computer Science: cache invalidation, naming things and off-by-one errors\"</p>\n</blockquote>\n\n<p>-- variation of Phil Karlton\'s quote</p>\n','3','1','0','233608');
