INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1902,101,'2013-11-04T20:45:37.583','Ana','2015-08-07T18:10:38.097','http://enemygatedown.com/','New York, NY, United States','<p>Stack Exchange Community Manager. I\'m here to help the inmates run the asylum. </p>\n\n<p>You may know me from projects like:</p>\n\n<ul>\n<li>That time the SE Community Team <a href=\"http://meta.stackexchange.com/questions/257614/graduation-site-closure-and-a-clearer-outlook-on-the-health-of-se-sites\">updated our criteria for graduating and closing</a> Q&amp;A sites (shoutout to <a href=\"http://meta.stackexchange.com/users/131713/pops\">Pops</a> on this one)</li>\n<li><a href=\"http://meta.stackexchange.com/questions/263905/design-independent-graduation-is-on-for-early-september\">Design Independent Graduation</a></li>\n<li>The introduction of <a href=\"http://meta.stackexchange.com/questions/278882/lets-experiment-with-town-hall-style-chat-events\">Meta Stack Exchange Town Halls</a></li>\n</ul>\n\n<p>I\'ve also poked at a lot of my team\'s back office-y systems and spend a fair amount of time hanging around the <a href=\"http://meta.stackoverflow.com/questions/tagged/jobs\">jobs tag on MSO</a>.</p>\n\n<p>Beyond that...</p>\n\n<p>I\'m a hobbyist programmer who loves thinking about how systems talk to each other. I\'ve dabbled with technologies like JavaScript/Node.js, C, Python, Rails, and SQL and have developed a real love for UNIX environments. In the near future, I want to learn more about networking. I\'m an avid consumer of science fiction, with a special soft spot for all things cyberpunk. Oh, and I just recently began reading comics. Better late than never, right? </p>\n\n<p>Send comic book recommendations to ana (at) stackexchange.com</p>\n','0','0','0','2415655');
