INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1911,101,'2013-11-07T02:18:43.430','puretppc','2013-11-24T22:02:09.457','https://www.facebook.com/puretppc','Canada','<p>I\'m learning how to program C# right now. I have done programming for 3 years before and this is currently my 4th year and language.</p>\n\n<p>Languages I\'ve tried but didn\'t do well before:</p>\n\n<ul>\n<li>Turing</li>\n<li>Python</li>\n<li>Java</li>\n</ul>\n\n<p>My Roles on Stack Overflow:</p>\n\n<ul>\n<li>Helping new users with site features</li>\n<li>Editing posts</li>\n<li>Asking questions regarding my code problems</li>\n<li>Answering questions (rarely)</li>\n<li>Reviewing (*new)</li>\n</ul>\n\n<p>Cool Achievements</p>\n\n<ul>\n<li><a href=\"http://i.stack.imgur.com/eBRzI.png\" rel=\"nofollow\">First Silver Badge (2014/01/13 10:00PM EST)</a></li>\n<li><a href=\"http://i.imgur.com/L7MMinv.png\" rel=\"nofollow\">500 Reputation (2014/01/16 9:29PM EST)</a></li>\n<li><a href=\"http://i.imgur.com/ys2V4ue.png\" rel=\"nofollow\">200 Rep in 1 day (2014/01/18 4:48PM EST)</a></li>\n<li><a href=\"http://i.imgur.com/S5IKVi1.png\" rel=\"nofollow\">1000 Rep Milestone! (2014/1/22 9:50PM EST)</a></li>\n<li><a href=\"http://i.stack.imgur.com/iCuTr.png\" rel=\"nofollow\">1337 Reputation! (2014/02/01 6:10PM EST)</a></li>\n<li><a href=\"http://i.stack.imgur.com/D4PJn.png\" rel=\"nofollow\">First Gold Badge!!!!!! (2014/02/05 1:36PM EST) </a></li>\n<li><a href=\"http://i.imgur.com/XQvAxfM.png\" rel=\"nofollow\">Question with 1337 views!</a></li>\n</ul>\n','1','0','0','3311833');
