INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1933,226,'2013-11-13T20:45:46.480','greenoldman','2016-01-21T19:33:42.843','http://aboutskila.wordpress.com/','null','<p>I am interested in such topics: </p>\n\n<ul>\n<li>usability and accessibility of user interfaces,  </li>\n<li>design of programming languages,  </li>\n<li>natural language processing,  </li>\n<li>machine translation, </li>\n<li>data mining.</li>\n</ul>\n\n<p>Currently I am developing compiler and programming language Skila -- read more at <a href=\"http://aboutskila.wordpress.com/\" rel=\"nofollow\">aboutskila.wordpress.com</a>.</p>\n','1','9','0','72937');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1934,133,'2013-11-14T06:26:11.510','Sathiya Kumar','2018-01-20T05:02:38.557','http://www.latest-seo-news-updates.blogspot.com','Chennai, India','<p>Sathiya Kumar V M - An Enthusiastic Database Administrator, Search Engine Optimizer, A Good Search Engine Marketer and a Better Social Media Optimizer.</p>\n\n<p>Started my career in 2012 @ContempoTech(Search Engine Genie) a startup company gave me a good platform for my SEO career. With the 1 year experience I joined Sulekha New Media Pvt ltd(<a href=\"http://www.sulekha.com\" rel=\"nofollow noreferrer\">Sulekha.com</a>) where I learned SEO as well as SEM.\nLater I got a chance to join Servion Global Solutions as Engineer where I have been working as SQL Database Administrator as well as CUIC Report Developer.</p>\n\n<p>I love to Contribute to Stack Exchange sites especially on <a href=\"http://webmasters.stackexchange.com/\">Pro Webmasters</a> as I love SEO. I love editing, flagging and answering questions.\n@2013 I tried to  become a <a href=\"http://webmasters.stackexchange.com/election/4\">Moderator @ProWebmasters</a> but didn\'t get a chance :( but still contributing to the site as a normal user or we can say Unofficial Moderator :-P</p>\n\n<p>I have my own blogs:</p>\n\n<p><a href=\"http://latest-seo-news-updates.blogspot.com/\" rel=\"nofollow noreferrer\">http://latest-seo-news-updates.blogspot.com/</a> - Info about SEO</p>\n\n<p><a href=\"http://mytamilkavithaigal.blogspot.in/\" rel=\"nofollow noreferrer\">http://mytamilkavithaigal.blogspot.in/</a> - Tamil Language Poets and Quotes</p>\n\n<p>Reach out me through my following profiles:</p>\n\n<p>Wikipedia - <a href=\"https://en.wikipedia.org/wiki/User:SathiyaKumarVM\" rel=\"nofollow noreferrer\">https://en.wikipedia.org/wiki/User:SathiyaKumarVM</a></p>\n\n<p>Twitter - <a href=\"http://twitter.com/SathiyaKumarseo\" rel=\"nofollow noreferrer\">http://twitter.com/SathiyaKumarseo</a></p>\n\n<p>Facebook - <a href=\"https://www.facebook.com/sathiyakumarseo\" rel=\"nofollow noreferrer\">https://www.facebook.com/sathiyakumarseo</a></p>\n\n<p>Google+ - <a href=\"https://plus.google.com/+SathiyaKumarSEO\" rel=\"nofollow noreferrer\">https://plus.google.com/+SathiyaKumarSEO</a></p>\n\n<p>About.me - <a href=\"https://www.about.me/sathiya.kumar\" rel=\"nofollow noreferrer\">https://www.about.me/sathiya.kumar</a></p>\n\n<p>Quora - <a href=\"http://www.quora.com/Sathiya-Kumar\" rel=\"nofollow noreferrer\">http://www.quora.com/Sathiya-Kumar</a></p>\n','5','27','0','2795406');
