INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1939,101,'2013-11-15T12:33:16.217','Yosi Dahari','2013-11-18T22:15:42.170','https://www.linkedin.com/in/yossi-dahari/','Israel','<p>Currently working as a Software Development Engineer, Alexa Shopping at Amazon.</p>\n\n<p>Previously worked as a Software engineer and Technical lead at Intel. Worked in business intelligence group, which provides automated data solutions. </p>\n\n<p>I was leading the development of scalable cloud solutions in Spring framework (Java) and SDK for data analytics, leveraging technologies such as Apache Spark, Apache Kafka etc.</p>\n','0','0','0','2990262');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1942,128,'2013-11-15T16:54:18.160','Mikhail','2016-05-28T12:07:34.660','http://mmatrosov.github.io/cv/','Moscow, Russia','<p>I\'m a professional C++ developer with background in computer graphics &amp; computer vision. Experienced in developing high-performance desktop image processing applications.</p>\n\n<p>I\'m currently working in <a href=\"http://www.aligntech.com/home\" rel=\"nofollow\">Align Technology</a> R&amp;D office in Moscow, Russia. </p>\n\n<p>I graduated from Computational Mathematics and Cybernetics department of Lomonosov Moscow State University and worked in <a href=\"http://graphics.cs.msu.ru/en\" rel=\"nofollow\">Graphics &amp; Media Lab</a> as a PhD student. </p>\n\n<p>I also code in Matlab, C#, Python and other languages (who doesn\'t?), but C++ is the best.</p>\n','3','1','0','96023');
