INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1952,123,'2013-11-21T08:04:03.487','Esa Paulasto','2014-02-22T22:21:10.517','http://www.flickr.com/photos/pelasu/','Finland','<p>I am a floor-level three-shift factory worker by profession. My hobbies are movies, reading, photography and living in peace. I\'m definitely not a photographer. I just like to use a camera and record a memory of things I see around me. Been doing this since I was 14 years old and I\'m not any sort of enthusiast about it. I just like it :)</p>\n\n<p>my cameras:</p>\n\n<ul>\n<li><a href=\"http://www.imaging-resource.com/PRODS/sony-a37/sony-a37A.HTM\" rel=\"nofollow\">Sony SLT A37</a> (with a 14mm, 18-55mm and 70-300mm)</li>\n<li><a href=\"http://www.dpreview.com/reviews/olympussp550uz/\" rel=\"nofollow\">Olympus SP-550UZ</a> (learned to hate it)</li>\n<li><a href=\"http://www.dpreview.com/reviews/canona70\" rel=\"nofollow\">Canon Powershot A70</a> (loved it!)</li>\n<li><a href=\"http://www.woot.com/blog/post/logitech-clicksmart-510-webcam\" rel=\"nofollow\">Logitech ClickSmart 510</a> (a pocket digicam and a webcam together)</li>\n<li><a href=\"http://camerapedia.wikia.com/wiki/Yashica_FR_I\" rel=\"nofollow\">Yashica FR-1</a> (with full b/w dark room equipment)</li>\n<li><a href=\"http://www.amateurphotographer.co.uk/archive/536415/olympus-pen-d-buying-and-using-classic-cameras\" rel=\"nofollow\">Olympus Pen D</a> (inherited from my father)</li>\n<li>had a few of Nokia and Samsung mobile phone cameras.</li>\n</ul>\n','0','8','0','2422077');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1953,128,'2013-11-21T08:18:27.713','Justin Jenkins','2017-07-07T20:02:31.683','null','Seattle, WA','<p>I love to architect and develop effective, creative and refreshing solutions to complex problems ... then again, sometimes it\'s solving the simple ones that brings the most delight.</p>\n\n<p>I have enjoyed solving problems for startups, government &amp; military contractors, non-profits, you name it.</p>\n','0','1','0','112243');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (1954,298,'2013-11-22T03:47:59.647','Wesley Bland','2017-05-11T19:05:00.190','http://wesbland.com','Austin, TX, United States','<p>I work in High Performance Computing on distributed runtimes. At times, I also look at other things including fault tolerance, single-node parallelism, video games, home repair, etc.</p>\n\n<p>My views, opinions, and wrong answers are my own and not my employers or funders. Everyone gets credit for the right answers.</p>\n','0','23','3','229008');
