INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2023,133,'2013-12-12T23:15:57.343','Phoenix87','2017-12-18T10:59:59.933','http://thenestofheliopolis.blogspot.com','Edinburgh, United Kingdom','<p>PhD in Pure Mathematics, University of Glasgow. My research area was Functional Analysis. Specifically, I worked on the problem of classification of C*-algebras (arXiv:1602.02043, arXiv:1607.02333).</p>\n\n<p>During my MSc in Theoretical Physics, I focused on Algebraic Quantum Field Theory and contributed to DFR models for Quantum Space-time (arXiv:1211.7050).</p>\n\n<p>I currently work as a Software Engineer in Edinburgh, Scotland, on an Oracle Database application. My duties involve innovation and maintenance of the messaging interface. I work with many technologies, including PL/SQL, JEE7 and shell scripting.</p>\n','1','2','0','528399');
