INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2051,101,'2013-12-19T10:52:40.717','Ricardo','2017-04-03T18:41:32.683','null','Brazil','<p>I\'m a Software Engineer with MSc in Computer Science. I currently work in Financial Markets and Banking as a Software and Business Analyst. I have a minor in Computer Engineering, which I completely neglected during college. Now I\'m trying to catch up. But mostly I consider myself just a hobbyist trying to teach myself electronics.</p>\n\n<p>Things I like the most in electronics:</p>\n\n<ol>\n<li>To design and etch my own PCBs at home (mostly with thru-role components, with an occasional SMD part to spice things up)</li>\n<li>To play with the oscilloscope</li>\n<li>To light up LEDs and 7-segment displays</li>\n<li>To gut toy RC cars and redo their electronics</li>\n<li>To organize my electronics components into neat boxes</li>\n<li>To browse questions and answers here at EE.SE and to edit posts to make them shine (when I can, that is, but I\'m especially fond of fixing equations formatting using MathJaX)</li>\n</ol>\n','0','0','0','3368906');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2052,241,'2013-12-19T11:41:32.187','Joe Taras','2018-02-12T08:38:18.540','http://www.casadelproverbio.it','Taranto, TA, Italy','<p>Hi, I\'m computer scientist living in Taranto (Italy), my birth home.</p>\n\n<p>I\'m working in a software house. On projects implemented in JavaEE.</p>\n\n<p>I\'va a holiday house to rent in Valle d\'Itria (South Italy), click on my hyperlink info in my profile to show it.</p>\n\n<p>I like write queries on different DBMS, my experiences are on MS Sql Server, My Sql and Oracle</p>\n\n<h1>SOreadytohelp</h1>\n','3','61','2','3040588');
