INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2055,1,'2013-12-20T06:34:58.823','Gasol','2013-12-20T07:07:52.707','http://about.me/gasol','Taiwan','<p>Hello, I\'m a Java Developer living in <a href=\"http://en.wikipedia.org/wiki/Taiwan\" rel=\"nofollow\">Taiwan</a>.</p>\n\n<p>Twitter: <a href=\"http://twitter.com/gasolwu\" rel=\"nofollow\">@gasolwu</a></p>\n','0','0','0','52749');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2056,142,'2013-12-20T15:24:07.197','jwir3','2017-11-13T16:27:07.410','http://www.glasstowerstudios.com/~scottj','Burnsville, MN','<p>I am a developer committed to open source software.</p>\n\n<p>I currently work for <a href=\"http://wheniwork.com\" rel=\"nofollow\">When I Work</a>, a mobile scheduling software platform. </p>\n\n<p>I have worked for Mozilla, helping develop the Gecko Platform, the rendering engine behind Firefox, Thunderbird, Sunbird, and many other third-party products. I am also the lead software engineer for Lil Joe Bean and President of Glass Tower Studios, LLC.</p>\n\n<p>I also volunteer my time to numerous projects, including the Crystal Space SDK, which is an open source game engine, and the Eridanus project, a game design project. I am very passionate about video games, especially with regards to high performance graphics and immersive environments.</p>\n\n<p>When I\'m not working or developing open source software, my major hobbies include martial arts, video games, sailing, and playing my violin. I hold the rank of 3rd Degree Black Belt, Green Sash in Wu Chi Chuu\'an Kung Fu. I am also a certified level 2 ice hockey referee for USAHockey.</p>\n','0','3','1','105481');
