INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2165,216,'2014-01-17T14:37:00.637','called2voyage','2017-11-06T13:41:14.643','http://www.reddit.com/r/religion','Georgia, USA','<p>I\'m a Software Engineer for a well-known aerospace and defense industry company. I\'ve been with the company for five years, and I\'ve been working with a flight simulation lab for over three years now. </p>\n\n<p>Before working for my current employer, I worked for four years as an IT Technician for a college campus.</p>\n\n<p>I\'ve been running RPGs of many types since about 2003. I\'ve been a player, a GM, and a moderator many times. As a GM and moderator most of my experience is with freeform, text-based, play-by-post RPGs. I have also LARPed a few times, and I have some experience with traditional tabletop RPGs. Most of my tabletop experience is with Pathfinder.</p>\n\n<p>I\'m also an amateur novelist and poet, and when I get the chance I work on my large story universe or one of my short stories. My wife and I are also working on a book series together.</p>\n','0','0','0','2359501');
