INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2168,101,'2014-01-18T16:38:59.943','Sibiraj PR','2014-01-18T16:38:59.943','https://lightrains.com','kerala','<p>My Parents call me Sibi. And I am registered in my birth certificate as Sibiraj PR. My area of working is web development, experienced as Drupal PHP Developer.</p>\n\n<p>I believe knowledge is power. I think information is not knowledge. The only source of knowledge is experience. </p>\n\n<p><a href=\"http://en.wikipedia.org/wiki/Abraham_Lincoln\" rel=\"nofollow noreferrer\">“Better to remain silent and be thought a fool than to speak out and remove all doubt”</a></p>\n\n<p>Currently i work with <a href=\"http://www.lightrains.com\" rel=\"nofollow noreferrer\">Lightrains Technolabs Pvt Ltd</a>, a SMALL company but the work is absolutely HUGE.</p>\n','0','0','0','324200');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2170,101,'2014-01-18T18:09:57.003','Matthew Nichols','2014-01-23T18:00:22.367','http://matthew-nichols.com','Denver, CO','<p>I am a passionate full-stack web developer living in Denver CO, USA.  My current tech passions are javascript, knockoutjs and MongoDB.  I am joyously married to <a href=\"http://www.marycamacho.com\" rel=\"nofollow\">Mary Camacho</a> who to my delight has a stackoverflow account and is learning how to code.  We own our own business, <a href=\"http://www.joyasolutions.com\" rel=\"nofollow\">JoyaSolutions</a> and run <a href=\"http://mongo4.net\" rel=\"nofollow\">mongo4.net</a>, a website on <a href=\"http://mongo4.net\" rel=\"nofollow\">developing with MongoDB and .NET</a> which keeps me very busy.  </p>\n','0','1','0','55114');
