INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2174,101,'2014-01-19T06:43:35.107','B-Con','2014-01-19T06:43:35.107','http://bradconte.com','United States','<p>I\'m a software engineer with a background in computer science and mathematics. I enjoy cryptography, Linux, and math.</p>\n\n<p>More about me on my website: <a href=\"http://bradconte.com/about\" rel=\"nofollow\">http://bradconte.com/about</a>.</p>\n','0','2','0','536039');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2175,119,'2014-01-19T06:50:09.593','Vector','2014-01-23T22:23:50.717','null','New York, NY','<p>Have been in IT/NYC financial industry etc. for about over 20 years. Started development work as a Paradox/Clipper/DBase guy around 1992. Done some serious work with Paradox, Delphi, SQLServer, C++, C#, XML-XSD and Python over the years, and have touched all phases of the SDLC. </p>\n\n<p>Right now getting up to speed with C++11, <a href=\"http://www.gtkmm.org/en/\" rel=\"nofollow\"><strong>gtkmm3</strong></a> and <a href=\"http://www.webtoolkit.eu/wt\" rel=\"nofollow\"><strong>WT</strong></a>.</p>\n\n<p>History-Law-Math-Literary-Science <strong>Dilettante</strong>;</p>\n','0','0','0','366814');
