INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (2180,101,'2014-01-20T04:33:30.867','Kevin Suttle','2014-01-20T04:33:30.867','http://kevinsuttle.com','Cincinnati, OH','<p>I have made a career out of wielding technology as a design tool. Using science and code to improve experiences for people is what gets me up in the morning, and keeps me up at night.</p>\n\n<p>With strong roots in user interface, interaction, and experience design, I approach usability from a holistic, \'big-picture\' perspective. Ranging anywhere from information architecture, to performance optimization, to hand-crafting UIs for mobile and TV, my deep fascination with the way people communicate through technology is what drives me to make things “the way they should be.”</p>\n\n<p>I care about crafting content-centered, predictable, and responsive interfaces using clean, standards-based code. I design products for mobile, touch, and typography first. In my work, the questions of ‘who’ and ‘why’ always come before ‘what’ and ‘how’.</p>\n\n<p>As both a developer and designer, a huge chunk of my work focus has been on developer experience. Here are some of the highlights.</p>\n','0','0','0','171269');
