INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3253,101,'2014-02-04T05:40:30.827','Coelho','2016-04-28T03:24:32.003','null','Sydney, Australia','<p>I am a Brazilian guy who lived in Portugal for the last 11 years and has just moved to Australia. I have been working as a Developer since 1998.</p>\n\n<p>My bests skills are, but not limited to, C#, MVC, WCF, Jquery, Java Script and everything that refers to Web Development although I had also worked with Windows Forms, Services and Mobile. I have Microsoft Certification MVC 4, HTML 5, CSS 3 and JavaScript.</p>\n\n<p>My professional experiences were in banks, telecommunications, insurance, government, transport and logistics companies.</p>\n\n<p>I am a self-starter, self-confident, organized and determined person. I am motivated to always keep learning and I am sure I can show my knowledge and skills in all steps of development.</p>\n\n<p><a href=\"http://au.linkedin.com/in/andersonfetter/\" rel=\"nofollow\">http://au.linkedin.com/in/andersonfetter/</a></p>\n','0','3','0','1047164');
