INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3257,1517,'2014-02-05T06:12:24.907','JeopardyTempest','2018-02-28T06:40:34.687','null','Orlando, FL, United States','<p>I am a:  </p>\n\n<ul>\n<li>Meteorologist (BS University Oklahoma, coursework for Masters at Florida State)</li>\n<li>Past teacher (ranging from youth to college)</li>\n<li>Big believer in open source and improving information (active on OSM, Wikipedia, etc)</li>\n<li>Major geography aficionado</li>\n<li>Traveler (<a href=\"http://mob-rule.com/user-gifs/jeopardytempest.gif\" rel=\"nofollow noreferrer\">US</a>, UK, Denmark)</li>\n<li>Past storm chaser (after 5/31/13, have decided there are more important things, though still spot around central FL)</li>\n<li>Past college intramural sports referee</li>\n<li>Programmer (PHP, Perl, C++, VB, Excel, Linux shells, etc)  </li>\n</ul>\n\n<p>And most importantly, a very passionate Christian.  I wasn\'t the typical Christian.  I didn\'t grow up in a religious family.  I was an ardent atheist.  But God showed even a wretch like me at 17.  Sometimes the simplest answer, even as preposterous as it seems, is the truth.  And we are the ones who don\'t want to see it, because we\'re too prideful, too worried about what we\'ll lose.<br>\nJesus Christ is Lord.<br>\nSeek ardently and you will find Him.</p>\n\n<p>Many of my passions stem from that, whether it\'s answering questions in place like this, providing weather information (feel free to message me anytime for meteorological advice), teaching, or trying to make a difference.<br>\nTo God alone be every glory!</p>\n','42','527','10','3645794');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3258,101,'2014-02-05T21:34:49.110','Andrew Brown','2014-02-05T21:34:49.110','https://wisletics.com','Madison, WI','<p>BS in Genetics.</p>\n\n<p>Started learning PHP as a hobby in 2004. I love it so much that now I do it as a profession.</p>\n\n<p>Started as a procedural coder, but now fully into OOP.</p>\n\n<p>I started with CodeIgniter, and while it was a good introduction to frameworks, I quickly outgrew it. I then switched over to Laravel. For all the times I felt like I had to hack the framework to get things to work in CI, I\'ve not run into that issue yet in Laravel, and I\'m loving it.</p>\n\n<p>Really enjoy contributing on Github.</p>\n\n<p>Always interested in learning more about programming.</p>\n','0','0','0','1166607');
