INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3265,3,'2014-02-07T00:17:28.480','decision maker','2016-12-31T06:48:55.447','http://linkedin.com/in/ricardojgmateus/','Portugal','<p>Analytics consultant and researcher with a passion for data-driven decision-making using:\n- descriptive analytics, such as business intelligence, data mining, problem structuring, system analysis, performance measurement, behavioral sciences, or nudging;\n-predictive analytics, such as statistics, machine learning, data science, artificial intelligence, simulation, system dynamics, decision trees, forecasting, prediction, regression, and risk analysis;\n- prescriptive analytics, such as optimization and planning, multicriteria analysis and evaluation, portfolio optimization and resource allocation, negotiation analysis, project management, game theory, scheduling, pricing, meta-heuristics, and constraint programming.</p>\n\n<p>More than two hundred consultancy projects and works delivered to top-tier organizations worldwide, including Johnson&amp;Johnson, European Commission, Syngenta, BathCo, the Portuguese State, GALP, Infraestruturas de Portugal, Águas de Portugal, EPAL, REN, IPE, EPUL, Metro de Lisboa, Metro do Porto, AMB3E, and several Central, Regional, and Local Governments.</p>\n\n<p>Broad area of applications and industries, particularly procurement &amp; purchasing, supply chain &amp; logistics, sustainability &amp; ecosystem services, energy, health, defense, and government.</p>\n\n<p>Sound knowledge and experience using a wide range of analytical tools, including programming (C++, Python, FORTRAN, VB, VBA), web (HTML, JavaScript, Node.js, ASP, PHP), databases (MongoDB, SQL Server, Access, MySQL, QGIS), optimization (OpenSolver, AIMMS, GAMS, CPLEX, IBM OPL, SolverStudio, MiniZinc), statistics and data science (R, Pythin, WEKA, Azure, SAS, SPSS), multicriteria evaluation (M-MACBETH, Hiview, VISA, Equity), and simulation (Anylogic, InsightMaker, Vensim, STELLA, Risk).</p>\n\n<p>Several publications in high-impact scientific journals and international conferences.</p>\n\n<p>Specialties: Analytics, Operations Research, Decision theory, Data Science, Multicriteria Analysis, Procurement &amp; Auctions, Forest Management</p>\n','1','0','0','3378070');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3266,101,'2014-02-07T09:27:07.570','RafaSashi','2014-09-27T10:26:57.623','http://recuweb.com','France','<p><strong>About Rafasashi</strong> </p>\n\n<p>Web development primarily in <code>php</code></p>\n\n<p>I have a polyvalent experience, from the fund management industry to the direct investment, with a special emphasis on Real Estate activities and Web Businesses.</p>\n\n<p><a href=\"https://twitter.com/rafasashi\" rel=\"nofollow\">@rafasashi</a> | <a href=\"http://careers.stackoverflow.com/rafasashi\">Careers 2.0</a> | <a href=\"https://www.linkedin.com/in/raphaeldartigues\" rel=\"nofollow\">LinkedIn</a></p>\n\n<p><strong>About Recuweb.me</strong> </p>\n\n<p>A social media monitoring platform providing tools to automate and monitor actions on social media such as Twitter.</p>\n\n<ul>\n<li><p><a href=\"http://twitter.recuweb.me\" rel=\"nofollow\">EN - Twitter automation</a></p>\n\n<p><a href=\"https://twitter.com/recuweb\" rel=\"nofollow\">@recuweb</a> | <a href=\"https://www.facebook.com/pages/Recuwebcom/1446735682217187\" rel=\"nofollow\">Facebook page</a> | <a href=\"https://www.linkedin.com/company/recuweb-com\" rel=\"nofollow\">Linkedin page</a></p></li>\n</ul>\n\n<p><strong>About Recuweb.com</strong> </p>\n\n<p>A multimedia content aggregation platform providing thematic and location filters to search, follow and share web resources. </p>\n\n<ul>\n<li><a href=\"http://en.recuweb.com/\" rel=\"nofollow\">EN - Feed aggregator thematic &amp; multimedia</a></li>\n<li><a href=\"http://fr.recuweb.com/\" rel=\"nofollow\">FR - Agregateur de flux d\'information thématique multimedia</a></li>\n<li><a href=\"http://es.recuweb.com/\" rel=\"nofollow\">ES - Agregador de flujos de informacion tematico multimedia</a></li>\n</ul>\n','0','1','0','2860702');
