INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3308,101,'2014-02-16T14:40:49.493','Alex Tape','2014-02-16T14:40:49.493','null','Germany','<p>i am a student of information science and information management focused on applied computer science</p>\n\n<hr>\n\n<p><strong>pieces of wisdom:</strong></p>\n\n<ol>\n<li>mathmatics is the language of nature</li>\n<li>everything around us can be represented and understood through numbers</li>\n<li>if you graph these numbers, of any system, patterns emerge</li>\n<li>there are patterns - everywhere in nature!</li>\n</ol>\n\n<hr>\n\n<p>-----BEGIN GEEK CODE BLOCK-----<br>\nVersion: 3.1<br>\nGIT/CS d-- s-:->: a- C++++ UL++ P+ L++ E-- W+(-) N K++ w++ M- PS+>$ Y+<br>\nPGP-- R* tv+ b+ D+ e r+++ y++++<br>\n------END GEEK CODE BLOCK------<br></p>\n\n<hr>\n\n<p>@github: <a href=\"https://github.com/AlexTape\" rel=\"nofollow\">https://github.com/AlexTape</a> (tiny:)</p>\n\n<p>@perlmonks: <a href=\"http://perlmonks.org/?node=alextape\" rel=\"nofollow\">http://perlmonks.org/?node=alextape</a></p>\n\n<p>@latest: <a href=\"http://opac.lbs-hildesheim.gbv.de/DB=1/SET=2/TTL=1/MAT=/NOMAT=T/CLK?IKT=1004&amp;TRM=Tebbje,Alexander\" rel=\"nofollow\">Markerless Object Recognition for Augmented Reality Apps</a></p>\n\n<p>@work: i have to use <a href=\"http://www.workrave.org/\" rel=\"nofollow\">http://www.workrave.org/</a> :)</p>\n','0','0','0','1713863');
