INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3323,101,'2014-02-19T01:24:22.213','David Schwartz','2015-08-13T03:20:42.940','http://zeldafreak.github.io/','Dallas, TX','<p>I am a <em>software engineer</em> with a focus on <em>Microsoft platforms and technologies</em>, including a decade of experience leveraging the <strong><a href=\"http://msdn.microsoft.com/en-us/library/z1zx9t92.aspx\" rel=\"nofollow noreferrer\">C# programming language</a></strong> and the <strong><a href=\"http://msdn.microsoft.com/en-us/library/zw4w595w.aspx\" rel=\"nofollow noreferrer\">.NET Framework</a></strong> to build a wide variety of client and <a href=\"http://msdn.microsoft.com/en-us/library/d56de412(v=vs.110).aspx\" rel=\"nofollow noreferrer\">server applications</a> for the <em>Retail</em>, <em>Cloud Services</em>, and <em>Insurance</em> industries. </p>\n\n<p>The majority of my career has been <a href=\"http://msdn.microsoft.com/en-us/library/bb400852(v=vs.110).aspx\" rel=\"nofollow noreferrer\">web applications</a> and <a href=\"http://msdn.microsoft.com/en-us/library/dd456779(v=vs.110).aspx\" rel=\"nofollow noreferrer\">services</a> using <strong><a href=\"http://www.asp.net/mvc\" rel=\"nofollow noreferrer\">ASP.NET MVC</a></strong> (<em>incl.</em> <strong><a href=\"http://www.asp.net/web-api\" rel=\"nofollow noreferrer\">Web API</a></strong>) and <strong><a href=\"http://msdn.microsoft.com/en-us/library/dd456779.aspx\" rel=\"nofollow noreferrer\">Windows Communication Foundation</a></strong> (WCF) in <a href=\"http://msdn.microsoft.com/en-us/library/e80y5yhx(v=vs.110).aspx\" rel=\"nofollow noreferrer\">tandem</a> with database technologies such as <strong>Microsoft SQL Server</strong>, <strong>MongoDB</strong>, and <strong>Apache Solr</strong> (Lucene). I also spent several years working with less common .NET technologies such as legacy <strong><a href=\"http://msdn.microsoft.com/en-us/library/96bef039(v=vs.110).aspx\" rel=\"nofollow noreferrer\">Windows Forms</a></strong>, current-generation <strong><a href=\"http://msdn.microsoft.com/en-us/library/ms754130(v=vs.110).aspx\" rel=\"nofollow noreferrer\">Windows Presentation Foundation</a></strong> (WPF), and the <strong><a href=\"http://msdn.microsoft.com/en-us/library/cc838158(VS.96).aspx\" rel=\"nofollow noreferrer\">Silverlight</a></strong> browser plugin.</p>\n\n<p>I am especially interested in the .NET Framework\'s <a href=\"http://msdn.microsoft.com/en-us/library/hh156536(v=vs.110).aspx\" rel=\"nofollow noreferrer\">unique performance characteristics</a>, due to factors like <a href=\"http://msdn.microsoft.com/en-us/library/f144e03t(v=vs.110).aspx\" rel=\"nofollow noreferrer\">automatic memory management</a>, <a href=\"http://msdn.microsoft.com/en-us/library/zcx1eb1e(v=vs.110).aspx\" rel=\"nofollow noreferrer\">type safety</a>, and <a href=\"http://msdn.microsoft.com/en-us/library/8a3x2b7f(v=vs.110).aspx\" rel=\"nofollow noreferrer\">reliability guarantees</a>; further, I study practical high-performance design techniques such as <a href=\"http://msdn.microsoft.com/en-us/library/hh156548(v=vs.110).aspx\" rel=\"nofollow noreferrer\">parallelization</a> and <a href=\"http://msdn.microsoft.com/en-us/library/dd997357(v=vs.110).aspx\" rel=\"nofollow noreferrer\">caching</a>. Historically, developers have been able to ignore performance, but the advent of the cloud has changed things. Often, leveraging the cloud means taking a given task and breaking it into sub-tasks that can be processed at different speeds organically. That division of labor necessitates a better understanding of any given operation\'s cost. As a result, I find that my performance expertise is getting called upon more and more by my employer.</p>\n','0','0','0','171596');
