INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3365,101,'2014-02-27T06:01:47.003','Mario Radomanana','2015-02-25T12:47:04.650','http://www.doyoubuzz.com/mario-johnathan-radomanana','Paris, France','<p>I am a php developer with 5 years of experience in the domain of web programming.</p>\n\n<p>I am specialized in the following technologies :</p>\n\n<p>Framework : Symfony</p>\n\n<p>CMS : Wordpress, Prestashop</p>\n\n<p>Gists : <a href=\"https://gist.github.com/xanou\" rel=\"nofollow noreferrer\">https://gist.github.com/xanou</a></p>\n','0','0','0','167682');
