INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3369,101,'2014-02-27T14:09:03.440','Chris Skardon','2014-02-27T14:09:03.440','http://www.xclave.co.uk','United Kingdom','<p>I\'m a developer developing primarily in Microsoft technologies:</p>\n\n<ul>\n<li>ASP.NET MVC, (Web API)</li>\n<li>trusty console apps :)</li>\n<li>XAML apps,</li>\n</ul>\n\n<p>I\'ve been moving towards the web side of things, so JQuery, LESS etc are becoming increasingly important.</p>\n\n<p>Database wise - whilst I\'ve done a lot of the different types, at the moment most of my time is spent with:</p>\n\n<ul>\n<li>RavenDB (Document DB)</li>\n<li>Neo4j (Graph DB)</li>\n</ul>\n\n<p>And Neo4j is winning in being one of the nicest DB\'s I\'ve <em>ever</em> worked with. I\'ve dealt with RDBMS databases (SQL Server, MySQL), but I wouldn\'t class myself as a DBA :)</p>\n\n<p>I\'m learning F# and Haskell (slowly), but at the moment I am mostly a C# developer (which I have to say I thoroughly enjoy).</p>\n\n<p>Personally - I waveski (whaaaat? <a href=\"http://www.youtube.com/watch?v=0wOCsSFm6-c\" rel=\"nofollow\" title=\"Waveskiing\">Video here</a>) and run competitions in the UK (via <a href=\"http://www.tournr.com\" rel=\"nofollow\">Tournr</a>), I also do the traditional things of reading, eating, breathing, but we all know that... and I\'ve just taken up (after a 20 year hiatus) the Piano.</p>\n','0','0','0','1678');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3370,179,'2014-02-27T15:15:09.460','Lynob','2018-02-08T22:39:37.380','http://www.scarycode.com','null','<p>I would rather be free in my mind, and be locked up in a prison cell, than to be a coward and not be able to say what I want.</p>\n\n<p>I despise the media... They\'re destroying reality, turning everything into media.</p>\n','11','7','0','186123');
