INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3382,101,'2014-03-01T12:47:31.990','Vadim Gremyachev','2015-04-12T19:13:47.067','http://blog.vgrem.com/','Helsinki, Finland','<p>Currently a software developer at HiQ Finland Oy and <a href=\"https://mvp.microsoft.com/en-us/PublicProfile/5002297\" rel=\"nofollow noreferrer\">Microsoft MVP</a> </p>\n\n<p>I\'m available for paid one-on-one assistance via <a href=\"https://www.codementor.io/vgrem\" rel=\"nofollow noreferrer\">CodeMentor</a>.</p>\n\n<p>A few open source projects I\'m working on:</p>\n\n<ul>\n<li><a href=\"https://github.com/vgrem/phpSPO\" rel=\"nofollow noreferrer\">Office 365 REST client for PHP</a></li>\n<li><a href=\"https://github.com/vgrem/CSOMNode\" rel=\"nofollow noreferrer\">SharePoint Client Object Model (CSOM) API for Node.js</a></li>\n<li><a href=\"https://github.com/vgrem/Office365-REST-Python-Client\" rel=\"nofollow noreferrer\">Office 365 REST client for Python</a></li>\n</ul>\n\n<hr>\n\n<p>Various badge milestones:</p>\n\n<ul>\n<li>1th to receive the silver <a href=\"http://sharepoint.stackexchange.com/help/badges/112/client-object-model\">client-object-model</a> badge in <a href=\"http://sharepoint.stackexchange.com/\">SharePoint community</a></li>\n<li>1th to receive the silver <a href=\"http://sharepoint.stackexchange.com/help/badges/115/javascript\">JavaScript</a> badge in <a href=\"http://sharepoint.stackexchange.com/\">SharePoint community</a></li>\n<li>bronze <a href=\"http://stackoverflow.com/help/badges/549/google-maps?userid=1375553\">Google Maps</a> badge in <a href=\"http://stackoverflow.com/\">Stack Overflow</a> </li>\n</ul>\n\n<h1>SOreadytohelp</h1>\n','0','0','0','1461295');
