INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3459,101,'2014-03-21T14:01:21.840','Pablo Marin-Garcia','2014-03-21T18:16:50.530','null','null','<p>Currently I work as a Computer Biologist at FUNDACIÓN INVESTIGACIÓN CLÍNICO DE VALENCIA-INCLIVA after being working at Genome Campus, Cambridge-UK (both Sanger and EBI) for more than 10 years. My current job deals with genomic analysis of complex diseases in humans using NGS.</p>\n\n<p>I have a Zoology degree, a master in genetics and evolution and a PhD in molecular genetics in complex diseases (Hypertension).</p>\n\n<p>I create software applications for genetic analysis and genomic visualization using Perl (bioperl API, ensEMBL API), R (bioconductor) and javascript (jquery and extjs)</p>\n','1','3','0','188390');
