INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3544,101,'2014-04-08T23:45:33.833','Brian Hadaway','2014-06-19T18:04:27.997','http://www.brianhadaway.com','Seattle, WA','<p>My name is Brian and I’ve studied Physics and Marketing, worked in the Music Industry and developed interactive projects for agencies in Nashville, Chicago and New York. My work for some of the biggest brands in the world has appeared in Times Square, on national TV and in museum installations. Currently, I’m a Senior Developer at POSSIBLE where I building UIs using HTML5, CSS and JavaScript.</p>\n','0','0','0','1223689');
