INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3547,101,'2014-04-09T16:11:18.817','Hashir Omer','2014-07-28T09:41:32.767','null','Pakistan','<p><strong>Some of the finest Einstein\'s quotes</strong></p>\n\n<p><strong>If you can\'t explain it simply, you don\'t understand it well enough</strong></p>\n\n<p><strong>Its a miracle that curiosity survives formal education</strong></p>\n\n<p><strong>Once we accept our limits, we go beyond them</strong></p>\n\n<p><strong>Logic will take you from A to B, imagination will take you everywhere</strong></p>\n\n<p><strong>Anyone who has never made a mistake has never tried anything new</strong></p>\n\n<p><strong>Gravitation is not possible for people falling in love</strong></p>\n\n<p><strong>Heroism on command,senseless violence and all the loathsome nonsense that goes by the name of Patriotism-how passionately I hate them!</strong></p>\n\n<p><strong>It was the experience of mystery mixed with fear that engendered religion</strong></p>\n\n<p><strong>i have no special talents. I am only passionately curious.</strong></p>\n','0','2','0','3166110');
