INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (3763,2780,'2014-06-08T01:23:41.343','pacoverflow','2018-03-02T04:03:26.830','null','Pacland','<p><a href=\"https://i.stack.imgur.com/dv2sc.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/dv2sc.png\" alt=\"enter image description here\"></a></p>\n\n<p>Inventor of <a href=\"http://puzzling.stackexchange.com/search?tab=votes&amp;q=[computer-puzzle]%20[rebus]%20user%3A4450%20is%3Aquestion\">programming and command line rebus puzzles</a>.</p>\n\n<p>The goal of Stack Exchange is to <a href=\"https://meta.stackoverflow.com/a/255019/782011\">build a repository of questions and answers</a>, so you should do the following:</p>\n\n<ul>\n<li><strong>Self-answer your own questions</strong><br>\n\"<a href=\"http://blog.stackoverflow.com/2011/07/its-ok-to-ask-and-answer-your-own-questions/\">It is not merely OK to ask and answer your own question, it is <em>explicitly encouraged</em>.</a>\" -Jeff Atwood, Co-founder</li>\n<li><strong>Make up hypothetical questions</strong><br>\n\"<a href=\"http://meta.stackexchange.com/questions/250981/new-ui-encourages-askers-to-confirm-or-dispute-duplicate-votes#comment819448_250992\">I\'d love to believe thousands of people decide every day to <em>make up questions</em> they hope will be interesting to others</a>\" -Shog9, Community Manager</li>\n</ul>\n\n<p>Anyone with the username \"pacoverflow\" on a different web site is not me.</p>\n\n<p>Email: pacoverflow@gmail.com</p>\n','49','59','22','410264');
