INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (4786,1,'2014-06-13T09:45:02.870','Udit Desai','2016-09-18T23:03:10.160','http://blog.incognitech.in','Santa Cruz, CA','<p>Udit hails from India &amp; is found working on his laptop with Pink Floyd, Dire Straits or Hans Zimmer OSTs. He graduated in Computer Science and holds a major in Information Technology. Udit came across WordPress when he joined rtCamp. And in no time he grasped the ins &amp; outs of WordPress and made it the crux of his profession.</p>\n\n<p>He’s a proud contributor to WordPress 4.1, 4.2 &amp; 4.3, and maintains a couple of plugins on the WordPress repository &amp; Github with the belief in Open Source future of Web &amp; its equilibrium.</p>\n\n<p>When he’s not looking at his black window of terminal, he is rambling into his incognito mind, dreaming about that damn cool EF180mm f/3.5L Macro USM Lens with a pixel perfect picture from his DSLR or how good cricketer he would have been; if not a developer. He\'s also a Foodie &amp; a Movie-buff!</p>\n','1','0','0','2810917');
