INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (4863,101,'2014-06-24T17:45:27.153','Dan Drews','2014-07-17T15:26:56.547','null','Nebraska','<p>I love code.</p>\n','0','0','0','2411207');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (4865,304,'2014-06-24T18:31:24.090','Bruce James','2015-12-16T18:09:13.723','http://www.angelfire.com/md3/baruchgershom/ynotj.html','Maryland','<p>I converted to Orthodox Judaism in 1980.  My conversion story was originally published in the Baltimore Jewish Times and was reprinted in its entirety by <a href=\"http://judaism.about.com/od/conversiontojudaism/a/baruch.htm\" rel=\"nofollow\">About.com</a> and in excerpt form by Rabbi Maurice Lamm in his book <em>Becoming a Jew</em>.  I learned Daf Yomi for 10 years completing the entire 11th Cycle and getting half way through the 12th.  I stopped shortly after being diagnosed with Parkinson\'s Disease and recognized I could not stay up for late night Daf classes nor keep up if I did not.  For the 20th anniversary of my conversion, I decided to teach the last daf of Kesubos and contacted Art Scroll for help, as they had not yet published their translation of that daf.  Rabbi Yehezkel Danziger surprised me by suggesting that I try translating the page for publication in order to make my celebration \"more special.\"  It took me 3 months to translate the main text and the Rashi, but I submitted my work and, after much editing, received an editorial credit in Volume III of Art Scroll\'s Kesuvos translation.  I have been a frequent contributor to the About.com Judaism board and specialized in counter-missionary posts.  My website, \"A Primer:  Why Jews Cannot Believe in Jesus\" is designed as a quick introduction to major points I tend to make when dealing with missionaries.  In my secular life, I am an attorney for the Federal Government.</p>\n','5','8','0','2180498');
