INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (4870,231,'2014-06-24T22:05:45.027','Jörg W Mittag','2018-02-22T08:09:30.310','http://StackOverflow.Com/users/2988/','Karlsruhe, Germany','<p>Not a software developer in the sense that I write software as part of my job or otherwise get paid to do so. Also, not a developer in the sense that I write software for others.</p>\n\n<p>I write software for myself, often for no other reason than that I want to. (What I call <a href=\"http://Intertwingly.Net/blog/2006/03/11/Recreational-Programming/\" rel=\"nofollow\">recreational programming</a>.)</p>\n\n<p>Actually, I’m currently forcibly confined to recreational programming, as I’m looking for a job.</p>\n\n<p>My current go-to language is <a href=\"http://Ruby-Lang.Org/\" rel=\"nofollow\">Ruby</a>, but I’m interested in all sorts of other languages as well: <a href=\"http://NewspeakLanguage.Org/\" rel=\"nofollow\">Newspeak</a>, <a href=\"http://Seph-Lang.Org/\" rel=\"nofollow\">Seph</a>, <a href=\"http://Ioke.Org/\" rel=\"nofollow\">Ioke</a>, <a href=\"http://SelfLanguage.Org/\" rel=\"nofollow\">Self</a>, <a href=\"http://IoLanguage.Com/\" rel=\"nofollow\">Io</a>, <a href=\"http://SlateLanguage.Org/\" rel=\"nofollow\">Slate</a>, <a href=\"http://Reia-Lang.Org/\" rel=\"nofollow\">Reia</a>, <a href=\"http://Cobra-Language.Com/\" rel=\"nofollow\">Cobra</a>, <a href=\"http://ProjectFortress.Java.Net/\" rel=\"nofollow\">Fortress</a>, <a href=\"http://SapphireSteel.Com/The-Sapphire-Programming-Language/\" rel=\"nofollow\">Sapphire</a>, <a href=\"http://Haskell.Org/\" rel=\"nofollow\">Haskell</a>, <a href=\"http://Scala-Lang.Org/\" rel=\"nofollow\">Scala</a>, <a href=\"http://Clojure.Org/\" rel=\"nofollow\">Clojure</a>, <a href=\"http://Racket-Lang.Org/\" rel=\"nofollow\">Racket</a>, <a href=\"http://GoLang.Org/\" rel=\"nofollow\">Go</a>, <a href=\"http://Fancy-Lang.Org/\" rel=\"nofollow\">Fancy</a>, <a href=\"http://Po.isono.us/\" rel=\"nofollow\">Poison</a>, and many more.</p>\n','3','3','0','2172');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (4871,101,'2014-06-24T22:46:20.283','Reuben','2014-06-24T22:46:20.283','http://reuben-in-rl.blogspot.com','Brisbane, Australia','<p>Software developer who mainly deals with PHP, Python/Django and web development, these days.</p>\n\n<p>Previous roles have also had me working with Progress 4GL and Java.</p>\n\n<p>Has dabbled with Perl, C, C#, but they\'re not my cup of tea on a day to day basis.</p>\n','0','1','0','138589');
