INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6101,101,'2014-07-15T12:32:50.633','kay','2017-04-03T15:13:40.997','https://github.com/Kijewski','Berlin, Germany','<p>Working at my alma mater, where I studied <em>CS</em> in order to aid the <em>forces of light</em>, and thwart the <em>forces of darkness</em>.</p>\n\n<p>I\'m fluent in Python, C++, C, Cython, JavaScript, CSS, HTML, (and Java if I have to). At one point I knew Haskell, Pascal, Erlang, Prolog, Matlab, but forgot most about it.</p>\n\n<p><a href=\"https://imgur.com/RoxeZGh\" rel=\"nofollow noreferrer\"><img src=\"https://i.imgur.com/RoxeZGh.gif\" alt=\"\"></a></p>\n','0','1','0','181901');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6103,103,'2014-07-15T15:47:46.377','innisfree','2017-10-28T02:08:30.397','https://andrewfowlie.github.io/','null','<p>My interests are high-energy physics, including LHC and dark matter phenomenology, and the application of Bayesian statistics in those topics. For more information about my work, see my <a href=\"https://andrewfowlie.github.io/\" rel=\"nofollow noreferrer\">personal webpage.</a></p>\n\n<blockquote>\n  <p>I will arise and go now, and go to Innisfree, And a small cabin build\n  there, of clay and wattles made; Nine bean rows will I have there, a\n  hive for the honey bee, And live alone in the bee loud glade.</p>\n  \n  <p>And I shall have some peace there, for peace comes dropping slow,\n  Dropping from the veils of the morning to where the cricket sings;\n  There midnight\'s all a glimmer, and noon a purple glow, And evening\n  full of the linnet\'s wings.</p>\n  \n  <p>I will arise and go now, for always night and day I hear lake water\n  lapping with low sounds by the shore; While I stand on the roadway, or\n  on the pavements grey, I hear it in the deep heart\'s core..</p>\n</blockquote>\n','1','8','0','2663485');
