INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6153,56,'2014-07-23T21:45:10.907','Ayan Mullick','2016-08-16T03:05:01.743','http://about.me/ayanm','Montpelier, VT, USA','<p>I am Azure IaaS &amp; Wintel Architect with the DataQuest Corp. I like automation thru Powershell and the Cloud technology.</p>\n\n<p>Seeking senior level assignments in the domain of Azure-IaaS, MS Clustering, Windows Virtualization and technical training as a Hybrid Windows Cloud Architect preferably in IT industry in a location-independent profile. </p>\n\n<p>I\'m a Glider Pilot and an avid cyclist.</p>\n','1','1','0','3263859');
