INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6158,118,'2014-07-25T11:49:25.610','ᔕᖺᘎᕊ','2016-10-02T18:17:14.270','http://stackexchange.com/users/4337810/shub','The Intersect','<p>I live in England UK, and I\'m in Year 12, doing my A Levels.</p>\n\n<p>I\'m interested in <a href=\"/questions/tagged/html\" class=\"post-tag\" title=\"show questions tagged &#39;html&#39;\" rel=\"tag\">html</a>, <a href=\"/questions/tagged/php\" class=\"post-tag\" title=\"show questions tagged &#39;php&#39;\" rel=\"tag\">php</a>, <a href=\"/questions/tagged/javascript\" class=\"post-tag\" title=\"show questions tagged &#39;javascript&#39;\" rel=\"tag\">javascript</a>, <a href=\"/questions/tagged/jquery\" class=\"post-tag\" title=\"show questions tagged &#39;jquery&#39;\" rel=\"tag\">jquery</a>, <a href=\"/questions/tagged/python\" class=\"post-tag\" title=\"show questions tagged &#39;python&#39;\" rel=\"tag\">python</a>, and <a href=\"/questions/tagged/css\" class=\"post-tag\" title=\"show questions tagged &#39;css&#39;\" rel=\"tag\">css</a>.</p>\n\n<p>I LOVE <a href=\"http://www.nbc.com/chuck?nbc=1\" rel=\"nofollow noreferrer\">Chuck</a>!! :D</p>\n\n<p><a href=\"http://stackexchange.com/users/4337810\">\n<img src=\"http://stackexchange.com/users/flair/4337810.png\" width=\"208\" height=\"58\" alt=\"profile for ᔕᖺᘎᕊ on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for ᔕᖺᘎᕊ on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<p>Contact me at shubatse@gmail.com -- yeah; I created an email account <em>just for SE</em>... because why not!? :P</p>\n\n<h3>Userscripts</h3>\n\n<p>I\'ve made some userscripts for the Stack Exchange sites you may be interested in:</p>\n\n<ul>\n<li>My SOOF userscript, now <a href=\"http://stackapps.com/questions/6091\">Stack Overflow Extras</a>, has a bunch of optional features you can add to \'enhance\' SE (examples of these features are: pre-defined edit reasons; keyboard shortcuts for pre-defined comments; highlight answerer\'s names in comments, and so on)</li>\n<li>My <a href=\"http://stackapps.com/q/6571/26088\">SE WYSIWYG Editor</a> userscript adds a WYSIWYG (What You See Is What You Get) Editor to Stack Exchange - definitely worth a try! :)</li>\n<li>My <a href=\"http://stackapps.com/q/6353/26088\">Freehand Circles Drawing Tool</a> userscript allows you to draw directly onto images you see on SE sites - you can change the brush colour and width to draw <em>anything</em> you might want - it\'s great fun, useful and easy to use :)</li>\n<li>My <a href=\"http://stackapps.com/q/6316/26088\">Self Destructing Comments</a> userscript allows you to set a date at which a comment you wrote should be deleted - useful for those \'comment cleanup\', \'thanks\', or \'welcome\' comments.</li>\n<li>My <a href=\"http://stackapps.com/q/6460/26088\">SE Desktop Notifications</a> userscript shows desktop notifications whenever there is new activity on a question open in a new tab - useful for keeping track of questions without having to scroll through the answers to see if there is a new edit, or comment, or score change :)</li>\n<li>See <em>many</em> more at my <a href=\"http://stackapps.com/users/26088/\">Stack Apps profile</a> :)</li>\n</ul>\n\n<p><sub><sub><em>ǝɯɐuɹǝsn ʎɯ ɹoɟ ɯoɔ˙sloqɯʎsɟ˙ʍʍʍ oʇ sʞuɐɥʇ</em></sub></sub></p>\n','3','1','0','4337810');
