INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6224,101,'2014-08-12T09:11:34.737','NicoFerna','2014-08-12T09:11:34.737','http://www.efootballclub.com','Copenhagen, Denmark','<p>Have recently dived in the wonderful world of Ruby on rails and front-end development to work on my personal project www.efootballclub.com, which is a social network for amateur football players around the World.</p>\n','0','0','0','2035258');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6226,101,'2014-08-14T01:51:58.700','CopperKettle','2014-12-05T09:47:47.187','http://en.wiktionary.org/wiki/User:CopperKettle','Yekaterinburg, Russia','<p>A freelance translator, born and living in Russia.</p>\n\n<p>Useful links:<br>\n<a href=\"http://meta.stackoverflow.com/editing-help\">StackExchange Markdown help</a>  </p>\n\n<p>\"Nothing more true than not to trust your senses; And yet what are your other evidences?\"</p>\n\n<p>To read up:<br>\n1. True Light Verb vs. Vague Action Verb<br>\n2. <a href=\"http://ell.stackexchange.com/tags/aspect/info\">aspect</a> - In English the perfect construction does not express perfective aspect; that is expressed by the simple past form.  The name perfect for the <em>HAVE</em>+past participle construction is a misleading historical accident.\n3. PEU 90 - be with auxiliary do (CGEL: \"lexical <em>be</em>\"; Quirk et al - ? )<br>\n4. Actionsart<br>\n5. NICE auxiliaries criteria: negation, inversion, emphasis and code.<br>\n6.  Quirk et al. p.839 - optative mood<br>\n7. <a href=\"https://en.wikipedia.org/wiki/Veridicality\" rel=\"nofollow\">Veridicality</a><br>\n8. I doubt this (all) <a href=\"http://ell.stackexchange.com/questions/38977/more-vs-the-more-i-doubt-this-the-more-because\">the more</a> - <strong>the</strong> <a href=\"http://english.stackexchange.com/questions/3944/what-are-sentences-like-the-longer-x-the-more-y-called-and-can-they-be-used-i/3945#3945\">as modifier or adverb</a></p>\n','0','0','0','3083107');
