INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6240,469,'2014-08-17T13:22:36.303','Scimonster','2017-11-11T17:42:00.627','null','Israel','<p><a href=\"http://stackexchange.com/users/3846032/scimonster\"><img src=\"http://stackexchange.com/users/flair/3846032.png\" width=\"208\" height=\"58\" alt=\"profile for Scimonster on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Scimonster on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n\n<p>I\'m Scimonster. I\'m a homeschooled teenage computer geek.</p>\n\n<p><a href=\"http://goo.gl/b9EuM2\" rel=\"nofollow noreferrer\">May your code always be like kosher lettuce.</a></p>\n\n<p>I think that using a capital \"i\" in the middle of a sentence is obsolete. Please don\'t remove it from my posts. Or whatever, it\'s too hard to keep up with all you old-style-grammar people. :(</p>\n\n<p>You can find me on:</p>\n\n<ul>\n<li><a href=\"http://stackexchange.com/users/3846032/scimonster\">Stack Exchange</a></li>\n<li><a href=\"https://github.com/Scimonster\" rel=\"nofollow noreferrer\">GitHub</a></li>\n<li><a href=\"http://scratch.mit.edu/users/scimonster/\" rel=\"nofollow noreferrer\">Scratch</a> (fmr. Community Moderator)</li>\n<li><a href=\"http://wiki.scratch.mit.edu/wiki/User:Scimonster\" rel=\"nofollow noreferrer\">Scratch Wiki</a> (admin)</li>\n</ul>\n\n<p>You will not find me on:</p>\n\n<ul>\n<li>Facebook</li>\n<li>Twitter</li>\n<li>Reddit</li>\n<li>Other social networking sites</li>\n</ul>\n\n<p><a href=\"http://area51.stackexchange.com/proposals/79791/toy-construction?referrer=wuY59ZBbDdHhckhXA-XIrg2\"><img src=\"http://area51.stackexchange.com/ads/proposal/79791.png\" width=\"220\" height=\"250\" alt=\"Stack Exchange Q&amp;A site proposal: Toy Construction\" /></a>\n<a href=\"http://area51.stackexchange.com/proposals/75348/hebrew-language?referrer=wuY59ZBbDdHCzDHh3-zT9w2\"><img src=\"http://area51.stackexchange.com/ads/proposal/75348.png\" width=\"220\" height=\"250\" alt=\"Stack Exchange Q&amp;A site proposal: Hebrew Language\" /></a>\n<a href=\"http://area51.stackexchange.com/proposals/75548/homeschooling?referrer=wuY59ZBbDdGw1u2r-9NF4A2\"><img src=\"http://area51.stackexchange.com/ads/proposal/75548.png\" width=\"220\" height=\"250\" alt=\"Stack Exchange Q&amp;A site proposal: Homeschooling\" /></a></p>\n','11','83','0','3846032');
