INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6278,101,'2014-08-25T19:12:40.917','J. Musser','2015-02-11T16:29:11.540','http://gardening.stackexchange.com/','Lancaster, Pennsylvania','<p>Here\'s a shout-out to the <a href=\"http://stackexchange.com/users/current\"><strong>hero of Stack Exchange</strong></a>! You\'re the best!</p>\n\n<p>Feel free to contact me (@J.Musser) in our site chat room, <a href=\"http://chat.stackexchange.com/rooms/546/the-garden-shed\"><strong>The Garden Shed</strong></a>, if you have something you want to tell me, or just want to chat. Or you can email me at <strong>frank.j.musser@gmail.com</strong> if you want to contact me personally for any reason (take that literally :D). I only use that email for Stack Exchange, so expect a slight reply delay. </p>\n\n<p>pm me here:</p>\n\n<p><img src=\"https://i.imgflip.com/z7eiv.gif\" width=\"421\" ></p>\n\n<p>Here\'s my network flair (if you are a member of Stack Exchange, find your flair <a href=\"http://stackexchange.com/users/current?tab=flair\">here</a>) It show\'s some of your accomplishments:</p>\n\n<p><a href=\"http://stackexchange.com/users/531689/jmusser\"><img src=\"http://stackexchange.com/users/flair/531689.png\" width=\"208\" height=\"58\" alt=\"profile for jmusser on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for jmusser on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n\n<hr>\n\n<h3>Because I\'m a landscaper/plant health care guy, here\'s a brief description of my local area and climate:</h3>\n\n<ul>\n<li><strong>Location:</strong> Lancaster, Pennsylvania, United States </li>\n<li><strong>USDA hardiness zone:</strong> 6b</li>\n<li><strong>Frost dates:</strong> (1st frost) November 1st (last frost) April 30th</li>\n<li><strong>Yearly Precipitation:</strong>  43.64 inches, avg</li>\n<li><strong>Soil Type:</strong> Mostly heavy clay, some areas of sand or silt. Decent variable topsoil</li>\n<li><strong>Average high/low temperatures:</strong> (high) 86 F. (low) 24 F. </li>\n</ul>\n\n<hr>\n\n<p>I have been gardening all my life, and have knowledge in lawn care, tree and shrub care, general landscaping, edibles, nursery, and indoor gardening, as well as other variable aspects of horticulture.</p>\n\n<p>I also have a fairly good knowledge of basic biological concepts, and have fun learning about it on our [<strong>Biology</strong><a href=\"http://biology.stackexchange.com\">2</a> site. I enjoy outdoor activities, such as horse riding, hiking, camping, etc, when I can get around to them. </p>\n\n<hr>\n\n<p>Plants doing cool plant things: </p>\n\n<p><a href=\"https://media3.giphy.com/media/IaqlNUXfacG52/200.gif\" rel=\"nofollow\"><img src=\"https://media3.giphy.com/media/IaqlNUXfacG52/200.gif\" height=\"150\" /></a>\n<a href=\"https://media0.giphy.com/media/TLsYiql3w4u7m/200.gif\" rel=\"nofollow\"><img src=\"https://media0.giphy.com/media/TLsYiql3w4u7m/200.gif\" height=\"150\" /></a>\n<a href=\"https://media4.giphy.com/media/B5ilCD3qpysta/200.gif\" rel=\"nofollow\"><img src=\"https://media4.giphy.com/media/B5ilCD3qpysta/200.gif\" height=\"150\" /></a>\n<a href=\"https://media4.giphy.com/media/Wy5yWQD9bUZ2/200.gif\" rel=\"nofollow\"><img src=\"https://media4.giphy.com/media/Wy5yWQD9bUZ2/200.gif\" height=\"150\" /></a>\n<a href=\"https://media2.giphy.com/media/129giMCPtxY46I/200.gif\" rel=\"nofollow\"><img src=\"https://media2.giphy.com/media/129giMCPtxY46I/200.gif\" height=\"150\" /></a>\n<a href=\"https://media1.giphy.com/media/SqCwRBphjzFQc/200.gif\" rel=\"nofollow\"><img src=\"https://media1.giphy.com/media/SqCwRBphjzFQc/200.gif\" height=\"150\" /></a></p>\n','0','20','0','531689');
