INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6320,101,'2014-09-09T17:36:39.973','Logan H','2016-10-20T22:22:18.300','null','Phoenix, AZ, United States','\n\n<p>B.S. in Computer Science. Java and Javascript are primaries. My favorite Javascript libraries are Angular 1 &amp; 2, KnockoutJS, lodash, Bootstrap, and Angular-Material. I have also used NodeJS and npm to design and develop web applications. I have over two years of designing beautiful, seamless, intuitive, and responsive front end user interfaces for multiple web applications.</p>\n\n<p>I have developed web apps that you build with maven that bundle the webservices and the web app into a single .war file. I have used multiple modules within a maven project to keep the source code organized.</p>\n','0','1','0','3061294');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6321,141,'2014-09-09T17:41:19.977','James Kingsbery','2017-03-13T02:49:33.860','http://kingsbery.net','New York, NY','<p>I am a member of Dow Jones\'s Research and Development team, currently working mostly in Erlang with some Node.js.</p>\n\n<p>Before that, I was the Optimization Team Lead at Yodle, a company in New York City that does search engine marketing for local small-to-medium businesses. The Optimization Team develops Yodle\'s proprietary bidding algorithm.</p>\n\n<p>Before that, I was a software engineer for two startups located in New York.</p>\n','0','6','0','27569');
