INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6350,101,'2014-09-21T14:16:08.737','Simone Carletti','2016-05-21T09:14:48.613','https://simonecarletti.com/','Rome, Italy','<p>Hi! My name is <a href=\"https://simonecarletti.com/\" rel=\"nofollow noreferrer\">Simone Carletti</a>. I\'m a passionate programmer and scuba diving instructor.</p>\n\n<p>I work at <a href=\"https://dnsimple.com/\" rel=\"nofollow noreferrer\">DNSimple</a>. I created <a href=\"https://www.robowhois.com/\" rel=\"nofollow noreferrer\">RoboWhois</a> and <a href=\"http://robodomain.com/\" rel=\"nofollow noreferrer\">RoboDomain</a>.</p>\n\n<p>I have been involved with software development for more than a decade, contributing code and <a href=\"https://github.com/weppos\" rel=\"nofollow noreferrer\">creating libraries</a>.</p>\n\n<p><a href=\"http://stackexchange.com/users/42403/simone-carletti\"><img src=\"https://stackexchange.com/users/flair/42403.png\" width=\"208\" height=\"58\" alt=\"profile for Simone Carletti on Stack Exchange\" title=\"profile for Simone Carletti on Stack Exchange\" /></a></p>\n','0','0','0','42403');
