INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6362,101,'2014-09-23T21:09:01.953','Unsigned','2017-05-31T18:07:04.843','null','West Coast, USA','<p>Non-exhaustive list of my favorite languages, in no particular order:</p>\n\n<ul>\n<li>Golang, Scala, C#, x86 ASM (Intel syntax), .NET CIL/MSIL</li>\n</ul>\n\n<p>Experience in compiler development, build systems, SOAs, web applications and crawlers, data mining, 3D raytracing, and data compression algorithms.</p>\n\n<blockquote>\n  <p>\"I want my ER doctor to understand anatomy, even if all she has to do is put the computerized defibrillator nodes on my chest and push the big red button, and I want programmers to know programming down to the CPU level, even if Ruby on Rails does read your mind and build a complete Web 2.0 social collaborative networking site for you with three clicks of the mouse.\" -- <a href=\"http://stackexchange.com/users/4/joel-spolsky\">Joel Spolsky</a></p>\n</blockquote>\n\n<p><a href=\"https://stackexchange.com/users/314364/unsigned\"><img src=\"https://stackexchange.com/users/flair/314364.png\" width=\"208\" height=\"58\" alt=\"profile for Unsigned on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Unsigned on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n','0','4','0','314364');
