INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6382,101,'2014-09-26T19:15:00.320','GalacticCowboy','2017-02-13T20:58:25.653','http://spamsense.blogspot.com','Indianapolis, IN','<p>Professional: I have been a professional software developer for more than 20 years. I started out in C++, then jumped to C# and haven\'t looked back. Along the way, I picked up quite a bit of experience with SQL Server, ASP.NET / MVC, and HTML / CSS / JavaScript. I\'ve also had chances to dabble in Java, Ruby / Rails, Bootstrap, Angular, EmberJS, and D3js as part of my day job.</p>\n\n<p>Personal: My wife and I have been married for 20 years. We have two daughters, one son, and a dog. When I\'m not at work, I enjoy playing computer games (World of Warcraft, Diablo III, and a variety of racing and flight simulations), board games, and pool.</p>\n','1','2','0','14409');
