INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (6390,148,'2014-09-29T05:24:46.417','Nate','2016-01-17T12:06:23.623','http://stackoverflow.com/users/119114/nate','United States','<p>Freelance software developer in the US, specializing in embedded and distributed systems, intelligence and defense domains, and smartphone apps.</p>\n\n<p>You can reach me at: <code>nate.anon.dev</code> at <code>gee mail</code>, but please do not email me asking to <strong>privately</strong> answer your question for free.  Just post it online.</p>\n\n<hr>\n\n<p>First Stack Overflow user to <a href=\"http://data.stackexchange.com/stackoverflow/query/134153/users-with-a-combination-of-3-badges?BadgeName1=ios&amp;BadgeName2=blackberry&amp;BadgeName3=android\" rel=\"nofollow noreferrer\">earn an iOS, BlackBerry and Android badge</a> ... <br/>... and the <a href=\"http://data.stackexchange.com/stackoverflow/query/121280/users-with-a-combination-of-badges?BadgeName1=ios&amp;BadgeName2=android\" rel=\"nofollow noreferrer\">13th to hold iOS+Android</a></p>\n\n<p><a href=\"http://stackoverflow.com/badges/2821/jailbreak\">First user to earn a Jailbreak (iOS) badge</a></p>\n\n<p><a href=\"http://stackoverflow.com/help/badges/190/blackberry\">4th to the silver BlackBerry badge</a> and <a href=\"http://stackoverflow.com/help/badges/1835/ios\">109th to the gold iOS badge</a></p>\n\n<hr>\n\n<p>Sorry, but I don\'t do <strong>chat</strong>.  Software development is a knowledge exercise, that requires concentration, and a lack of interruptions, to do well.  <em>Chat</em> forces constant context-switching, and loss of efficiency as a result of these interruptions.  I post on Stack Overflow in my free time, when I\'ve already been interrupted for other reasons, but I can\'t spare the time to hang around in chat rooms.  Thanks for your understanding.</p>\n','2','3','0','41016');
