INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7482,101,'2014-10-23T12:42:11.033','Michael Schinis','2014-10-23T12:42:11.033','http://www.opensourcerer.io','London, United Kingdom','<p>I am a Software Engineer at <a href=\"https://www.trouva.com\" rel=\"nofollow noreferrer\">Trouva</a> and an Ambassador at <a href=\"https://www.algolia.com\" rel=\"nofollow noreferrer\">Algolia</a>. I am also a hackathon veteran, huge startup fan and a photography enthusiast. During my spare time, I like to wear my opensourcerer hat and actively work on, amongst other things, EmberJS documentation, popular open source projects and my own side projects.</p>\n\n<p>I mainly work with React and EmberJS during working hours but outside work I use NodeJS, Elixir and continuously explore new avenues and new programming patterns. I always use photography as my main source of relaxation and exploration of his creativity.</p>\n','0','1','0','436063');
