INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7485,101,'2014-10-23T15:17:18.483','daOnlyBG','2016-01-13T19:47:14.587','http://www.Federal35.com','Las Vegas, NV','<p>I am a die-hard Chicago Bulls fan, but I do respect most NBA teams, including Bulls\' rivals. There\'s no need to slight other teams when the G.O.A.T. played on yours. </p>\n\n<p>I\'ve been a hardcore fan of FC Barcelona for 15 years, but I can respect Barca\'s rivals, Real Madrid. Again- there\'s no need to slight other teams when the G.O.A.T. played on yours. I disapprove of \"hey, let\'s buy our way to the top\" teams like PSG, and admire teams that develop as much talent as (or even more) than they buy, like Barcelona, Bayern, Arsenal, etc. </p>\n\n<p>Other teams I enjoy include the New England Patriots, the Chicago Blackhawks, the San Antonio Spurs, Atletico Madrid, and the Chicago Bears. I\'m only a lukewarm supporter of the Bears (until they prove that there\'s hope for winning meaningful games), but my God, <strong>do I loathe the Packers.</strong> If you are a Packers fan, I\'m sure we can get along; however, we\'re better off not discussing football.</p>\n','0','4','0','4772220');
