INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7511,101,'2014-10-31T18:49:09.923','Michael Hoffman','2014-11-03T19:16:19.103','http://www.michaelhoffmaninc.com','Crystal Lake, IL','<p>I am a self-driven consultant and entrepreneur with over fifteen years of experience in business. Through a strong foundation of knowledge and character, I am committed to the success and quality of the solutions I provide. I believe in cultivating a strong bond across the members of a project team with the goals of learning and a sense of shared purpose. I highly regard the relationship with clients, stakeholders and technical staff and strive to continuously grow and improve that relationship. </p>\n\n<p>In the technical arena, I specialize in both front-end architecture, with a foundation on flexible, component-based views, and in back-end architecture, with a focus on service-based APIs. While I have no dedication to specific technologies, my most recent focus has been on Java solutions leveraging the Spring Framework. I\'ve also implemented features on IBM platforms, including WebSphere Commerce and WebSphere Portal. The current list of frameworks I am regularly using include AngularJS, jQuery, Spring, Camel and Java. The primary databases I have been working on include Oracle and SQL Server.</p>\n\n<p>My passions outside of my career include being a good husband and good father. I dabble in woodworking and have a love for sports, including baseball and hockey. I enjoy running and playing hockey.</p>\n','1','0','0','4466263');
