INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7578,101,'2014-11-18T09:37:47.480','Marco Geertsma','2014-11-21T14:43:46.430','http://www.frisianallies.nl','Netherlands','<p>Gaming enthusiast. \nFanatic gamer. \nProud member of Frisianallies [FrA]. \nPlaying CoD BO2 and GW2.\nKnown as [FrA]thefellowes.</p>\n\n<hr>\n\n<p>Doing a live-stream every other week on twitch.tv/frisianallies. Streaming GW2, Black ops 2 and sometimes Minecraft (not at the same time). We also do requests. Send your requests to frisianallies@gmail.com. Gameplays and lets-plays are totally random and can be watched on youtube.com/frisianallies (Dutch and English). Want to hop in on a commentary or lets-play? Send a message to frisianallies@gmail.com or message us on youtube. </p>\n\n<hr>\n','0','0','0','2385967');
