INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7585,101,'2014-11-18T20:47:07.550','jedd.ahyoung','2016-04-05T14:55:30.227','http://jedd-ahyoung.com','null','<p>I\'m a professional programmer, currently working for a private company called Surge Forward (based in Washington state). I\'m currently working with C#, MVC4, Angular, and jQuery.</p>\n\n<p>I have some experience with C++ (although I don\'t use it much) and I used to be really interested in Flash/Actionscript 3 until HTML5 and Javascript became the norm. I\'ve had experience with Perl, I\'m attempting to really learn Python, and I also have experience with PHP and Wordpress.</p>\n\n<p>Previous jobs have also given me experience in Unix/Linux systems administration, knowledge of Cisco routing and switching, and general networking experience.</p>\n\n<p>StackOverflow has given me a lot over the years and I really hope to be able to give back.</p>\n','0','0','0','344915');
