INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7651,642,'2014-11-29T00:49:56.840','leDominatre','2017-11-22T01:15:54.063','null','Ontario, Canada','<p><a href=\"https://stackexchange.com/users/5361489/scriptHero\"><img src=\"https://stackexchange.com/users/flair/5361489.png\" width=\"208\" height=\"58\" alt=\"profile for DominatorX on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for scriptHero on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n\n<blockquote>\n  <p>Nerd is no longer a derogatory term. It\'s social norm.<br>\n  <em>- some person on the internet</em></p>\n</blockquote>\n\n<p>I am a <strike>perfectly normal</strike> person who likes making and playing games in my free time. You can usually find <a href=\"https://steamcommunity.com/id/boxcomms/profile\" rel=\"nofollow noreferrer\">me on Steam</a>, or endlessly <strike>torturing</strike> improving the posts on <a href=\"https://stackoverflow.com/search?q=score%3A..-2+answers%3A..1+is%3Aquestion+hasaccepted%3Ano+closed%3Ano+duplicate%3Ano+migrated%3Ano+wiki%3Ano\">my hitlist</a>.</p>\n\n<hr>\n\n<p><strong>My rules of editing</strong>:</p>\n\n<ol>\n<li>No fun</li>\n<li>Make bad jokes about <a href=\"https://freelancer.com\" rel=\"nofollow noreferrer\">https://freelancer.com</a> and <a href=\"https://shouldiblamecaching.com\" rel=\"nofollow noreferrer\">https://shouldiblamecaching.com</a></li>\n<li>No strict rules of editing.</li>\n</ol>\n','27','413','421','5361489');
