INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7796,101,'2015-01-02T18:12:09.957','Mooseman','2015-05-07T10:32:50.707','null','Oblivion','<p>Moderator on <a href=\"http://lifehacks.stackexchange.com/\">Lifehacks</a>.</p>\n\n<p>I like helping people who ask good questions on <a href=\"http://stackoverflow.com\">Stack Overflow</a>. #SOreadytohelp</p>\n\n<p>Sometimes I can be found in the <a href=\"http://chat.meta.stackexchange.com/rooms/89/tavern-on-the-meta\">Tavern on the Meta</a>, where I was introduced to this gif:</p>\n\n<p><a href=\"http://www.discovery.com/tv-shows/north-america/animals/red-fox.htm\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/PUf7X.gif\" alt=\"Not a fail...\"></a></p>\n\n<p><a href=\"http://stackoverflow.com/users/current\">This guy</a> is the Hero of Stack Overflow. (<a href=\"http://chat.meta.stackexchange.com/transcript/89?m=2793159#2793159\">37 stars</a>)</p>\n','0','0','0','1279912');
