INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7798,101,'2015-01-02T19:05:00.590','Doorknob','2016-02-07T23:47:28.070','http://keyboardfire.com','Texas, US','\n\n<p>Programmer, elected SE moderator ♦ on <a href=\"http://codegolf.stackexchange.com/users/3808\">PPCG</a>. I have orbited the Sun 17 times.</p>\n\n<p>Email andy@keyboardfire.com or find me in chat: <a href=\"http://chat.stackexchange.com/rooms/240/\">The Nineteenth Byte</a> (for <a href=\"http://codegolf.stackexchange.com\">PPCG</a>), <a href=\"http://chat.stackexchange.com/rooms/14524/the-green-llama\">The Sphinx\'s Lair</a> (for <a href=\"http://puzzling.stackexchange.com\">Puzzling</a>), <a href=\"http://chat.stackexchange.com/rooms/20803/chat\">:chat!</a> (for <a href=\"http://vi.stackexchange.com\">Vi and Vim</a>), and <a href=\"http://chat.stackexchange.com/rooms/22119/se-chess\">SE Chess</a> (informal group in which I lose a lot).</p>\n\n<p><a href=\"http://stackexchange.com/users/1266491\"><img src=\"https://stackexchange.com/users/flair/1266491.png?theme=dark\" alt=\"\"></a><br>\n:wq</p>\n','0','0','0','1266491');
