INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (7801,101,'2015-01-02T21:10:03.677','apnorton','2015-10-22T14:44:33.240','http://www.apnorton.com','Virginia, USA','<p>Programmer, robotics enthusiast, and math-lover.  Future computer scientist or mathematician.</p>\n\n<p>Check out my blog at <a href=\"http://www.apnorton.com/blog\" rel=\"nofollow noreferrer\">www.apnorton.com/blog</a>.</p>\n\n<p>Upset about voting patterns? Read <a href=\"http://meta.math.stackexchange.com/a/18734/23353\">this</a>.</p>\n\n<blockquote>\n  <p>The point of Stack Exchange isn\'t just to grow the number of users asking questions, it is to grow the number of useful answers to questions. -- <a href=\"http://meta.stackoverflow.com/a/284455/1110928\">Bill The Lizard</a></p>\n</blockquote>\n','0','0','0','1123059');
