INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (8880,101,'2015-01-16T12:59:41.993','MarceloBoni','2015-01-16T12:59:41.993','null','São Paulo - Capital','<p>Estudante de Engenharia da computação, interessado por avanços da tecnologia e afins, desenvolvedor <code>Java</code>, <code>C</code>, <code>C++</code>, <code>C#</code>, <code>Delphi</code>, <code>VB</code>, <code>PHP</code>, <code>JavaScript</code>...\nConhecimentos em Banco de Dados <code>SQL</code>, com enfase em <code>Oracle</code> e <code>MySQL</code>.</p>\n\n<p>Possuo também conhecimentos em FrontEnd <code>HTML+CSS</code>. Futuramente planejo aprender mais sobre <code>Python</code> e <code>Ruby-on-Rails</code>.</p>\n\n<p>Conhecimentos intermediário em infraestrutura.</p>\n\n<p>Adoro ler e estudar sobre <code>IA</code>, <code>Redes Neurais</code>, <code>supercomputadores</code> entre outros assuntos da área de TI.</p>\n\n<p>Atualmente atuo na área de desenvolvimento WEB.</p>\n\n<pre><code>while(0 &lt; 1){\n  \"keep trying and never give up\"\n}\n</code></pre>\n\n<p>-- Escute, existe uma ordem natural neste mundo e aqueles que tentam muda-la não acabam nada bem. Esse movimento não resistirá. Se você se unir a eles, você e sua família inteira serão banidos e você viverá apenas pra ser ridicularizado e sofrer, e até poderá ser linchado e crucificado.. E pelo que? Pelo que? Não importa o que você faça, nunca vai parecer mais do que uma mísera gota num oceano infinito..</p>\n\n<p>-- O que é o oceano, se não uma infinidade de gotas?\" </p>\n\n<p>(Cloud Atlas)</p>\n\n<blockquote>\n  <p>Algumas regras para a vida:</p>\n  \n  <ul>\n  <li>Questione a autoridade.</li>\n  <li>Nenhuma ideia é verdadeira só porque alguém diz que é, incluindo eu.</li>\n  <li>Pense por si próprio, questione a si próprio.</li>\n  <li>Não acredite em algo só porque quer acreditar, acreditar em algo não o torna verdadeiro.</li>\n  <li>Teste ideias pelas evidencias adquiridas, pela observação e experimentação.</li>\n  <li>Se uma ideia prevalecente falhar num teste bem desenvolvido, esta errada. Supere.</li>\n  <li>Siga as evidências onde quer que elas levem, se não houver evidências, evite julgamento. E talvez a regra mais importante de\n  todas:</li>\n  <li>Lembre-se, você pode estar errado.</li>\n  </ul>\n</blockquote>\n\n<p>Neil deGrasse Tyson</p>\n','0','0','0','4890190');
