INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (8934,148,'2015-01-30T04:46:04.157','aroth','2017-09-13T04:21:48.130','null','null','<p>Open-source contributions include <a href=\"https://github.com/adam-roth/matchbook\" rel=\"nofollow noreferrer\">matchbook</a>, a platform-agnostic matchmaking service, API, and SDK for mobile applications (think multi-platform real-time gaming), a <a href=\"https://github.com/adam-roth/coredata-threadsafe\" rel=\"nofollow noreferrer\">thread-safe wrapper</a> for Apple\'s Core Data framework, and a <a href=\"https://github.com/adam-roth/screen-cap-view\" rel=\"nofollow noreferrer\">screen-capture utility</a> for iOS.  See <a href=\"https://github.com/adam-roth\" rel=\"nofollow noreferrer\">GitHub</a> for more.</p>\n\n<p>Interested in AI, robotics, sustainable/renewable energy, and Internet-of-Things (IoT) applications.  Feel free to get in touch if you have a project along those lines and need a capable technical resource to help make it a reality.  </p>\n','1','3','0','301489');
