INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9059,101,'2015-02-27T19:32:47.513','Enrique Moreno Tent','2017-01-23T17:51:59.807','https://enriquemorenotent.com','Dresden, Germany','<p>I am a full-stack web developer. Born in Spain, living in Germany currently. Always interested in learning more and improving the quality of my work. Also, very glad to be a part of this community where we all help each other.</p>\n\n<p>Let\'s break some eggs!</p>\n','0','0','0','167698');
