INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9066,111,'2015-03-01T13:26:52.737','user7','2018-03-03T13:55:09.573','null','India','<p>Young SDE learning new things. I mainly come to SO to learn from others.</p>\n\n<p>Some of my favourites</p>\n\n<p><strong>Stack Overflow:</strong></p>\n\n<ol>\n<li><a href=\"https://stackoverflow.com/questions/48383521/can-a-1-a-2-a-3-evaluate-to-true-in-java\">https://stackoverflow.com/questions/48383521/can-a-1-a-2-a-3-evaluate-to-true-in-java</a></li>\n<li><a href=\"https://stackoverflow.com/questions/48688363/how-does-just-in-time-compiler-optimizes-java-parallel-streams/48695413#48695413\">https://stackoverflow.com/questions/48688363/how-does-just-in-time-compiler-optimizes-java-parallel-streams/48695413#48695413</a> (related to above).</li>\n<li><a href=\"https://stackoverflow.com/questions/48215297/method-reference-to-private-interface-method/48229115\">https://stackoverflow.com/questions/48215297/method-reference-to-private-interface-method/48229115</a></li>\n</ol>\n\n<p><strong>Software Engineering:</strong></p>\n\n<ol>\n<li><a href=\"https://softwareengineering.stackexchange.com/questions/365544/java-is-it-okay-to-abuse-spring-beans-component-rather-than-use-static-final\">Java: Is it okay to abuse Spring beans (@Component) rather than use static final utility classes?</a></li>\n</ol>\n','2','3','0','5553464');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9068,123,'2015-03-02T01:17:07.157','Anthony Pham','2016-08-19T23:13:27.200','null','United States','<h1>Formerly known as PythonMaster</h1>\n\n<p>915695659349  <br>\n943698349339  <br>\n999991849739  <br>\n925692589167<br>\n924692579289 </p>\n\n<p>Highlight the above text, press CTRL-F, then press 9 and {insert message here} </p>\n\n<p>Created my very own GutHub project for a <a href=\"https://github.com/StackExchangeDude/Physics-Module\" rel=\"nofollow noreferrer\">physics module</a> for Python.</p>\n\n<p>I hope I can answer your questions in whatever site I am currently in (and be a moderator some day)! If you need me, I will be at <a href=\"http://languagelearning.stackexchange.com/\">Language Learning Stack Exchange</a> helping out. It would be nice if you could join me and help the young site out!</p>\n\n<p>Also currently working on the <a href=\"http://languagelearningseblog.weebly.com/\" rel=\"nofollow noreferrer\">unofficial blog for Language Learning Stack Exchange</a> because I\'m bored. And random coding JavaScript games at <a href=\"https://www.khanacademy.org/profile/UltimateShaymin/\" rel=\"nofollow noreferrer\">Khan Academy</a>!\n<br><br>\n\n<img src=\"https://stackexchange.com/users/flair/5046588.png\" width=\"208\" height=\"58\" alt=\"profile for PythonMaster on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for PythonMaster on Stack Exchange, a network of free, community-driven Q&amp;A sites\"></p>\n','0','15','0','5046588');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9070,101,'2015-03-02T07:21:15.483','Eugene','2015-04-18T19:08:23.837','http://www.art-coder.com','Tallinn, Estonia','<p>Web developer with extensive experience in developing web applications in <code>PHP</code> and <code>JavaScript</code>. Also got experience with different database systems and such programming languages as <code>Java</code>, <code>Python</code>, ...<br>\nGot plenty experience with <code>git</code> and some with <code>hg</code>.</p>\n\n<p><a href=\"https://twitter.com/jeserkin\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/yg7X9.png\" alt=\"@jeserkin\"> @jeserkin</a></p>\n','0','0','0','123693');
