INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9099,101,'2015-03-10T16:28:02.757','Travis J','2015-03-10T16:28:02.757','null','California','<p>I really appreciate the Stack Exchange community.</p>\n\n<p>This is a nice feature that isn\'t well known, <a href=\"http://stackoverflow.com/questions/greatest-hits\">Greatest Hits</a>. It shows some of the best questions on the site, there is also a link to view the ones which you participated in! :)</p>\n\n<p>VP of a medium company, B.S. in Computer Science, currently working on creating revenue generating subscription based web applications built on MVC3 / IIS7.5 / ASP.NET4 / C# / MSSQL / MySQL / AJAX. Technology that I have used or learned about: java, javascript, jQuery, c, c#, c++, sql, oracle, fortran, pascal, assembly, basic, VB, F#, J2EE, J2ME, objective-c, etc.</p>\n\n<p>I am the only person at the company who deals with software development making me fill the rolls of a software designer, programmer, dba, server admin, and graphics artist. As you can see from my gravatar, this causes me to wear many <a href=\"http://winterbash2013.stackexchange.com/\" rel=\"nofollow\">hats</a>.</p>\n\n<p>My main goals when designing and coding are: how can I make the user experience easiest, and how can I reduce redundancy.</p>\n\n<p>When developing software, I take a duality approach where I design an approximate Waterfall model as a map, and then traverse through the map using a SCRUM agile approach.</p>\n\n<p>\"Acknowledge your faults so you can overcome them.\"</p>\n\n<p></p>\n','0','2','0','1014615');
