INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9167,101,'2015-03-27T03:36:35.650','Alexis King','2015-11-18T19:02:30.210','https://lexi-lambda.github.io','Los Angeles, CA','<p>Programming language nerd and Lisp hacker extraordinaire. I work on the <a href=\"https://racket-lang.org\" rel=\"nofollow noreferrer\">Racket</a> project and hang out in the <a href=\"/questions/tagged/racket\" class=\"post-tag\" title=\"show questions tagged &#39;racket&#39;\" rel=\"tag\">racket</a>, <a href=\"/questions/tagged/haskell\" class=\"post-tag\" title=\"show questions tagged &#39;haskell&#39;\" rel=\"tag\">haskell</a>, and <a href=\"/questions/tagged/scheme\" class=\"post-tag\" title=\"show questions tagged &#39;scheme&#39;\" rel=\"tag\">scheme</a> tags on Stack Overflow.</p>\n\n<p>Also I sometimes do web stuffs but that\'s boring.</p>\n','0','0','0','212518');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9168,101,'2015-03-27T03:37:00.243','Jason C','2017-06-15T02:16:45.637','null','New York, United States','<p>Check out <a href=\"https://stackapps.com/search?tab=active&amp;q=user%3A25350%20is%3Aq%20%5Bscript%5D%20\">my userscripts on StackApps</a>:</p>\n\n<ul>\n<li><a href=\"https://stackapps.com/q/7404/25350\">https://stackapps.com/q/7404/25350</a> - Fully functional top bar for chat rooms with inbox/achievements and room search.</li>\n<li><a href=\"https://stackapps.com/q/7398/25350\">https://stackapps.com/q/7398/25350</a> - Visualize answered status of sidebar questions.</li>\n<li><a href=\"https://stackapps.com/q/7399/25350\">https://stackapps.com/q/7399/25350</a> - Linkifies URLs in revision history comments.</li>\n<li><a href=\"https://stackapps.com/q/7403/25350\">https://stackapps.com/q/7403/25350</a> - Link sharing on steroids.</li>\n<li><a href=\"https://stackapps.com/q/7439/25350\">https://stackapps.com/q/7439/25350</a> - Help ROs clean up chat with auto-select message moving.</li>\n<li><a href=\"https://stackapps.com/q/7442/25350\">https://stackapps.com/q/7442/25350</a> - Unlock message delete ability for ROs.</li>\n</ul>\n\n<hr>\n\n<p>Support the <a href=\"http://area51.stackexchange.com/proposals/109898/memes\">Memes Proposal</a>. Or not. It\'s an experiment. </p>\n\n<p><strong>Awesome SE sites that you should check out:</strong></p>\n\n<ul>\n<li><a href=\"http://woodworking.stackexchange.com/\">Woodworking Beta</a></li>\n<li><a href=\"http://mechanics.stackexchange.com/\">Motor Vehicle Maintenance &amp; Repair Beta</a></li>\n</ul>\n\n<hr>\n\n<p>I am a freelance programmer based out of NYC. I grew up in Pittsburgh, PA, USA and still consider it my home. I have a background in medical robotics, computer-assisted surgery, and computational biology. I currently specialize in both systems and application programming, augmented reality, simulations, and embedded devices, as well as development project management. Since moving to NYC 11 years ago, I\'ve fallen in to working primarily with new media and tech artists doing a lot of interactivity and <a href=\"http://thebaylights.org/\" rel=\"nofollow noreferrer\">large-scale lighting installations</a>. I consider my current job to be creating tools that allow artists to naturally express themselves through software without limiting their creativity.</p>\n\n<p>You can generally find me in <a href=\"https://chat.meta.stackexchange.com/rooms/89\">The Tavern</a>.</p>\n\n<hr>\n\n<p>Interesting posts, if I say so myself:</p>\n\n<ul>\n<li><a href=\"https://codegolf.stackexchange.com/a/21950/16504\">How to write</a> programs like <a href=\"http://www.cise.ufl.edu/~manuel/obfuscate/xmas.c\" rel=\"nofollow noreferrer\">Twelve Days of Christmas in C</a>.</li>\n<li><a href=\"https://codegolf.stackexchange.com/q/22144\">Images With All Colors</a> - best CodeGolf.SX contest ever!</li>\n</ul>\n\n<p>Some data analysis and statistics from the very exciting 2015 SO mod elections (server is now defunct, I could reactivate for future elections):</p>\n\n<ul>\n<li><a href=\"https://meta.stackoverflow.com/q/290346\">2015 Election Live Vote Monitor</a></li>\n<li><a href=\"https://meta.stackoverflow.com/q/289995\">2015 Election Candidate Activity Profiles</a></li>\n<li><a href=\"http://disorient.ddns.net/SOVoteMonitor/qa.jsp\" rel=\"nofollow noreferrer\">2015 Candidate Questionnaire Alternate View</a> </li>\n</ul>\n\n<hr>\n\n<p><code>echo &gt; \\\\?\\c:\\windows\\x.</code></p>\n','0','0','0','305991');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9169,101,'2015-03-27T03:42:01.290','Kevin Brown','2017-11-11T16:29:40.403','https://kevin-brown.com','United States','<p>I build things.</p>\n\n<blockquote>\n  <p>Walking on water and developing software from a specification are easy if both are frozen.<br>\n  -- Edward V Berard</p>\n</blockquote>\n\n<ul>\n<li><a href=\"https://kevin-brown.com/?utm_source=stackoverflow.com&amp;utm_medium=user-generated&amp;utm_campaign=profile-page\" rel=\"nofollow noreferrer\">Personal website</a></li>\n<li><a href=\"https://github.com/kevin-brown\" rel=\"nofollow noreferrer\">GitHub profile</a></li>\n<li><a href=\"https://stackoverflow.com/cv/kbrown\">Careers 2.0 profile</a></li>\n<li><a href=\"https://blog.kevin-brown.com/?utm_source=stackoverflow.com&amp;utm_medium=user-generated&amp;utm_campaign=profile-page\" rel=\"nofollow noreferrer\">Development blog</a></li>\n</ul>\n\n<p><a href=\"https://stackexchange.com/users/147868/kevin-brown\"><img src=\"https://stackexchange.com/users/flair/147868.png\" alt=\"View my Stack Exchange account.\"></a></p>\n','0','0','0','147868');
