INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9226,101,'2015-04-07T18:26:35.793','Undo','2017-08-27T01:09:35.660','http://keybase.io/undo','null','\n\n<p>I\'m <a href=\"https://github.com/Undo1\" rel=\"nofollow noreferrer\">@Undo1</a> on GitHub.</p>\n\n<hr>\n\n<p>Moderator on <a href=\"//stackoverflow.com\">Stack Overflow</a> and <a href=\"//softwarerecs.stackexchange.com/\">Software Recommendations</a>.</p>\n\n<p>Everything I post on Stack Overflow is licensed to you under <a href=\"https://creativecommons.org/publicdomain/zero/1.0/\" rel=\"nofollow noreferrer\">CC0</a>:</p>\n\n<blockquote>\n  <p>you can copy, modify, distribute and perform the work, even for commercial purposes, all without asking permission.</p>\n</blockquote>\n\n<p>Feel free to just throw it into your project without attribution. That\'s what most folks do anyway... but for my contributions, it\'s nice and legal.</p>\n\n<p><a href=\"https://stackexchange.com/users/1703573\">\n<img src=\"https://stackexchange.com/users/flair/1703573.png\" width=\"208\" height=\"58\" alt=\"profile for Undo on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Undo on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<p>If you want to send me some math money: <code>1BY5kWZQHosw8VYYzPpJUw9DnvDByFcNXf</code></p>\n','0','2','0','1703573');
