INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9252,1,'2015-04-11T14:33:12.530','tlewis3348','2015-04-11T20:48:18.587','http://google.com/+TimLewis3348','Charlotte, NC','<p>I am a mechanical engineer that designs optical alignment systems for Opto Alignment Technologies Inc. From time to time, I use scripts and macros to make my job easier.</p>\n\n<p>In my spare time, I enjoy tinkering with my Android phone (Tasker, IFTTT, and Material Design Tasker Plugin are pretty awesome), woodworking, running, and reading informational books.</p>\n\n<p>Challenging thought: No matter what you are studying, it is absolutely crucial that you understand both the theory behind what you are doing as well as how to effectively apply that theory in the real world.  Theory alone is useless knowledge, knowing only the application is what robots do and prevents you from thinking outside the box.</p>\n\n<p>P.S.  If you want to contact me, send me a message on Hangouts (via my Google+ profile).  That is the only service I check on a regular basis.</p>\n','0','0','0','3039524');
