INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9289,101,'2015-04-20T05:50:52.377','Guruprasad Rao','2015-04-20T05:50:52.377','http://stackoverflow.com/users/2065039/kaushik','Mangaluru, India','<p><strong>About me</strong></p>\n\n<p>Having a work experience of around 4 years and counting and growing knowledge in </p>\n\n<ul>\n<li>Asp.net</li>\n<li>MVC</li>\n<li>C#</li>\n<li>SQL Server</li>\n<li>HTML5</li>\n<li>CSS3</li>\n<li>javascript</li>\n<li>jQuery</li>\n<li>Bootstrap</li>\n<li>Ajax.</li>\n<li>Android</li>\n<li>mongoDB</li>\n<li>nodeJS</li>\n<li>java</li>\n<li>Angular2+</li>\n<li>Materialize CSS</li>\n</ul>\n\n<hr>\n\n<p><strong>An IT life <em>gif</em> that\'s pretty interesting and I actually took it from user <a href=\"http://stackoverflow.com/users/3420271/alex-char\"><em>Alex Char</em></a> - Conveying thanks hereby</strong></p>\n\n<p><a href=\"https://i.stack.imgur.com/SWJGD.gif\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/SWJGD.gif\" alt=\"enter image description here\"></a></p>\n\n<hr>\n\n<p><strong>Few sites built by me.</strong></p>\n\n<blockquote>\n  <ul>\n  <li><strong><a href=\"http://marpallichande.in\" rel=\"nofollow noreferrer\">Marpalli Chande Balaga</a></strong> - A community group web-site, which has been indulged in various social and traditional activities for<br>\n  past 10+ years</li>\n  <li><strong><a href=\"http://shrutikotian.com\" rel=\"nofollow noreferrer\">Shruti Kotian - A Choreographer, Physiotherapist, Dancer</a></strong> - A personal website of a famous Bharatanatya Artist.</li>\n  <li><strong><a href=\"http://kemmaleengineers.in\" rel=\"nofollow noreferrer\">Kemmale Engineers</a></strong> - A website for construction and builders of Kemmale Group, to make their stunning flats reach people with very less cost.</li>\n  </ul>\n</blockquote>\n\n<hr>\n\n<p><strong>Few future projects are definitely there which obviously I\'ll update once done.</strong></p>\n','0','0','0','2357554');
