INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9293,101,'2015-04-20T08:19:16.953','Qantas 94 Heavy','2017-06-24T12:23:17.293','http://qantas94heavy.github.io','Azerbaijan','\n\n<blockquote>\n  <p>If you\'re a newbie who\'d like a guide around Stack Overflow, or you\'d just like to contact me, please send me an email:</p>\n\n<pre><code>var email = \'\\x71\\x61\\x6e\\x74\\x61\\x73\\x39\\x34\\x68\\x65\\x61\\x76\\x79@qq.cn\';\nemail = email.replace(\'qq.cn\', \'gmail.com\');\n</code></pre>\n  \n  <p>All code in my posts on Stack Overflow are under the Apache 2.0 licence.</p>\n</blockquote>\n\n<p>I\'m a self-taught programmer (dabbled a bit around 12, but didn\'t really get started until two years later) that just wants to get to know more about web development and computers in general. Despite this, I <em>hate</em> school (can\'t really learn there).</p>\n\n<p>Currently I\'m proficient in the following languages:</p>\n\n<ul>\n<li>JavaScript</li>\n<li>HTML</li>\n<li>CSS</li>\n<li>Python</li>\n</ul>\n\n<p>Right now, I\'m learning Rust, with a bit of C on the side so I can understand how to use pointers better.</p>\n\n<p>Having said that, some of the languages considering to in the future are:</p>\n\n<ul>\n<li>C#</li>\n<li>Haskell</li>\n<li>Racket</li>\n<li>Lua</li>\n</ul>\n\n<p>Some random stuff:</p>\n\n<ul>\n<li>Top 12 on Stack Overflow\'s <a href=\"http://data.stackexchange.com/stackoverflow/query/131879/reputation-of-young-users\" rel=\"nofollow noreferrer\">Reputation of Young Users</a></li>\n<li>Check out dystory\'s new chat site, <a href=\"http://dystroy.org/miaou/user/98\" rel=\"nofollow noreferrer\">Miaou</a>!</li>\n</ul>\n','0','0','0','2052845');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9294,101,'2015-04-20T08:19:35.903','rene','2018-01-15T16:12:33.453','https://bloggingaboutdotnet.github.io','Netherlands','<p>I\'m a self employed .net software architect, certified scrum master and product owner.</p>\n\n<p>You can find me in the all time top reviewer list of the close vote queue on SO and I\'m a regular in:</p>\n\n<h1><a href=\"http://chat.stackoverflow.com/rooms/41570/so-close-vote-reviewers\">SO Close Vote Reviewers chat room</a></h1>\n\n<p>with its daily gatherings and weekly close vote events. (bring your own drinks and snacks)</p>\n\n<p>#SOreadytohelp</p>\n\n<p>I have one extra account: <a href=\"http://stackoverflow.com/users/3972324/kennybot\">KennyBOT</a></p>\n','0','0','0','281857');
