INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9517,101,'2015-06-06T19:55:58.583','Shashank','2015-06-06T19:55:58.583','http://shashank-py.blogspot.in/','Indore, Madhya Pradesh, India','<p>I work as Django Web Developer where I try to work on backend most of the time.I have experience with Python, nodeJS, Angular 4, C++. Besides this I love to sketch anime characters and love reading Manga.</p>\n\n<p>My favorite thought is from Tokyo Ghoul where Rize say:</p>\n\n<p><strong>\"Destiny doesn\'t exist in this world, its all one person circumstances\ncolliding with others but who create those circumstances? ITS YOU ... \"</strong> </p>\n\n<p><a href=\"http://stackexchange.com/users/flair/4312856.png\" title=\"profile for Shashank Sharma on Stack Exchange, a network of free, community-driven Q&amp;A sites\">profile for Shashank Sharma on Stack Exchange, a network of free, community-driven Q&amp;A sites http://stackexchange.com/users/flair/4312856.png</a></p>\n\n<p>Thanks for visiting ... :D</p>\n\n<p><a href=\"https://i.stack.imgur.com/U6i4y.gif\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/U6i4y.gif\" alt=\"Legend\"></a></p>\n\n<p>For those don\'t know, He is Madara Uchiha.</p>\n','2','0','0','4312856');
