INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9528,128,'2015-06-07T21:34:22.073','HDE 226868','2017-12-18T19:37:15.000','https://medium.com/look-upwards','A small planet somewhere in the vicinity of Betelgeuse','<p>I have a blog now! Well, sort of; it\'s a work in progress. I call it <a href=\"https://medium.com/look-upwards\" rel=\"nofollow noreferrer\">Look Upwards</a>, after <a href=\"https://www.brainyquote.com/quotes/quotes/p/plato385302.html\" rel=\"nofollow noreferrer\">a quote attributed to Plato</a>. My blog posts deal with physics, astronomy, science education, and related topics. Let me know what you think!</p>\n\n<hr>\n\n<p>I\'m a prospective astrophysics and mathematics major at Swarthmore College, looking to focus on computational and stellar astrophysics. My current interests include pulsar timing and stellar modeling.</p>\n\n<p>I\'m an elected moderator on Worldbuilding and a pro-tem mod on History of Science &amp; Mathematics (HSM), Mythology, and Interpersonal Skills (IPS). I also do community moderation tasks on other sites.</p>\n','2','5','1','4816578');
