INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9556,101,'2015-06-13T02:14:27.313','Braiam','2015-11-03T05:32:55.897','null','Dominican Republic','\n\n<p>Nothing to say about me... but if you insist, just take a look at my actions, they speak better than I could ever do. Even when I\'m not part of the solution, I will not be part of the problem.</p>\n\n<blockquote>\n  <p>Better to have nothing, no matter when, than to accept rubbish. — Random Wuxia</p>\n</blockquote>\n\n<p></p>\n\n<blockquote>\n  <p>when you wish for peace and quiet, trouble tends to find ways to catch up to you.</p>\n</blockquote>\n','0','0','0','416592');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9557,101,'2015-06-13T02:29:10.257','Dennis','2016-11-04T14:29:57.610','http://tryitonline.net','The Nineteenth Byte','<p>Mathematician. Coding enthusiast. Elected moderator on <a href=\"http://codegolf.stackexchange.com/\">Programming Puzzles &amp; Code Golf</a>. If I can help you with anything, don\'t hesitate to ping me (<code>@Dennis</code>) in <a href=\"http://chat.stackexchange.com/rooms/240/the-nineteenth-byte\">The Nineteenth Byte</a>.</p>\n\n<p>PPCG answers I\'m proud of:</p>\n\n<ul>\n<li><a href=\"http://codegolf.stackexchange.com/a/105014/12012\">Absolute Sums of Sidi Polynomial Coefficients</a></li>\n<li><a href=\"http://codegolf.stackexchange.com/a/74372/12012\">Calculate the number of primes up to n</a></li>\n<li><a href=\"http://codegolf.stackexchange.com/a/104681/12012\">Coprimes up to N</a></li>\n<li><a href=\"http://codegolf.stackexchange.com/a/51238\">Rearranging Words</a></li>\n</ul>\n','0','0','0','918086');
