INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9609,101,'2015-06-22T22:20:49.930','BatScream','2015-06-22T22:20:49.930','null','Chennai, Tamil Nadu, India','<p>My other contributions: <em><a href=\"https://github.com/BatScream\" rel=\"nofollow noreferrer\">https://github.com/BatScream</a></em></p>\n\n<p>We can catch up here: <a href=\"http://chat.stackoverflow.com/rooms/70508/mongodb\"><em>mongodb</em></a></p>\n\n<p>A list of beautiful answers i have come across:</p>\n\n<ul>\n<li><a href=\"http://stackoverflow.com/a/4165530/1617024\">Processing instructions transform</a> by <a href=\"http://stackoverflow.com/users/36305/dimitre-novatchev\"><strong><em>Dimitre Novatchev</em></strong></a></li>\n<li><a href=\"http://stackoverflow.com/a/28955050/1617024\">Why does a module level return statement work in Node.js?</a> by <a href=\"http://stackoverflow.com/users/1903116/thefourtheye\"><strong><em>thefourtheye</em></strong></a></li>\n</ul>\n\n<p>Questions that made me think for a while:</p>\n\n<ul>\n<li><a href=\"http://stackoverflow.com/q/28310237/1617024\">http://stackoverflow.com/q/28310237/1617024</a></li>\n<li><a href=\"http://stackoverflow.com/q/26725658/1617024\">http://stackoverflow.com/q/26725658/1617024</a></li>\n<li><a href=\"http://stackoverflow.com/q/28547309/1617024\">http://stackoverflow.com/q/28547309/1617024</a></li>\n</ul>\n\n<p>My fastest responses:</p>\n\n<ul>\n<li><a href=\"https://stackoverflow.com/a/26922168/1617024\">https://stackoverflow.com/a/26922168/1617024</a></li>\n</ul>\n\n<p>Want to ask a good question? - <em>just avoid the <a href=\"http://mywiki.wooledge.org/XyProblem\" rel=\"nofollow noreferrer\">XY</a> problem.</em></p>\n','0','0','0','1772508');
