INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9619,101,'2015-06-26T08:14:52.327','Thomas Orozco','2015-06-26T08:14:52.327','null','Paris, France','<p>My top interests here are:</p>\n\n<ul>\n<li>Python</li>\n<li>Django</li>\n<li>Software security</li>\n</ul>\n\n<p>In the past, I used <code>python</code> and <code>django</code> to develop a payment solution at <a href=\"https://www.my-bee.fr/pro/\" rel=\"nofollow noreferrer\">MyBee</a> - I\'m glad they\'re still going strong today! I also worked at <a href=\"http://scalr.com/\" rel=\"nofollow noreferrer\">Scalr</a> as a Product Manager, and at <a href=\"http://www.accenture.com/\" rel=\"nofollow noreferrer\">Accenture</a> as a consultant on business / IT projects. Today, I\'m Lead Backend Engineer at <a href=\"https://aptible.com\" rel=\"nofollow noreferrer\">Aptible</a>.</p>\n\n<p>Personal email: <code>thomas@orozco.fr</code></p>\n','0','0','0','467632');
