INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9630,121,'2015-06-29T16:05:59.940','Beta Decay','2017-07-28T14:04:36.867','https://github.com/beta-decay','Orion Arm, Milky Way','<p>I am the creator of the programming language <a href=\"https://github.com/beta-decay/Fourier\" rel=\"nofollow noreferrer\">Fourier</a> and am an avid user of PPCG.</p>\n\n<p>I also program apps for the Pebble Smartwatch: <a href=\"https://apps.getpebble.com/en_US/developer/53bc5610db5c3bc8f8000016/1\" rel=\"nofollow noreferrer\">https://apps.getpebble.com/en_US/developer/53bc5610db5c3bc8f8000016/1</a></p>\n\n<hr>\n\n<blockquote>\n  <p>I have a friend who\'s an artist and has sometimes taken a view which I don\'t agree with very well. He\'ll hold up a flower and say \"look how beautiful it is,\" and I\'ll agree. Then he says \"I as an artist can see how beautiful this is but you as a scientist take this all apart and it becomes a dull thing,\" and I think that he\'s kind of nutty. First of all, the beauty that he sees is available to other people and to me too, I believe. Although I may not be quite as refined aesthetically as he is ... I can appreciate the beauty of a flower. At the same time, I see much more about the flower than he sees. I could imagine the cells in there, the complicated actions inside, which also have a beauty. I mean it\'s not just beauty at this dimension, at one centimeter; there\'s also beauty at smaller dimensions, the inner structure, also the processes. The fact that the colors in the flower evolved in order to attract insects to pollinate it is interesting; it means that insects can see the color. It adds a question: does this aesthetic sense also exist in the lower forms? Why is it aesthetic? All kinds of interesting questions which the science knowledge only adds to the excitement, the mystery and the awe of a flower. It only adds. I don\'t understand how it subtracts.</p>\n</blockquote>\n\n<p>Richard P. Feynman</p>\n','4','1','0','3244989');
