INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9719,276,'2015-07-20T08:12:18.310','Arrow','2018-03-03T16:13:21.120','null','null','<p>Code for labelling a parallel pair:</p>\n\n<pre><code>\\overset{f}{\\underset{g}{\\rightrightarrows}}\n</code></pre>\n\n<p>$$\\overset{f}{\\underset{g}{\\rightrightarrows}}$$</p>\n\n<p>Code for a commutative square:</p>\n\n<pre><code>\\require{AMScd} \\begin{CD}\nFA @&gt;{\\eta_A}&gt;&gt; GA\\\\ @V{Ff}VV @VV{Gf}V\\\\\nFB @&gt;&gt;{\\eta_B}&gt; GB\n\\end{CD}\n</code></pre>\n\n<p>$$\\require{AMScd} \\begin{CD} FA @>{\\eta_A}>> GA\\ @V{Ff}VV @VV{Gf}V\\ FB @>>{\\eta_B}> GB \\end{CD}$$</p>\n\n<p>Code for a small chain map:</p>\n\n<pre><code>\\newcommand{\\ra}[1]{\\kern-1.5ex\\xrightarrow{\\ \\ #1\\ \\ }\\phantom{}\\kern-1.5ex}\n\\newcommand{\\ras}[1]{\\kern-1.5ex\\xrightarrow{\\ \\ \\smash{#1}\\ \\ }\\phantom{}\\kern-1.5ex}\n\\newcommand{\\da}[1]{\\bigg\\downarrow\\raise.5ex\\rlap{\\scriptstyle#1}}\n\\begin{array}{c}\n0 &amp; \\ra{f_1} &amp; A &amp; \\ra{f_2} &amp; B &amp; \\ra{f_3} &amp; C &amp; \\ra{f_4} &amp; D &amp; \\ra{f_5} &amp; 0 \\\\\n\\da{g_1} &amp; &amp; \\da{g_2} &amp; &amp; \\da{g_3} &amp; &amp; \\da{g_4} &amp; &amp; \\da{g_5} &amp; &amp; \\da{g_6} \\\\\n0 &amp; \\ras{h_1} &amp; 0 &amp; \\ras{h_2} &amp; E &amp; \\ras{h_3} &amp; F &amp; \\ras{h_4} &amp; 0 &amp; \\ras{h_5} &amp; 0 \\\\\n\\end{array}\n</code></pre>\n\n<p>$$\\newcommand{\\ra}[1]{\\kern-1.5ex\\xrightarrow{\\ \\ #1\\ \\ }\\phantom{}\\kern-1.5ex}\n\\newcommand{\\ras}[1]{\\kern-1.5ex\\xrightarrow{\\ \\ \\smash{#1}\\ \\ }\\phantom{}\\kern-1.5ex}\n\\newcommand{\\da}[1]{\\bigg\\downarrow\\raise.5ex\\rlap{\\scriptstyle#1}}\n\\begin{array}{c}\n0 &amp; \\ra{f_1} &amp; A &amp; \\ra{f_2} &amp; B &amp; \\ra{f_3} &amp; C &amp; \\ra{f_4} &amp; D &amp; \\ra{f_5} &amp; 0 \\\n\\da{g_1} &amp; &amp; \\da{g_2} &amp; &amp; \\da{g_3} &amp; &amp; \\da{g_4} &amp; &amp; \\da{g_5} &amp; &amp; \\da{g_6} \\\n0 &amp; \\ras{h_1} &amp; 0 &amp; \\ras{h_2} &amp; E &amp; \\ras{h_3} &amp; F &amp; \\ras{h_4} &amp; 0 &amp; \\ras{h_5} &amp; 0 \\\n\\end{array}$$</p>\n\n<p>Code for a table:</p>\n\n<pre><code>\\begin{array}{|c|c|c|c|}\n\\hline\nt &amp; a &amp; b &amp; l &amp; e \\\\\n\\hline\na &amp; b &amp; c &amp; d &amp; e \\\\\na &amp; b &amp; c &amp; d &amp; e \\\\\na &amp; b &amp; c &amp; d &amp; e \\\\\na &amp; b &amp; c &amp; d &amp; e \\\\\n\\hline\n\\end{array}\n</code></pre>\n\n<p>$$\\begin{array}{|c|c|c|c|}\n\\hline\nt &amp; a &amp; b &amp; l &amp; e \\\n\\hline\na &amp; b &amp; c &amp; d &amp; e \\\na &amp; b &amp; c &amp; d &amp; e \\\na &amp; b &amp; c &amp; d &amp; e \\\na &amp; b &amp; c &amp; d &amp; e \\\n\\hline\n\\end{array}$$</p>\n','23','0','0','5914321');
