INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9829,101,'2015-08-13T15:13:29.523','Blaszard','2017-09-07T06:21:35.650','http://None','All over the world','<p>I\'m here to gain knowledge and insights on a variety of fields I\'m interested in.</p>\n\n<p>Specifically,</p>\n\n<ul>\n<li>Programming &amp; Software Development (Python and R, sometimes JavaScript/node.js; no longer use Swift)</li>\n<li>Data Science, Machine Learning, AI, &amp; statistics</li>\n<li>Travel (started in 2016)</li>\n<li>Language (Mandarin, Spanish, Italian; sometimes Russian and Korean)</li>\n<li>Politics, Economics, and Finance (pretty new to this field so must learn a lot)</li>\n</ul>\n\n<p>Currently (in 2017), my primary interest is in Deep Neural Network and Mandarin</p>\n\n<hr>\n\n<p>PS: I\'m not a native English speaker; if you find some of my grammars and expressions wrong, don\'t hesitate to correct it. I\'ll appreciate it‍</p>\n','2','12','0','2738792');
