INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9841,101,'2015-08-17T06:12:44.507','RedEagle2000','2015-12-29T01:45:54.947','null','Flomaton, AL, United States','<p>I am a 17-year-old Christian who likes baseball and Apple products. I also have a little experience in iOS app development using Swift and some SpriteKit. Check out <a href=\"https://m.youtube.com/channel/UCfzatLIwuiViwBounX2pAzA\" rel=\"nofollow noreferrer\">my YouTube channel</a> all about working on/with Apple and (mainly older) Nintendo consoles.</p>\n\n<p>I never used to like Apple stuff and used to think Windows was awesome. Boy does that sound stupid now. I began reading up on iOS, OS X, Windows, and Android online and eventually began to dislike the latter two for their lack of security and lack of long-term support. Call me an Apple fanboy, but after using all 4 OSes, the choice for me is pretty clear. I eventually got an iPad, then in 2013 was able to buy a broken iPhone 4s and fix it up for under $50 (back when the phone was worth $200). Similarly with my MacBook Pro, which I bought water-damaged for $20 and was able to repair with a new $23 keyboard (apparently, there was only enough water spilled inside to fry the keyboard, which the power button was connected to). I do repairs locally (only Apple stuff and game consoles) and was able to make enough to buy the Applr Watch, which I was fortunate to receive on launch day: April 24, 2015.</p>\n\n<p>Here\'s every Apple product I own:</p>\n\n<ul>\n<li>iPhone 6s</li>\n<li>iPad Air</li>\n<li>Apple Watch</li>\n<li>2017 MacBook Pro</li>\n<li>Late 2010 Mac mini</li>\n</ul>\n','0','1','0','6468040');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9842,101,'2015-08-17T07:00:37.367','T.J. Crowder','2016-06-14T07:38:02.930','http://www.farsightsoftware.com','United Kingdom','<p>I run <a href=\"http://farsightsoftware.com\" rel=\"nofollow\">Farsight Software</a>, a software consulting firm. Good people, reasonable rates. We currently have availability for projects, large and small; you can contract me personally, a member of my team, or just leave it with us and we\'ll work the project as a team. Give us a shout on info@farsightsoftware.com.</p>\n\n<p>I\'m a software engineer with a particular interest in web technologies (esp. JavaScript). I also do lots of work in C#, and formerly Java, and several other languages. I\'ve been doing this professionally for >25 years, goofing with computers for 10 years before that, but I hope I\'m not <a href=\"http://dilbert.com/strips/comic/2010-12-23/\" rel=\"nofollow\">this guy</a>.</p>\n\n<p>On occasion, I write up snippets of nifty tricks or techniques in my <a href=\"http://blog.niftysnippets.org/\" rel=\"nofollow\">anemic little blog</a>.</p>\n','0','0','0','52616');
