INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9850,110,'2015-08-18T08:57:56.180','Willem Van Onsem','2017-11-04T09:40:51.250','https://www.scribd.com/user/60098423/Willem-Van-Onsem','Utrecht, Netherlands','<blockquote>\n  <p><em>An answer a day, keeps dementia away.</em></p>\n</blockquote>\n\n<p>Also known as @CommuSoft and @KommuSoft</p>\n\n<p>Not much to say... <em>uninteresting object</em> that grew up in what is known as <em>Flander\'s Texas</em> (<a href=\"https://www.google.com/maps/place/West+Flanders,+Belgium/@51.037014,2.4737738,9z/data=!3m1!4b1!4m5!3m4!1s0x47dcb4b76f3c7355:0x20099ab2f4c80a0!8m2!3d51.0536024!4d3.1457942?hl=en\" rel=\"nofollow noreferrer\"><em>West-Vlaanderen</em></a>). Developer by day, programmer by night.</p>\n\n<p>Because of a group of engineers at my university, I cannot call myself a <em>scientist</em>, but have to call myself a <em>civil engineer</em>, but I still hope that one day, they change their minds.</p>\n\n<p>A bit a <em>jack of all trades but master in <code>None</code></em>: programming in <a href=\"/questions/tagged/bash\" class=\"post-tag\" title=\"show questions tagged &#39;bash&#39;\" rel=\"tag\">bash</a>, <a href=\"/questions/tagged/c\" class=\"post-tag\" title=\"show questions tagged &#39;c&#39;\" rel=\"tag\">c</a>, <a href=\"/questions/tagged/c%2b%2b\" class=\"post-tag\" title=\"show questions tagged &#39;c++&#39;\" rel=\"tag\">c++</a>, <a href=\"/questions/tagged/c%23\" class=\"post-tag\" title=\"show questions tagged &#39;c#&#39;\" rel=\"tag\">c#</a>, <a href=\"/questions/tagged/haskell\" class=\"post-tag\" title=\"show questions tagged &#39;haskell&#39;\" rel=\"tag\">haskell</a>, <a href=\"/questions/tagged/java\" class=\"post-tag\" title=\"show questions tagged &#39;java&#39;\" rel=\"tag\">java</a>, <a href=\"/questions/tagged/javascript\" class=\"post-tag\" title=\"show questions tagged &#39;javascript&#39;\" rel=\"tag\">javascript</a>, <a href=\"/questions/tagged/perl\" class=\"post-tag\" title=\"show questions tagged &#39;perl&#39;\" rel=\"tag\">perl</a>, <a href=\"/questions/tagged/php\" class=\"post-tag\" title=\"show questions tagged &#39;php&#39;\" rel=\"tag\">php</a>, <a href=\"/questions/tagged/prolog\" class=\"post-tag\" title=\"show questions tagged &#39;prolog&#39;\" rel=\"tag\">prolog</a>, <a href=\"/questions/tagged/python\" class=\"post-tag\" title=\"show questions tagged &#39;python&#39;\" rel=\"tag\">python</a> and a few others.</p>\n\n<p>Programming contests (with several teams):</p>\n\n<ul>\n<li><a href=\"http://www.vlaamseprogrammeerwedstrijd.be\" rel=\"nofollow noreferrer\"><em>Flemish programming contest</em></a>: 1st (2009), 1st (2011), 3rd (2012), 2nd (2014), 2nd (2015), 3rd (2017)</li>\n<li><a href=\"https://www.ieee.org/xtreme\" rel=\"nofollow noreferrer\"><em>IEEEXtreme</em></a>: 31st (2011), 7th (2012), 32nd (2014)</li>\n</ul>\n\n<p>Author of courses on <em>Artificial Intelligence</em> and <em>Digital Electronics and Processors</em>. </p>\n\n<p>Notes:</p>\n\n<blockquote>\n  <p>Answering questions is difficult, <strong>asking good questions is difficult as well</strong>. Please try to provide a <em>minimal compiling example</em>, reread your question and ensure yourself that someone with no a priori knowledge of your situation <strong>can understand your problem</strong>. Later <strong>accept the answer that helped you the most</strong>, upvotes can be a <em>guide</em>.</p>\n</blockquote>\n\n<hr>\n\n<blockquote>\n  <p>Message to <strong>downvoters</strong>: please <strong>first</strong> provide comment and start a discussion. If the person in question does not solve the problem, then downvote. I\'m doing the same by the way.</p>\n</blockquote>\n\n<hr>\n\n<p>There is this <a href=\"https://www.paypal.me/WVanOnsem\" rel=\"nofollow noreferrer\"><em>PayPal account</em></a> if you want to say \"thnx\" in a different way.</p>\n\n<p>You can <a href=\"https://www.codementor.io/willemvanonsem\" rel=\"nofollow noreferrer\">hire me</a> for a <em>code mentoring</em> session.</p>\n','1','4','0','26078');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (9852,1,'2015-08-18T17:26:51.047','Mayank Gupta','2016-08-16T06:50:13.273','null','Gurgaon, Haryana, India','<p>I am a Software Engineer in Gurgaon, India. I specialize mainly in C++ and core Java. I have worked on C++, Core Java projects on Windows Phone and Android. Worked a little bit on feature phone based C, Web-service client project as well.</p>\n','0','0','0','5197479');
