INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10005,101,'2015-09-17T12:10:04.890','Wrzlprmft','2017-12-18T19:21:14.223','null','Germany','<p><em>Any sufficiently complex deterministicity is indistinguishable from stochasticity.</em></p>\n\n<p>Postdoc of physics dealing with complex systems, chaos theory, scientific computing, networks, analysis methods, and theoretical ecology. To get an idea what I am doing, take a look at <a href=\"https://orcid.org/0000-0002-5472-7067\" rel=\"nofollow noreferrer\">my publications</a> or <a href=\"http://idw-online.de/de/news646752\" rel=\"nofollow noreferrer\">this journalistic report on my work</a>.</p>\n\n<p>Blackletter enthusiast. <a href=\"http://typography.guru/seven-questions-for/gerrit-ansmann-unifraktur-maguntia/\" rel=\"nofollow noreferrer\">Here</a> is an interview with me on my work on <a href=\"http://unifraktur.sourceforge.net/\" rel=\"nofollow noreferrer\">Unifraktur Maguntia</a>.</p>\n\n<p>My username is pronounced [ˈvʀ̩ʦl̩ˌpʀm̩ft] and comes from a list of names you should not give to your child, which in turn got it from <a href=\"http://en.wikipedia.org/wiki/Karl_Valentin\" rel=\"nofollow noreferrer\">this guy</a>.</p>\n','0','0','0','2437491');
