INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10106,101,'2015-10-09T16:50:20.533','ixe013','2015-10-27T02:44:14.720','http://www.paralint.com/','Montreal, Canada','<p>I like smart people who get things done. I do my best everyday to be one of them.</p>\n\n<p>I code mostly in C++, Python, Java and... whatever comes my way. I also like to understand a problem down to its roots, a process also known as debugging.</p>\n\n<p><a href=\"http://ca.linkedin.com/in/gseguin\" rel=\"nofollow\">LinkedIn profile</a>. </p>\n','0','1','0','289850');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10112,140,'2015-10-10T03:01:50.067','RockPaperLizard','2017-09-11T05:35:10.973','null','null','<p>Looking for Spock here?  Live long and prosper, my friends.</p>\n\n<p>I specialize in <strong>Usability</strong>, <strong>Human Factors Engineering</strong>, and <strong>User Interface Design</strong>.</p>\n\n<p><a href=\"http://stackexchange.com/users/5182392\">\n<img src=\"http://stackexchange.com/users/flair/5182392.png\" width=\"208\" height=\"58\" alt=\"RockPaperLizard on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"RockPaperLizard on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<p>The StackExchange sites can be a great place to share knowledge and learn new things.</p>\n\n<p>Due to some rude and inappropriate moderating of the Superuser StackExchange site (a sentiment unfortunately shared by quite a few people), I regret that I will be limiting my contributions there.  I do not share those values.  Hopefully things will improve.</p>\n\n<p>The other StackExchange sites seem to attract much better quality and more friendly moderators, and thus have healthier communities.</p>\n','1','7','2','5182392');
