INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10185,103,'2015-10-22T22:02:57.910','Peter Mortensen','2015-11-18T19:55:06.540','http://pmortensen.eu/','Århus, Denmark','<p><sub><em>(Last updated 2015-04-16.)</em></sub></p>\n\n<h2>Every time you make a typo, the errorists win.</h2>\n\n<hr/>\n\n<p>Experienced application developer. Software Engineer. M.Sc.E.E. C++ (10 years),\n   software engineering, .NET/C#/VB.NET (7 years), usability testing, Perl, scientific computing,\nPython, Windows/Macintosh/Linux, Z80 assembly.</p>\n\n<p><hr/>\n<b>Selected questions, etc.</b>:</p>\n\n<ul>\n  <li><a href=\"http://msdn.microsoft.com/en-us/library/cc704588.aspx\" rel=\"nofollow\">Windows error codes</a> (MSDN), e.g. 0xC000042C for STATUS_ELEVATION_REQUIRED.</li>\n  <li><a href=\"http://stackoverflow.com/questions/1399268\">End-of-line identifier in VB.NET?</a></li>\n  <li><a href=\"http://stackoverflow.com/a/270545\">How to determine if a .NET assembly was built for x86 or x64?</a></li>\n  <li><a href=\"http://stackoverflow.com/questions/4946685\">Good tutorial for WinDbg?</a></li>\n  <li><a href=\"http://www.cplusplus.com/reference/cstring/memmove/\" rel=\"nofollow\">C++ reference</a> - sample <em>memmove</em></li>\n  <li><a href=\"http://stackoverflow.com/questions/734600\">The difference between + and &amp; for joining strings in VB.NET</a></li>\n</ul>\n\n<hr/>\n\n<h2>My other accounts:</h2>\n\n<p><a href=\"http://www.irosetta.com/users/peter%20mortensen\" rel=\"nofollow\">\n  iRosetta</a>.\n [<a href=\"http://www.irosetta.com\" rel=\"nofollow\">/</a>].\n</p>\n\n<p><a href=\"http://serverfault.com/users/5144\">\n Server Fault</a> (SF).\n [<a href=\"http://serverfault.com\">/</a>].\n</p>\n\n<p><a href=\"http://superuser.com/users/517\">\n Super User</a> (SU).\n [<a href=\"http://superuser.com\">/</a>].\n</p>\n\n<p><a href=\"http://meta.stackexchange.com/users/63550/peter-mortensen\">\n Meta Stack Exchange</a> (MSE).\n [<a href=\"http://meta.stackoverflow.com\">/</a>].\n</p>\n\n<p><a href=\"http://careers.stackoverflow.com/mortensen\">\n Careers</a>.\n [<a href=\"http://careers.stackoverflow.com/\">/</a>].\n</p>\n\n<h2>Other</h2>\n\n<p><a href=\"http://blog.superuser.com/2011/04/27/peter-mortensen-editor-in-chief/\" rel=\"nofollow\">My 15 minutes of fame on Super User</a></p>\n\n<p><a href=\"http://www.hovedetpaabloggen.dk/2011/09/20/wikipedia-er-der-mon-en-laege-til-stede/\" rel=\"nofollow\">My 15 minutes of fame in Denmark</a></p>\n\n<p><a href=\"http://pvm-professionalengineering.blogspot.dk/\" rel=\"nofollow\">Blog</a>. Sample: Jump the shark.</p>\n\n<p><a href=\"http://dk.linkedin.com/in/mortensenpeter\" rel=\"nofollow\">LinkedIn</a></p>\n\n<p><a href=\"http://mobile.twitter.com/PeterMortensen\" rel=\"nofollow\">@PeterMortensen</a> (Twitter)</p>\n\n<p><a href=\"http://www.google.com/profiles/mortense\" rel=\"nofollow\">Google</a></p>\n\n<p><a href=\"http://www.quora.com/Peter-Mortensen\" rel=\"nofollow\">Quora</a></p>\n\n<p><a href=\"http://github.com/PeterMortensen\" rel=\"nofollow\">GitHub</a></p>\n\n<p><a href=\"http://www.pmortensen.eu/jump.html\" rel=\"nofollow\">\n Full jump page</a></p>\n\n<hr/>\n\n<h2>Contact</h2>\n\n<p>I can be contacted through <a href=\"http://www.google.com/recaptcha/mailhide/d?k=01s2zm_HqZkovs_eUnDR30ew==&amp;c=aB0DAq4Q_RY3Hu3e9Rz4RygsYnHIMxFClCZn_LawwvE=\" rel=\"nofollow\">this reCAPTCHA</a> (requires JavaScript to be allowed from <em>google.com</em>).</p>\n','0','0','0','24885');
