INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10223,101,'2015-10-30T04:30:51.523','SevenSidedDie','2017-03-02T19:34:29.917','http://d7.pipemaze.com/','Vancouver, Canada','<p>Roleplayer, lapsed blogger, and full-time dad.</p>\n\n<p>Have been playing and GMing D&amp;Ds from B/X to D&amp;D 5e. Becoming a fan of indie games and the OSR in the mid 2000s expanded my horizons for both trad and indie games. Fond of GMless and short-form games that suit a busy schedule and are good for enticing non-gamers into the hobby.</p>\n\n<ul>\n<li><a href=\"http://twitter.com/sevensideddie\" rel=\"nofollow\">@sevensideddie</a> on Twitter</li>\n<li><a href=\"http://d7.pipemaze.com/blog/\" rel=\"nofollow\">The Seven-Sided Die</a> blog</li>\n</ul>\n\n<p><strong>Running</strong> <a href=\"http://www.thedesignmechanism.com/why-choose-runequest.php\" rel=\"nofollow\">RuneQuest 6</a> + <a href=\"http://www.glorantha.com/\" rel=\"nofollow\">Glorantha</a> + <a href=\"http://www.pelgranepress.com/?cat=222\" rel=\"nofollow\">Hillfolk</a>; and (as a backup) <a href=\"http://www.dungeon-world.com/\" rel=\"nofollow\">Dungeon World</a>\n• <strong>Reading</strong> <a href=\"http://rpggeek.com/rpgitem/164572/chuubos-marvelous-wish-granting-engine\" rel=\"nofollow\">Chuubo\'s Marvelous Wish-Granting Engine</a> RPG, and <a href=\"http://en.wikipedia.org/wiki/C._J._Cherryh_bibliography\" rel=\"nofollow\">everything by C. J. Cherryh</a></p>\n','0','5','0','222194');
