INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10269,101,'2015-11-06T07:52:05.130','krlzlx','2018-03-07T12:55:54.807','null','Geneva, Switzerland','<p>“Don’t worry if it doesn’t work right.  If everything did, you’d be out of a job.”\nMother’s Law of Software Engineering</p>\n\n<hr>\n\n<p>Featured answers:</p>\n\n<ul>\n<li><a href=\"https://stackoverflow.com/a/39878478/1351076\">Logarithmic y axis with morris.js</a></li>\n<li><a href=\"https://stackoverflow.com/a/33736423/1351076\">Sorting JSON by values</a></li>\n<li><a href=\"https://stackoverflow.com/a/20639964/1351076\">ASP.NET Check file size before upload</a></li>\n<li><a href=\"https://stackoverflow.com/a/37614659/1351076\">Response.Redirect() in iFrame, redirect parent window</a></li>\n</ul>\n','1','3','0','1428032');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10270,101,'2015-11-06T15:37:15.657','trippt02','2015-11-06T15:53:21.253','http://compscihub.weebly.com','Wilmington, NC','<p>Love programming! Currently getting a degree in computer science at the University of North Carolina Wilmington.</p>\n\n<pre><code>alive = True\n\nwhile alive:\n   print(\"Live life to fullest and have fun!\")\n   knowledge = 0\n   if knowledge == 0:\n      print(\"Learn\")\n      knowledge += 1\n   else: \n      print(\"share knowledge with others\")\n</code></pre>\n','0','0','0','7236532');
