INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10278,101,'2015-11-08T11:41:16.080','ArtOfCode','2018-03-05T14:57:45.483','http://artofcode.co.uk','UK','<p>I also provide all text I write on Stack Exchange sites under CC0, or public domain where possible. All code snippets are copyrighted and additionally licensed under the MIT license.</p>\n\n<hr>\n\n<p>Programmer. Sound engineer. Website designer/maintainer. Pretty much anything technical. Currently studying for a degree in computer science. I\'m a moderator pro-tem on <a href=\"http://opensource.stackexchange.com/\">Open Source</a> and <a href=\"http://hardwarerecs.stackexchange.com/\">Hardware Recommendations</a>.</p>\n\n<p><a href=\"http://artofcode.co.uk\" rel=\"nofollow noreferrer\">Development server</a> &mdash; hello@artofcode.co.uk</p>\n\n<hr>\n\n<p>If you want to verify my identity or confirm that I own any of the accounts or websites I claim to, you can do so using <a href=\"https://keybase.io/\" rel=\"nofollow noreferrer\">Keybase</a>. I am <a href=\"https://keybase.io/artofcode\" rel=\"nofollow noreferrer\">artofcode</a> on Keybase, and I am signing the following string using the PGP key identified on my Keybase profile:</p>\n\n<pre><code>3457374\n</code></pre>\n\n<p>which generates the following signed message:</p>\n\n<pre><code>-----BEGIN PGP SIGNED MESSAGE-----\nHash: SHA512\n\n3457374\n-----BEGIN PGP SIGNATURE-----\nVersion: Keybase OpenPGP v2.0.60\nComment: https://keybase.io/crypto\n\nwsBcBAABCgAGBQJYTR8AAAoJENTaEQHLAqUVqiIH/iJFL30KspzR+X7wQgGlA0/F\n+lAnnWh2QGzyGel2Bz4BnUiHIs7T0AXgpp5Tu1vacRD8G2BY8HaVCpQmAHFMRJY9\n0kPaN/bZzYEHS9daA/r37AsuxIGFt2Pmhf6pqqokVIwLg+twKXK8OGZERmG68KCu\nfpbipUBEjsNxmg1saxMe0+ODhCyX1hVLrvt6m0Tflxn/nUILBei9KWUCc06hAZwd\nwWtecmyc8nJ6vrnRpy4QTXX+0xIiPEym5jcHAdlC0O6H5Bi4bAV49eo/gF8e9mxj\nz9o6sPIBlvGDA3oTyapi3lOzvctHTKvpDQSAXpllIjDIflZpCpM5awTlrTbB7MA=\n=Hcr/\n-----END PGP SIGNATURE-----\n</code></pre>\n\n<p>You can paste the above text into <a href=\"https://keybase.io/verify\" rel=\"nofollow noreferrer\">Keybase\'s verification prompt</a> to verify that artofcode on Keybase signed the text.</p>\n','0','0','0','3457374');
