INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10346,101,'2015-11-19T04:34:45.343','DrZ214','2015-11-19T04:50:40.953','http://www.DessertFirstGames.com','null','<p>I have many hobbies and interests that lead me to research in the fields of physics, aircraft/spacecraft/submarines, electromagnetism, history, and others.</p>\n\n<p>Check out my game Scenario Chess, a custom chess game where you can cross rivers, battle multiple armies, and fight across real-world terrain. Coming soon to Steam.</p>\n\n<p><a href=\"https://www.youtube.com/watch?v=dXVrjzK4WUA\" rel=\"nofollow\">Demo Video</a></p>\n\n<p><a href=\"https://twitter.com/Dessert1stGames\" rel=\"nofollow\">Twitter</a></p>\n\n<p>Website: <a href=\"http://www.DessertFirstGames.com\" rel=\"nofollow\">www.DessertFirstGames.com</a></p>\n\n<p><a href=\"http://steamcommunity.com/sharedfiles/filedetails/?id=426424480&amp;result=15\" rel=\"nofollow\">Page on Steam</a></p>\n','0','0','0','1885821');
