INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10542,101,'2016-01-01T23:25:24.760','Paul Schreiber','2016-11-05T14:43:03.157','https://paulschreiber.com/','Brooklyn, NY, United States','<p>I like hockey, bicycle commuting, good design, discussing intellectual property law and baking chocolate cakes.</p>\n\n<p>I don’t have a land line, wear a watch or drink coffee.</p>\n\n<p>Here on SO, I usually help with HTML, CSS and JavaScript; Ruby, Rails, WordPress, PHP and Python; and the occasional Objective-C question.</p>\n','0','1','0','46021');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10543,196,'2016-01-02T00:33:28.843','Patrick Szalapski','2018-02-09T21:36:22.300','http://Szalapski.com','Minneapolis, MN','<p>I make software using .NET, lead software teams, and coach on Scrum and Agile.</p>\n\n<p>I\'ve spent my whole life twiddling with software, and I have grown to be passionate about good software design and practices. Since 2009, I have been leading Scrum teams and gathering all the best practices and attitudes necessary to make a software team effective and efficient. I am most experienced in digital/relationship marketing, eCommerce, CRM, ETL, and data warehousing domains, but I don\'t limit myself to these areas.</p>\n','4','4','0','4829');
