INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10583,229,'2016-01-07T15:59:52.903','Glorfindel','2018-03-10T11:01:15.480','http://i-cthru.com','Ermelo, The Netherlands','<blockquote>\n  <p>Life is complex &ndash; it has both real and imaginary parts.</p>\n</blockquote>\n\n<p><a href=\"https://apple.stackexchange.com/election/4\">Elected &diams; moderator</a> on Ask Different (Apple.SE). (Thanks to those who voted!)</p>\n\n<p><a href=\"https://meta.stackoverflow.com/questions/302924/edit-profile-page-for-10-million-questions-event\">#SOreadytohelp</a> &ndash; especially if you need somebody with shovels to help digging into the dark depths of Stack Exchange (including SEDE). You can ping me in Chat, in <a href=\"https://chat.stackexchange.com/rooms/11540/charcoal-hq\">Charcoal HQ</a>, <a href=\"https://chat.stackexchange.com/rooms/38/ask-different-chat\">Ask Different Chat</a> or <a href=\"https://chat.stackoverflow.com/rooms/41570/so-close-vote-reviewers\">SOCVR</a>.</p>\n','17','3','8','6085540');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10584,101,'2016-01-07T16:11:46.950','Cearon O'Flynn','2016-07-04T15:07:57.040','http://castlerideblog.wordpress.com/','UK','<p>Computer Analyst from the UK into Cycling (riding, watching and fettling), Books, Films &amp; TV, Sports &amp; Cooking</p>\n\n<p>Self confessed geek, fan of </p>\n\n<ul>\n<li><p>All things Marvel, Lord of The Rings, Star Wars, Game of Thrones, Farscape and Babylon 5 </p></li>\n<li><p>Too many assorted Sci-Fi and Fantasy books to name, but favourites include; </p>\n\n<ul>\n<li>The Dune Series</li>\n<li>Peter F Hamilton\'s Commonwealth Saga </li>\n<li>Malazan Book of the Fallen </li>\n<li>Scott Lynch\'s Gentleman Bastards</li>\n<li>Mark Lawrence\'s Broken Empire.</li>\n<li>The Dark Tower</li>\n</ul></li>\n<li><p>And games such as the Fallout, Elder Scrolls &amp; Mass Effect series. </p></li>\n</ul>\n\n<p>Father to 3</p>\n\n<p>Started <a href=\"http://castlerideblog.wordpress.com\" rel=\"nofollow noreferrer\">CAstle RidE for Alzheimers</a> in 2016 - a charity event involving cycling to castles to raise money for Alzheimer\'s Research UK - follow on twitter for the latest news <a href=\"http://www.twitter.com/castle_ride\" rel=\"nofollow noreferrer\">@CAstle_RidE</a> </p>\n','0','2','0','6434336');
