INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10637,123,'2016-01-14T23:28:12.710','haferje','2016-11-09T20:53:31.810','null','United States','<p>Currently working in web development.</p>\n\n<p>I have dabbled in a countless number of programming languages and associated libraries, with a focus in web development and related emerging technologies.</p>\n\n<p>My goal is to finally, one day, complete a mobile game, and stick with a personal website design that I don\'t rewrite each year...</p>\n\n<p>#SOreadytohelp</p>\n','0','1','0','497470');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10638,101,'2016-01-16T11:44:02.703','Darren Cook','2016-01-16T12:00:57.623','http://dcook.org/work/','Tokyo, Japan','<p><strong>UPDATE:</strong> I\'m working on a new book: Practical Machine Learning with H2O, again with O\'Reilly. Should be out in the Autumn. If you want me to let you know as soon as it comes out (and get a discount code!), send me an email (address is below).</p>\n\n<hr>\n\n<p>I\'m director at QQ Trends, a company that solves difficult data and software challenges for our clients. (We often have freelance projects, so get in touch if interested.)</p>\n\n<p>My book, \"Data Push Apps with HTML5 SSE\" is out and selling! Get it from O\'Reilly here: <a href=\"http://shop.oreilly.com/product/0636920030928.do\" rel=\"nofollow\">http://shop.oreilly.com/product/0636920030928.do</a>   Or from Amazon here: <a href=\"http://rads.stackoverflow.com/amzn/click/1449371930\" rel=\"nofollow\">http://www.amazon.com/dp/1449371930</a> Or from any good bookseller.</p>\n\n<p>UPDATE: looking for another part-time CSS/JS programmer. 理想は東京所在、日本語が読める方。Interesting project(s), you will definitely learn something.</p>\n\n<p>(And, of course, please do get in touch if you have interesting challenges that you would like our world-class experts to work on!)</p>\n\n<p>Typical work: doing fun stuff with data (fixing, mining, etc.), web sites (front and back-ends), trading strategies. Research: trading strategies, computer go, machine translation, understanding context, AI search algorithms. Languages: C++, PHP, R, javascript, and many more. </p>\n\n<p>I\'m British, living and working in Tokyo for almost 20 years. Human Languages: English, Japanese (fairly fluent, 1 kyu), some German, Chinese and Arabic.</p>\n\n<p>(Contact me at dc at qqtrend dot com: please mention you are coming from StackOverflow, so I know it is not spam.)</p>\n\n<hr>\n\n<p>Easy ways to irritate me on StackExchange sites (whether my own question or someone else\'s): 1. Downvote without a comment (N/A if someone already left a comment and you just agree with it, of course); 2. Answer in comments. Other than that I\'m a really easy-going and pragmatic guy :-)</p>\n\n<h1>SOreadytohelp</h1>\n','0','0','0','447920');
