INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10754,101,'2016-02-02T17:27:51.460','David Ketcheson','2016-02-02T17:27:51.460','http://davidketcheson.info','Thuwal, Saudi Arabia','<p>Associate Professor of applied mathematics at <a href=\"http://www.kaust.edu.sa\" rel=\"nofollow\">KAUST</a>.  Some links to learn more about me:</p>\n\n<ul>\n<li><a href=\"http://numerics.kaust.edu.sa\" rel=\"nofollow\">My group\'s webpage</a></li>\n<li><a href=\"http://davidketcheson.info\" rel=\"nofollow\">My own page, with blog and open science notebook</a></li>\n</ul>\n\n<p>In terms of computational science, my interests are mainly:</p>\n\n<ul>\n<li>Numerical analysis of ODE and PDE discretizations</li>\n<li>Numerical methods for hyperbolic PDEs</li>\n<li>High performance computing and scalable algorithms</li>\n<li>Scientific software development</li>\n<li>Scientific computing in Python</li>\n</ul>\n\n<p>I\'m a lead developer of the <a href=\"http://numerics.kaust.edu.sa/pyclaw\" rel=\"nofollow\">PyClaw</a> package, an extension of <a href=\"http://www.clawpack.org\" rel=\"nofollow\">Clawpack</a>, which is a finite volume solver for hyperbolic PDEs.</p>\n','0','2','0','413336');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10755,101,'2016-02-03T02:22:09.763','Felipe Plets','2016-02-03T02:22:09.763','http://www.plets.me/','Brazil','<p>I’m a programming polyglot, addicted to JavaScript, open hardware enthusiast with entrepreneur spirit, have an authentic restless mind. I am a practitioner and coach of agile methodologies and design thinking. Co-founder of menvia.com, a startup that develops magical solutions using UX and IoT.</p>\n','0','0','0','1605371');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10756,1,'2016-02-03T06:05:36.537','Just Code 007','2016-02-03T06:05:36.537','null','null','<p>I work in IT industry, though the hours are long and the work is sometimes a little tasking, I really do love my job. I\'m highly into music and I love outdoors. I enjoy socializing and above all I believe I\'m always honest and extremely loyal. My friends and family mean a lot to me. I can be a bit of a nerd sometimes.Anything involving technology  will always fill me in and I love to get along with latest technological trends...</p>\n','0','0','0','3812375');
