INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (10983,101,'2016-03-10T01:56:36.960','Downgoat','2017-12-10T16:32:49.543','https://vihan.org','The Glorious California Bay Area','<p>I\'m Vihan also known as Downgoat. I do Node, C (maybe C++ depending on your definition of \'do\'), and Swift primarily. I use Atom &amp; Vim and a Mac.</p>\n\n<ul>\n<li>Blog: <strong><a href=\"http://blog.vihan.org\" rel=\"nofollow noreferrer\">blog.vihan.org</a></strong></li>\n<li>Current project: <strong><a href=\"http://github.com/vsl-lang/vsl\" rel=\"nofollow noreferrer\">VSL</a></strong></li>\n</ul>\n\n<p>Other random projects:\n - <a href=\"http://vihan.org/p/SSS\" rel=\"nofollow noreferrer\">Solar System Simulator</a> is a newtonian gravity simulator designed to let you make your own solar system.</p>\n\n<p>Favorite answers:</p>\n\n<ul>\n<li><a href=\"http://codegolf.stackexchange.com/a/53023\">MS Paint is underrated</a></li>\n<li><a href=\"http://codegolf.stackexchange.com/a/62334\">Code Golf: Forwards sdrawkcaB sdrawkcaB Forwards Forwards sdrawkcaB</a></li>\n<li><a href=\"http://codegolf.stackexchange.com/a/54461\">Empty a Swimming Pool . . . With Only a Red Solo Cup</a></li>\n</ul>\n\n<p>You can usually find me in <a href=\"http://chat.stackexchange.com/rooms/240/the-nineteenth-byte\">the 19th Byte</a> if not just leave a message with @Downgoat</p>\n\n<p><a href=\"https://stackexchange.com/users/1777035/Downgoat\"><img src=\"https://stackexchange.com/users/flair/1777035.png\" alt=\"profile for Downgoat on Stack Exchange\"></a></p>\n\n<p>Maths is hard:</p>\n\n<p><img src=\"https://i.stack.imgur.com/qjKhD.png\" alt=\"\"></p>\n','0','2','0','1777035');
