n-python</a></li>\n<li><a href=\"http://stackoverflow.com/questions/312443/how-do-you-split-a-list-into-evenly-sized-chunks-in-python\">http://stackoverflow.com/questions/312443/how-do-you-split-a-list-into-evenly-sized-chunks-in-python</a></li>\n<li><a href=\"http://stackoverflow.com/questions/102535/what-can-you-use-python-generator-functions-for\">http://stackoverflow.com/questions/102535/what-can-you-use-python-generator-functions-for</a></li>\n<li><a href=\"http://stackoverflow.com/questions/11421659/passing-variables-creating-instances-self-the-mechanics-and-usage-of-classes\">http://stackoverflow.com/questions/11421659/passing-variables-creating-instances-self-the-mechanics-and-usage-of-classes</a></li>\n</ul>\n\n<p><strong>Concurrency</strong></p>\n\n<ul>\n<li><a href=\"http://www.dabeaz.com/usenix2009/concurrent/\" rel=\"nofollow noreferrer\">http://www.dabeaz.com/usenix2009/concurrent/</a></li>\n<li><a href=\"http://stackoverflow.com/questions/6893968/how-to-get-the-return-value-from-a-thread-in-python\">http://stackoverflow.com/questions/6893968/how-to-get-the-return-value-from-a-thread-in-python</a></li>\n<li><a href=\"http://stackoverflow.com/questions/2846653/how-to-use-threading-in-python\">http://stackoverflow.com/questions/2846653/how-to-use-threading-in-python</a></li>\n<li><a href=\"http://stackoverflow.com/questions/10797998/is-it-possible-to-multiprocess-a-function-that-returns-something-in-python\">http://stackoverflow.com/questions/10797998/is-it-possible-to-multiprocess-a-function-that-returns-something-in-python</a></li>\n<li><a href=\"http://programmers.stackexchange.com/questions/102552/should-i-stick-with-or-abandon-python-to-deal-with-concurrency\">http://programmers.stackexchange.com/questions/102552/should-i-stick-with-or-abandon-python-to-deal-with-concurrency</a></li>\n<li><a href=\"http://stackoverflow.com/questions/8489684/python-subclassing-multiprocessing-process\">http://stackoverflow.com/questions/8489684/python-subclassing-mul