INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11284,16,'2016-05-06T00:54:40.307','William Hird','2016-05-09T06:02:00.233','http://williamhird80@yahoo.com','Peacedale, RI','<p>Electronics Engineer, Amateur Cryptographer with interests in designing real random and psuedorandom bit generators.</p>\n\n<p>\"Randomness is like a box of chocolates; you never know what you are going to get\"</p>\n\n<pre><code>                                                                   Forrest Gump Jr.\n</code></pre>\n\n<p>\"You can\'t use mathematical means to create true randomness but you can use mathematical means to stretch a short truly random bitstream into a binary string of virtually infinite length that is indistinguishable from the uniform distribution, the distinguisher being a Universal Turing Machine\".\n                                                                       John Von Neumann Jr.</p>\n\n<p>\"It\'s trivial to make a Turing machine that fools all other Turing machines into \"thinking\" that they are looking at an unpredictable uniform distribution. Here is the schematic.\"</p>\n\n<pre><code>                                                                   Alan Turing Jr.\n</code></pre>\n','0','0','0','550172');
