INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11323,99,'2016-05-14T15:06:26.890','SuperUberDuper','2016-12-14T07:59:27.347','null','null','<p>Dear Eternal Sentient Being:</p>\n\n<p>You were created for everlasting fellowship and glory with our Father who art in heaven. You have a way to escape the chains that bind your soul to worldly matters and lusts. Step aboard the bridge that Jesus Christ made for you into the kindom of light.</p>\n\n<p>I ask that you say this prayer:</p>\n\n<p>*Father I know that I\'ve broken your laws and my sins have separated me from you.</p>\n\n<p>I\'m truly sorry and I repent and I want to turn away from my past life, and I want to turn towards you. Please forgive me and help me to avoid sinning again. I believe that your son Jesus Christ died for my sins and his blood was shed and he was resurrected from the dead that He is alive and he hears my prayers.</p>\n\n<p>I invite Jesus to become the Lord of my life and to rule and to rain in my heart from this day forward.</p>\n\n<p>Please send your holy spirit to help me obey you and to change my life through the power of your word. I want to serve you the rest of my life. In Jesus name I pray amen.*</p>\n','1','1','0','4854252');
