INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11338,101,'2016-05-17T18:24:03.777','Polygnome','2017-12-10T23:01:10.933','null','null','<p>Computer nerd, student of computer science, freelancer.</p>\n\n<p>I have experience in theoretical computer science and maths, as well as more practical experience in object oriented programming, functional programming, relational database design and many web technologies, including</p>\n\n<ul>\n<li>HTML5</li>\n<li>XML</li>\n<li>JSON, YAML, and other DSLs</li>\n<li>MySQL, Oracle, IBM Express, H2, HSQL</li>\n<li>JavaScript  </li>\n<li>PHP 7, 5.1 - 5.6</li>\n<li>Java 8, 9, 1.5 - 1.7</li>\n<li>Haskell</li>\n</ul>\n\n<p>and work as a freelancer in IT services and software development.</p>\n\n<p>I am interested in studying and following established standards as well as creating new, unique and innovative solutions for business problems, focusing on ease-of-use, maintainability, extendability and creating value for the customer.</p>\n','0','4','0','1440515');
