INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11342,101,'2016-05-18T06:37:46.213','Keith Hall','2017-04-04T12:34:22.073','null','Lithuania','\n\n<p><strong>BY DAY:</strong> .NET developer working on WCF services, Microsoft SQL Server databases and websites (some web forms, some MVC).  My philosophy: automate everything! If a task is assigned to you as a \"one-off\", what\'s the bet that you\'ll be asked to do it again? So doing something manually isn\'t always quicker, and it\'s certainly less fun ;) Plus you learn more that way. In any case, save your work and notes, archive it in such a way that you can find it again :P</p>\n\n<p><strong>BY NIGHT:</strong> maintainer of open source software, such as a couple of Sublime Text 3 plugins (Python)...</p>\n\n<p><strong>FOR FUN:</strong> TF2 &amp; Rocket League player</p>\n\n<p><strong>My toolbox?</strong> LINQPad, Sublime Text, Clipboard Fusion, GitKraken</p>\n','0','2','0','5653606');
