INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11350,101,'2016-05-19T00:49:33.287','William Kinaan','2016-05-24T11:31:55.957','null','Amsterdam, Netherlands','<p>Greetings</p>\n\n<p>I\'m a software engineer from Syria, working currently in the Netherlands</p>\n\n<p>I enjoy development, but coding is just one aspect of Software Engineering, so I do care about analysis and design.</p>\n\n<p>Design patters and Algorithms are the essential building block, while you can learn the syntax of any language in not more than two weeks.</p>\n\n<p>I enjoy music and I\'m a super huge fan for As Roma and Azzurri, and a big fan for the King \"Francesco Totti\"</p>\n\n<p>If you are in the Netherlands, let\'s get for a drink</p>\n\n<p>Cheers guys</p>\n','0','0','0','1465379');
