INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11426,101,'2016-05-31T18:31:56.277','Tim','2016-08-02T18:42:44.390','http://www.timbridge.online','Lincoln Park, NJ','<p>My name is Tim Bridge. I graduated from Stevens Institute of Technology in 2009 with a BS in Computer Science. </p>\n\n<p>Since (and before) then, I have worked in web development as a full stack developer -- primarily LAMP with Drupal, Magento, Wordpress and, secondarily, CodeIgniter and Laravel.  Finally, I have built out custom web applications with VB.NET.  </p>\n\n<p>I am currently employed by Stevens Institute of Technology as a Web Engineer.  On any given day, I can be found designing, building, extending, enhancing, and/or supporting any and all software related to Stevens\' web presence, external- or internal-facing.</p>\n\n<p>I enjoy exploring different technologies that I do not use in my career.  I am currently teaching myself Ruby on Rails, node.js, AngularJS, and designing with user experience as priority for a few side projects.  I have a private portfolio online with access to personal bitbucket repositories of code samples.  Contact me directly if you\'d like a link!</p>\n\n<p>My goal is to grow my skills as a leader as well as my development skills and, combined with my technology skillset, drive a more data-driven decision making process leading to a consistently better education and learning-environment for students, faculty, and staff at Stevens.</p>\n\n<p>I live my life by three pillars: honesty, integrity, and humility.</p>\n\n<p>I love to work with my hands and I love being outside.  When I’m not on a computer, you’d be apt to find me in my garage woodshop, out for a ride on my motorcycle, on a hike in the woods, kayaking down a river, or just sitting next to a small campfire.  I also love reading and podcasts</p>\n','0','2','0','3246129');
