INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11530,161,'2016-06-16T17:37:51.240','nitsua60','2018-01-05T02:39:48.010','null','Northeast USA','<p>Elected moderator on RPGSE: if you have <em>any</em> concerns, kudos, suggestions, questions, please find me in RPG General Chat.</p>\n\n<p><strong>Playing:</strong> Fate/5e, returning to a friend\'s setting for the first time in 5 years.</p>\n\n<p><strong>Running:</strong> 5e Starter Set for 8 year-olds, homebrew duet for son, ToA in AL, an AL site, ToA online.</p>\n\n<p><strong>Prepping:</strong> an <a href=\"http://theangrygm.com/category/megadungeon/\" rel=\"nofollow noreferrer\">Angry Megadungeon</a></p>\n\n<p><strong>Current &amp; Last 6 Books:</strong> Galbraith\'s <em>The Affluent Society</em>; Hunt\'s <em>Hannibal</em>; Davis\' <em>Policing the Black Man,</em> Soni &amp; Goodman\'s <em>A Mind at Play: How Claude Shannon Invented the Information Age</em>; Child\'s <em>The Midnight Line</em>; Mievelle\'s <em>October: The Story of the Russian Revolution.</em>(Oh, and Peterson\'s <em>Playing at the World</em> and Herodotus\' <em>Histories</em> are perennially \"current\" reads.) Not quite a book, but a fascinating read: <a href=\"https://www.feinstein.senate.gov/public/_cache/files/3/9/3974a291-ddbe-4525-9ed1-22bab43c05ae/934A3562824CACA7BB4D915E97709D2F.simpson-transcript-redacted.pdf\" rel=\"nofollow noreferrer\">312 pages of Glen Simpson\'s testimony before the Senate Intelligence Committee\'s staff.</a></p>\n','3','6','0','6656817');
