INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11681,123,'2016-07-09T17:21:05.820','simbabque','2017-05-31T13:00:20.147','http://hannover.pm','Berlin, Germany','\n\n<p>I am available for short-term freelance work. If you\'re interested, please contact me through my CPAN profile.</p>\n\n<hr>\n\n<p>I\'m a software developer working mostly in <a href=\"/questions/tagged/perl\" class=\"post-tag\" title=\"show questions tagged &#39;perl&#39;\" rel=\"tag\">perl</a> with the occasional <a href=\"/questions/tagged/mysql\" class=\"post-tag\" title=\"show questions tagged &#39;mysql&#39;\" rel=\"tag\">mysql</a>, <a href=\"/questions/tagged/html\" class=\"post-tag\" title=\"show questions tagged &#39;html&#39;\" rel=\"tag\">html</a> and <a href=\"/questions/tagged/javascript\" class=\"post-tag\" title=\"show questions tagged &#39;javascript&#39;\" rel=\"tag\">javascript</a> thrown in. I used to do a lot of <a href=\"/questions/tagged/soap\" class=\"post-tag\" title=\"show questions tagged &#39;soap&#39;\" rel=\"tag\">soap</a> in Perl and currently work with <a href=\"/questions/tagged/moose\" class=\"post-tag\" title=\"show questions tagged &#39;moose&#39;\" rel=\"tag\">moose</a> and <a href=\"/questions/tagged/catalyst\" class=\"post-tag\" title=\"show questions tagged &#39;catalyst&#39;\" rel=\"tag\">catalyst</a>. I\'m active in the German Perl community and I usually hang around on irc.perl.org in <em>#perl</em> and <em>#hannover.pm</em>. I also train software development apprentices in the Perl programming language.</p>\n\n<p>My favorite modules currently include <a href=\"http://p3rl.org/Data::Printer\" rel=\"nofollow noreferrer\">Data::Printer</a>, <a href=\"http://p3rl.org/Test::Class::Moose\" rel=\"nofollow noreferrer\">Test::Class::Moose</a> and <a href=\"https://metacpan.org/pod/LWP::ConsoleLogger\" rel=\"nofollow noreferrer\">LWP::ConsoleLogger</a>.</p>\n\n<p>Former favorites: <a href=\"https://v1.metacpan.org/pod/HTTP::XSHeaders\" rel=\"nofollow noreferrer\">HTTP::XSHeaders</a>.</p>\n\n<p>Here are some answers I gave that like a lot:</p>\n\n<ul>\n<li><a href=\"https://stackoverflow.com/a/44649041/1331451\">How do Perl modules “work”?</a></li>\n</ul>\n\n<hr>\n\n<p>We might have met at one of these Perl events:</p>\n\n<ul>\n<li><a href=\"http://hannover.pm\" rel=\"nofollow noreferrer\">Hannover Perl Mongers</a></li>\n<li><a href=\"http://act.yapc.eu/ye2012/\" rel=\"nofollow noreferrer\">YAPC::Europe 2012</a></li>\n<li><a href=\"http://act.yapc.eu/gpw2013/\" rel=\"nofollow noreferrer\">German Perl Workshop 2013</a></li>\n<li><a href=\"http://act.yapc.eu/lpw2013/\" rel=\"nofollow noreferrer\">London Perl Workshop 2013</a></li>\n<li><a href=\"http://act.yapc.eu/gpw2014/\" rel=\"nofollow noreferrer\">German Perl Workshop 2014</a> (Organizer)</li>\n<li><a href=\"http://www.perlworkshop.nl/nlpw2014/\" rel=\"nofollow noreferrer\">Dutch Perl Workshop 2014</a></li>\n<li><a href=\"http://act.yapc.eu/ye2014\" rel=\"nofollow noreferrer\">YAPC::Europe 2014</a></li>\n<li><a href=\"http://act.yapc.eu/gpw2015/\" rel=\"nofollow noreferrer\">German Perl Workshop 2015</a></li>\n<li><a href=\"http://act.yapc.eu/gpw2016/\" rel=\"nofollow noreferrer\">German Perl Workshop 2016</a></li>\n<li><a href=\"http://act.yapc.eu/ye2016/\" rel=\"nofollow noreferrer\">YAPC::EU 2016</a></li>\n<li><a href=\"http://act.yapc.eu/gpw2017/\" rel=\"nofollow noreferrer\">German Perl Workshop 2017</a></li>\n<li><a href=\"http://act.perlconference.org/tpc-2017-amsterdam/\" rel=\"nofollow noreferrer\">TPCiA 2017</a></li>\n<li><a href=\"http://act.yapc.eu/lpw2017/\" rel=\"nofollow noreferrer\">London Perl Workshop 2017</a></li>\n</ul>\n\n<p>I am <a href=\"http://stackoverflow.com/10m\">#SOreadytohelp</a>.</p>\n','0','1','0','1403038');
