INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11738,101,'2016-07-18T19:37:09.960','Amadeus Sánchez','2016-12-05T19:44:04.460','null','null','<p>BY DAY: I use .NET technologies to build the back-end of web apps.</p>\n\n<p>BY NIGHT: I try to sleep eight hours every single night to avoid caffeine during my work hours and to be able to work out.</p>\n\n<p>BY FUN: I like swimming, the outdoors, learning new human and programming languages, hanging out with friends, reading books, and watching movies and Pluralsight courses, among other things. Yo hablo español et je parle français aussi.</p>\n','0','0','0','1878237');
