INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11743,101,'2016-07-19T14:46:01.567','Akin Okegbile','2016-07-19T14:46:01.567','http://akin.okegbile.com','United States','<p>~2012<br>\nE̶n̶t̶r̶y̶ ̶L̶e̶v̶e̶l̶ ̶W̶e̶b̶ ̶D̶e̶v̶e̶l̶o̶p̶e̶r̶<br>\n<br>\n11/15/17<br>\nPolyglot Journeyman Full Stack Developer</p>\n','0','0','0','1735730');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11744,146,'2016-07-19T15:41:03.897','孙悟空','2017-04-25T12:57:30.010','null','Nice, France','<p>Hello, I am Ning ZHANG, I am a programmer Ruby on Rails in Nice. \nI like working with Rails, I like working with Prototype.js ... But I’m not worried too much what happens if they disappear. The programming patterns that I’m using are any-technology-friendly.</p>\n\n<p><strong>The Design of ActiveRecord :</strong> The idea is that you work with regular Ruby objects to manage your business logic, and you use ActiveRecord to make sure that those objects are persisted in your database.</p>\n','4','2','0','3512817');
