INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11781,101,'2016-07-25T11:53:46.297','Nigel Davies','2017-06-12T09:22:45.713','null','England','<p>I am an embedded software developer, working on a variety of control and instrument systems. Mostly I code in embedded C, sometimes C++ or assembler, sometimes with an operating system sometimes not. I also program tools for data acquisition, data analysis, software and system testing and algorithn prototyping in Python and Matlab. </p>\n\n<p>From time to time I have enjoyed working through Project Euler and MATLAB Cody, but life away from computers frequently intervenes and I go for a swim, cycle or walk or do some reading or cooking.</p>\n','0','0','0','330805');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11782,15,'2016-07-25T14:48:31.207','Billy Halim','2016-12-24T04:54:07.290','http://billyhalim.github.io','Medan, Medan City, North Sumatra, Indonesia','<p>Hello, my name is Billy Halim. I am 18 years old. I born on September 25, 1997 in Medan, North Sumatra, Indonesia. My nationality is Indonesian. Now, I live in Medan. I am the first child of 2 brothers and 1 sister in my family. I am an alumni of Sutomo 1, a school in Medan. Now, I am a Computer Science student at University of Sumatera Utara, Indonesia. I take Computer Science degree in University because I have been interested in Computer Science field especially Web Development and a little bit on Mobile Apps Development since the early of 2015. I currently focus on Front-End Web Development which I am responsible to create the user interface of a website. There is still no planning for me to move to Back-End Web Development. My goal is to become a Full-Stack Web Developer. I also like reading, writing, and get updated to stuff related to technology.</p>\n','6','0','0','5866475');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11786,101,'2016-07-27T11:32:06.150','Sami','2016-07-27T11:32:06.150','null','Lahore, Pakistan','<p>A humble well wisher of every one :)</p>\n','0','0','0','969317');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11787,101,'2016-07-27T15:07:41.443','PROBERT','2017-08-26T22:15:19.273','http://robertmpollock.weebly.com','Pueblo, Colorado, United States','<p>Hello Profile readers,</p>\n\n<p>Right now, I am working for the USDA’s US Forest Service as a GIS Specialist and in totally I have worked for USDA\'s US Forest Service and NRCS for the past 15 years.</p>\n\n<p>I taught American Sign Language at New Mexico State University from  January 2012 to May 2015. I hope to teach again somewhere in southern Colorado and Obviously I am the deaf GIS man! </p>\n\n<p>I earned BA in Geography from California State University Fullerton and earned my GIS certificate from the University of California Riverside GIS Extension Program.\nI taught American Sign Language at New Mexico State University from  January 2012 to May 2015. </p>\n\n<p>I love the weather, world events, travel, network new people, exercise, internet, watch movies, of course sports !!, and teach students sign language.</p>\n\n<p>The one thing I like about maps is 3D. It gives you the full concept of the area rather than having a 2D which gives you a vague picturesque in your mind!\nDrop me a note if you wish , psiccgis81008@gmail.com.</p>\n\n<p>Thank you for reading my profile!</p>\n','0','2','0','513080');
