INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11800,101,'2016-07-30T08:17:04.150','ABcDexter','2016-10-09T12:48:25.140','http://www.abcdexter.xyz/','New Delhi, India','<p>24M, Indian, Army Schools\' alumnus, Mensan from New Delhi chapter, graduated with B.Tech. in IT, currently working as a software developer; but all of it doesn\'t matter, or does it?</p>\n\n<p>I am a man of my own will, it\'s been years of अनुभव (experience) in learning...  </p>\n\n<p>The puzzles amused me since childhood. In school, my friends used to bring books of mathematical puzzles, riddles, \'whoddunnit\', and what not...</p>\n\n<p><a href=\"https://i.stack.imgur.com/1tbKs.gif\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/1tbKs.gif\" alt=\"Sierpinski!!\"></a></p>\n\n<p>You can ping me<a href=\"https://i.stack.imgur.com/QgN8w.gif\" rel=\"nofollow noreferrer\">,</a> with love, \n but remember!</p>\n\n<p>\"This better be important, woman. You are interrupting my very delicate calculations.\" <a href=\"https://www.facebook.com/Dexters-Lab-187099194751952/?fref=ts\" rel=\"nofollow noreferrer\">Dexter</a>!!</p>\n\n<h1>#SOreadytoHelp</h1>\n\n<p><a href=\"https://i.stack.imgur.com/58bQL.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/58bQL.png\" alt=\"Abcdexter\"></a><br>\n<a href=\"https://saythanks.io/to/ABcDexter\" rel=\"nofollow noreferrer\"><img src=\"https://img.shields.io/badge/Say%20Thanks-!-1EAEDB.svg\" alt=\"Say Thanks!\"></a>\n<a href=\"http://stackexchange.com/users/3874781\">to ABcDexter</a></p>\n','0','4','0','3874781');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11802,215,'2016-07-30T14:14:12.747','phil soady','2018-03-06T07:02:17.300','null','Heidelberg , Germany','<p>Software and Enterprise architect. \nUsing .Net , ASP.Net Entity Framework and of course C#. \nSpent 20 years doing SAP Projects.\nCurrently designing and building a subscription based multi-tenancy back-end.\nExperience with building and implementing software projects.</p>\n\n<p>Motto: If it\'s worth doing it\'s worth doing properly.</p>\n','1','7','0','1423721');
