INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11808,101,'2016-08-01T13:49:22.930','Preet_Android','2016-08-01T13:49:22.930','http://www.google.co.in','Gurgaon, Haryana, India','<p>I\'m an Android application developer. My working area is Java, Android and phone gap. I have developed more than 30 Android Application in which more than 20 is live on Google Play store. \nMy Phonegap application are also live on Google play store as well as on iTunes(apple store).</p>\n\n<p>My technical skill are Java, Android, Phone gap, Oracle DB, MySQL, SQLite, HTML5, XML, javascript, jQuery and JSON.</p>\n\n<p>Thanks </p>\n\n<p>Happy Coding!!!</p>\n','0','0','0','1131447');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11811,101,'2016-08-01T23:48:48.427','UpAndAdam','2016-11-04T17:42:59.990','null','Chicago, IL','<p>I enjoy integrating systems to solve problems efficiently, making things go faster, accomplishing things efficiently and fighting fires / aka solving problems. When not coding/developing/designing I can be found cycling, playing guitar or lacrosse, or training to do one of the three... unless I got lazy and am just relaxing on the couch playing a video game.</p>\n\n<p>I\'ve been developing professionally since I was in high school, including 3 years at IBM in Austin working on WMQ:LLM and a patent in managing a virtual machine. For the past 7 years I\'ve been working at a Proprietary Trading Firm developing, supporting and extending our in-house trading platform.</p>\n\n<p>Day to day I use: C/C++, Python, Bash, gnuMake, GIT and emacs, on Linux.</p>\n\n<p>I don\'t use vi/m, but I\'m planning on finally learning it oddly enough. I can be the computer science equivalent of my father, a New Yorker from Brooklyn who after living 30+ years in Boston now roots for both the Yankees and Red Sox.</p>\n\n<p>Lastly the answer is always 42.</p>\n','0','2','0','1507674');
