INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11819,101,'2016-08-03T14:47:23.943','Shaun Wild','2016-08-03T14:47:23.943','null','Manchester, United Kingdom','<p>I\'m a software developer for a company in Manchester, I have a passion for game development and spend alot of my spare time creating games.</p>\n\n<p>I mainly use Java and Slick2D to make my games, I\'ve had some experience with Unity and Unreal however.</p>\n\n<p>My current main project is: Tank Engineer, a game about creating your own circuit- controlled tanks that can fight other circuit controlled tanks.</p>\n','0','0','0','1333564');
