om</a> ✔</li>\n<li><p>Simple IT  Rocks <a href=\"http://simpleit.rocks/\" rel=\"nofollow noreferrer\">tech blog</a> ✔</p>\n\n<pre><code>█▒▒▒▒▒▒▒▒▒\n10%\n███▒▒▒▒▒▒▒\n30%\n█████▒▒▒▒▒\n50%\n███████▒▒▒\n90%\n█████████▒\n90%\n█████████▒\n90%\n█████████▒\n\n\n**Stack Overflow**\n</code></pre></li>\n</ul>\n','0','2','0','1193189');
