INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11857,101,'2016-08-09T15:07:34.960','John Kugelman','2016-11-28T23:44:11.437','null','Virginia','<p>Some day I\'ll finish my progressive rock concept album and finally be able to jettison this programming gig. Until then, I\'m happy to discuss the finer points of whatever software thing I\'m into right now. That\'d be <a href=\"/questions/tagged/bash\" class=\"post-tag\" title=\"show questions tagged &#39;bash&#39;\" rel=\"tag\">bash</a> and <a href=\"/questions/tagged/python\" class=\"post-tag\" title=\"show questions tagged &#39;python&#39;\" rel=\"tag\">python</a> at the moment, and definitely not <a href=\"/questions/tagged/c%2b%2b\" class=\"post-tag\" title=\"show questions tagged &#39;c++&#39;\" rel=\"tag\">c++</a>, which can go right to hell.</p>\n\n<hr>\n\n<p>E-mail me: john@kugelman.name</p>\n','0','0','0','26377');
