INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11933,101,'2016-08-16T20:34:46.060','aug','2016-08-16T20:34:46.060','http://augustusyuan.com','Seattle','<p>Web Developer. Quote-lover. Forever a student. University of Washington graduate of 2014 with a BS in Informatics Human Computer Interaction.</p>\n\n<p>I love <a href=\"/questions/tagged/javascript\" class=\"post-tag\" title=\"show questions tagged &#39;javascript&#39;\" rel=\"tag\">javascript</a> and am excited about the future of the web. I\'m here because I want to learn as much as I want to contribute.</p>\n\n<p>Checkout out <a href=\"http://frontendhappyhour.com/\" rel=\"nofollow noreferrer\">Frontend Happy Hour podcast</a>! It\'s just a bunch of guys drinking and talking about frontend shit but maybe you\'ll learn something and I speak on it occasionally.</p>\n','0','0','0','1197213');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11934,116,'2016-08-17T01:38:55.217','Thom Blair III','2016-09-03T16:49:50.040','https://www.facebook.com/thom.blairiii','Richmond, Virginia, USA','<p><strong>NOTE:</strong> Due to popular demand, here is an explanation of how I make my animated GIFs:</p>\n\n<h2>How I Make My Animated GIFs</h2>\n\n<p>I use <a href=\"http://www.cockos.com/licecap/\" rel=\"nofollow noreferrer\">LICEcap</a> with Max FPS set to 24:</p>\n\n<p><img src=\"https://i.stack.imgur.com/lCAVF.png\" alt=\"enter image description here\"></p>\n\n<p>Now, without further ado, on to me!</p>\n\n<h2>Thom Blair III</h2>\n\n<p>Hi! I\'m new to Blender but have been doing computer graphics since I was 13 or so. In fact, I remember when I got the first demo release of Adobe\'s first graphics program that was to become Photoshop. It came on a 5¼ inch floppy, ie before there even were 3.5 inch floppies, and I just laughed at how basic and lack-luster it was compared to Splash (which was the higher-end graphics software out at the time.) In Splash, they already had begun using brushes with soft edges, which was a HUGE leap forward for graphics software at the time -- no other software I could find had that feature. There also was no such thing as any kind of selection tool other than rectangle, although they might have had ovals. Anyway, I tried Adobe\'s program and it was so simplistic I thought, \"Wow, Adobe -- what kind of name is that?? Sticks and mud! Kinda appropriate for such a rudimentary program.\" Little did I know what was to come! Now I can\'t even find any trace of Splash on the internet at all! The wheel of Fate turns and turns...</p>\n\n<p>I also remember when I first started hearing about this new kind of graphics format called \"vectors\". The makers of the graphic novel \"Iron Man: Crash\" were some of the first to use vectors in comics, and vector-based software was being developed as they were making the novel. </p>\n\n<p>I had one job for a year overseeing a team of programmers to transition from an outdated PDP mainframe to a Microsoft Access database for a small university\'s Registrar office. It was very successful there, and so 5 related universities in India wanted it for their registrars, so I took it over there, modified it for them and trained them to use it.</p>\n\n<p>These days, I am just taking my time doing things I enjoy when I can find them and currently, I\'m really enjoying adding Blender to my graphics suite -- I\'m very impressed with it!</p>\n','1','1','0','3869241');
