INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (11963,101,'2016-08-19T15:47:57.520','GamrCorps','2016-08-19T15:47:57.520','http://mattmccaskillblog.blogspot.com/','Arizona, United States','<p><em>Whoever walks with the wise becomes wise, but the companion of fools will suffer harm.</em></p>\n\n<p><em>Proverbs 13:20</em></p>\n\n<hr>\n\n<p>My name is GamrCorps and I have been a member of the Stack Exchange network for over two years now. I love to program, play games and make challenges. I play strategy games and my primary programming languages are Java and Python, although I know others such as C# and Lua. My primary golfing languages are Convex and CJam.</p>\n\n<p>I have created the golfing language <a href=\"https://github.com/GamrCorps/Glava\" rel=\"nofollow noreferrer\">Glava</a>, a golfing dialect of Java.</p>\n\n<p>I have also created the esolang <a href=\"https://github.com/GamrCorps/Convex\" rel=\"nofollow noreferrer\">Convex</a>, a golfing language heavily based on CJam, Golfscript, and other golfing languages.</p>\n\n<p>You can also find me on <a href=\"http://chat.stackexchange.com/rooms/240/the-nineteenth-byte\">The Nineteenth Byte</a>. Just ping me with <code>@GamrCorps</code>.</p>\n\n<h2>All about me:</h2>\n\n<p>Favorite board games:</p>\n\n<ul>\n<li><a href=\"http://www.catan.com/\" rel=\"nofollow noreferrer\">Settlers of Catan</a></li>\n<li><a href=\"http://avalonhill.wizards.com/games/acquire\" rel=\"nofollow noreferrer\">Acquire</a></li>\n</ul>\n\n<p>Favorite challenges that I have made on PPCG:</p>\n\n<ul>\n<li><a href=\"http://codegolf.stackexchange.com/questions/64198/99-bottles-of-beer\">http://codegolf.stackexchange.com/questions/64198/99-bottles-of-beer</a> (The catalog version)</li>\n<li><a href=\"http://codegolf.stackexchange.com/questions/61618/remove-all-occurrences-of-the-first-letter-of-a-string-from-the-entire-string\">http://codegolf.stackexchange.com/questions/61618/remove-all-occurrences-of-the-first-letter-of-a-string-from-the-entire-string</a></li>\n<li><a href=\"http://codegolf.stackexchange.com/questions/60733/count-the-bytes-of-a-program\">http://codegolf.stackexchange.com/questions/60733/count-the-bytes-of-a-program</a></li>\n</ul>\n\n<p>Favorite answers that I have made on PPCG (All in Minecraft):</p>\n\n<ul>\n<li><a href=\"http://codegolf.stackexchange.com/questions/63834/count-up-forever/63865#63865\">http://codegolf.stackexchange.com/questions/63834/count-up-forever/63865#63865</a></li>\n<li><a href=\"http://codegolf.stackexchange.com/questions/64040/string-to-ascii-art-text/64893#64893\">http://codegolf.stackexchange.com/questions/64040/string-to-ascii-art-text/64893#64893</a></li>\n<li><a href=\"http://codegolf.stackexchange.com/questions/66202/product-over-a-range/66329#66329\">http://codegolf.stackexchange.com/questions/66202/product-over-a-range/66329#66329</a></li>\n</ul>\n\n<p>I am also the maintainer of the <a href=\"http://codegolf.stackexchange.com/questions/44680/showcase-your-language-one-vote-at-a-time/63956#63956\">Minecraft section</a> on <a href=\"http://codegolf.stackexchange.com/questions/44680/showcase-your-language-one-vote-at-a-time/\">http://codegolf.stackexchange.com/questions/44680/showcase-your-language-one-vote-at-a-time/</a>.</p>\n\n<hr>\n\n<p><em>But he said to me, \"My grace is sufficient for you, for my power is made perfect in weakness.\" Therefore I will boast all the more gladly about my weaknesses, so that Christ\'s power may rest on me. 10 That is why, for Christ\'s sake, I delight in weaknesses, in insults, in hardships, in persecutions, in difficulties. For when I am weak, then I am strong.</em></p>\n\n<p><em>2 Corinthians 12:9-10</em></p>\n\n<hr>\n\n<p><a href=\"http://stackexchange.com/users/5299249\">\nprofile for GamrCorps on Stack Exchange, a network of free, community-driven Q&amp;A sites http://stackexchange.com/users/flair/5299249.png\n</a></p>\n','0','1','0','5299249');
