INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12005,101,'2016-08-24T06:05:04.157','Ashish Vaghasiya','2018-02-07T05:21:40.353','null','Ahmedabad, Gujarat, India','<ul>\n<li>Open Source Enthusiast with 3 year of experience as Software\nDeveloper (NodeJS).</li>\n<li>Result oriented Professional with deep interest in Computer Science\nand Applied mathematics.</li>\n<li>Good analytical and problem-solving skills.</li>\n<li>Expertise and Hands on Experience in developing Scalable, Secured,\nRobust and Reliable Web Services of Application or system.</li>\n<li>Strong understanding of Database Management System like MYSQL,\nMongoDB.</li>\n<li>Strong knowledge and having strong enthusiasm for DESIGN PATTERN,\nALGORITHMS and DATA STRUCTURES.</li>\n<li>Good Understanding SOFTWARE DEVELOPMENT LIFE CYCLE like Agile\nMethodology, Scrum.</li>\n<li>Good Understanding TDD Software Development, with unit testing.</li>\n<li>Good Understanding of Core Design Patterns and Best Practices in Web\n&amp; Application Development.</li>\n<li>Good Understanding of Express Framework with Aspect Oriented\nProgramming and Dependency.</li>\n<li>Working Knowledge of Designing and Developing RESTFUL API and REST\nWeb Services.</li>\n<li>Working Knowledge of Software Development Tool like MQTT and Socket.</li>\n</ul>\n','0','2','0','2732100');
