INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12042,101,'2016-08-29T13:22:35.817','Malcolm Kogut','2016-08-29T13:22:35.817','null','Rotterdam','<p>Accompanist and soloist Malcolm Kogut has been tickling the ivories (and their distant cousin the plastics) since he was 14. He writes both popular and sacred music and won the National Association of Pastoral Musicians DMMD Musician of the Year award in 1999. He has two CDs of original works to his credit along with many published piano and choral books. Malcolm played in the pit for many Broadway touring shows and Albany, NY-area theater groups. When away from the keyboard, he loves exploring the nooks and crannies of the Adirondack Mountains, battling gravity on the ski slopes and going with the flow of roller coaster-enhanced G-forces.</p>\n','0','0','0','9096516');
