INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12057,101,'2016-08-31T15:30:11.450','Mark Schultheiss','2016-08-31T15:30:11.450','http://none','Canton, GA, United States','<h2>Full stack .Net MVC development C#, JavaScript with jQuery SQL Server TSQL and more.</h2>\n\n<p>Developed my first systems a while ago.\nCoded in so many languages (commercial software I got paid to write) I forget them all, must be 35++ at the moment.</p>\n\n<p>Recent work:</p>\n\n<ul>\n<li>Sr. Dev C# ASP.Net MVC, JavaScript/jQuery, SQL Server back end, Application development and maintenance (C#, Linq/lamda, JavaScript/jQuery Hand coded SQL Server T-Sql TFS/VisualStudio.com repo), some GIT work</li>\n<li>Agile/scrum</li>\n<li>Mentoring/Pair programming with Sr. developers</li>\n<li>Development Lead/Management &amp; mentoring</li>\n<li>Developed a windows service application in C#</li>\n<li>Memory leak discovery and Project Management on C++ 6.0 project</li>\n<li>Transform a classic ASP VB, VBScript web site to\nan MVC C# web application with Kendo UI</li>\n<li>Process engineering</li>\n<li>Mentoring/training TFS users on git use</li>\n</ul>\n','0','0','0','43153');
