INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12203,101,'2016-10-06T14:08:43.147','christo','2017-07-27T08:33:43.360','null','Italy','<p>Started computing with a Commodore 64 in 1982 and working on web technologies since 1994.\n<br><strong>Now</strong>: user interface designer and web developer with a focus on CSS and HTML.</p>\n\n<hr>\n\n<p>And I write about football (the kind of football that on the other side of the ocean is occasionally named soccer).</p>\n','0','0','0','9322546');
