INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12207,101,'2016-10-06T17:56:38.500','bassrek','2016-10-18T16:49:00.793','http://12and2.com','Katy, TX, United States','<p>Swiss Army Knife developer since \'97.  I love to learn whatever it takes to accomplish the task.  One of the first challenges presented to me was taking a Btrieve data file and converting to Quickbooks format through MS Access.  Been loving conversion and interface challenges ever since.</p>\n\n<p>Worked on many platforms, databases and languages (from SQL PL on IBM AS/400 for a little intranet to PL/SQL on Oracle for an enterprise ERP) and always enjoy the challenge of learning something new.</p>\n\n<p>Primary focus lately is developing an integrated custom solution for my company based on WPF utilizing C# and MVVM methodology with a SQL Server 2014 backend.  Learning all the features and capabilities of Azure on the side.</p>\n','0','0','0','5803704');
