INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12265,121,'2016-10-16T18:27:51.990','theonlygusti','2017-11-03T18:08:57.457','http://theonlygusti.github.io/','The Galapogas Isles','\n\n<p>theonlygusti is an outstanding well-respected community moderator, with an incredible knowledge of all programming.</p>\n\n<p><a href=\"http://stackexchange.com/users/4019407/theonlygusti\"><img src=\"http://stackexchange.com/users/flair/4019407.png\" width=\"208\" height=\"58\" alt=\"profile for theonlygusti on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for theonlygusti on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n','1','0','0','4019407');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12266,101,'2016-10-16T19:48:28.910','Byte Commander','2018-03-05T14:58:09.687','http://bytecommander.github.io','Germany','\n\n<p>Hello,  \n I\'m a young German guy interested in computers, science, art, music (heavy metal, rock, classical - in that order) and many other things.<br>\nI love Ubuntu and most Linux distributions in general, but I can also do some Windows magic if needed. Additionally I have pretty good programming skills in Python, Java, C# and Bash; basic skills in JavaScript, HTML+CSS, C, C++, Scheme, Basic, etc...  </p>\n\n<p>You can easily contact me in the <a href=\"http://chat.stackexchange.com/rooms/201/ask-ubuntu-general-room\">Ask Ubuntu General Room</a> or the <a href=\"http://chat.stackoverflow.com/rooms/22091/teenage-programmers-chatroom\">Teenage Programmers Chatroom</a>, as I at least have a quick peek in there most days. I also play chess, so feel free to send me a <a href=\"http://en.lichess.org/@/ByteCommander\" rel=\"nofollow noreferrer\">lichess.org challenge</a>.</p>\n\n<p></p>\n\n<p><sub><del>PS: My profile picture is derived from <a href=\"http://haskditex.deviantart.com/art/Wolf-Tribals-267898705\" rel=\"nofollow noreferrer\">\"Wolf Tribals\" by user HaskDitex (DeviantArt.com)</a>, which is under <a href=\"http://creativecommons.org/licenses/by/3.0/\" rel=\"nofollow noreferrer\">creative Commons 3.0 License</a>.</del>\n<br/>\nCurrently I\'m using the character \"Dregg Morriss\" from the game \"Medieval Cop\" by Vasant Jahav (\"Gemini Gamer\"). <del>It can be found <a href=\"http://medieval-cop.wikia.com/wiki/Dregg_Morris\" rel=\"nofollow noreferrer\">here</a>.</del>\n</sub></p>\n\n\n','1','0','0','5612515');
