INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12270,101,'2016-10-17T00:58:32.483','DJMcMayhem','2018-02-15T20:02:50.867','null','The ministry of silly walks','<blockquote>\n  <p>I never trust someone who\'s more excited about success than about doing the thing they want to be successful at. --xkcd</p>\n</blockquote>\n\n<p><a href=\"https://stackexchange.com/users/4314782/djmcmayhem\"><img src=\"https://stackexchange.com/users/flair/4314782.png\" width=\"208\" height=\"58\" alt=\"profile for DJMcMayhem on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for DJMcMayhem on Stack Exchange, a network of free, community-driven Q&amp;A sites\" /></a></p>\n\n<p>Elected <s>janitor</s> moderator ♦ on <a href=\"http://codegolf.stackexchange.com/\">Programming Puzzles and Code-golf</a>. Like doing horrible things to your code in the name of making it as short as possible? Come check it out!</p>\n\n<p>Off of stack Exchange, I enjoy making music and listening to music 24/7. I also like rock climbing and video games. </p>\n\n<p><em>On</em> Stack Exchange, I like answering questions about vim, and finding challenges that are completely unsuitable for vim and then using vim as a golfing language. I\'ve written a bunch of challenges in the past, so if you found an old challenge that you like, go ahead and answer it! I no longer accept answers on most of my challenges because <a href=\"https://codegolf.meta.stackexchange.com/a/8363/31716\">I belive it is harmful for the site</a>, but I like to encourage new answers to old challenges, so I tend to upvote new answers on my old challenges. </p>\n\n<p>Because code-golf is really an intra-language competition, not an inter-language competition, I greatly enjoy using the worst possible language for the task. That\'s why I\'ve written two different languages:</p>\n\n<ul>\n<li><p><a href=\"https://github.com/DJMcMayhem/V\" rel=\"nofollow noreferrer\">V</a>, a golfing variant of vim that\'s only good at manipulating strings, but can do a bunch of other stuff if you have the patience.</p></li>\n<li><p><a href=\"https://github.com/DJMcMayhem/Brain-Flak\" rel=\"nofollow noreferrer\">Brain-flak</a>, a turing tarpit where simple tasks are obscenely difficult, and the only valid code is balanced brackets.</p></li>\n</ul>\n\n<p>If you ever need me for something, feel free to ping me in <a href=\"http://chat.stackexchange.com/rooms/240/the-nineteenth-byte\">The Nineteenth Byte</a>, I\'m basically in that room constantly. Or you can email me at <code>DJMcMayhem[at]gmail[dot]com</code>.</p>\n\n<pre><code>:w !sudo tee %\n</code></pre>\n\n<blockquote class=\"spoiler\">\n  <p><sub>We did not invent The Algorithm. The algorithm is banned in 47 countries. The algorithm is on-topic on 87 percent of SE sites. The Algorithm consistently finds Jon Skeet. The algorithm cannot be detected by regex. This is not the algorithm. This is close.</sub></p>\n</blockquote>\n','0','0','0','4314782');
