INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12276,113,'2016-10-17T13:41:32.103','Francesco Casula','2016-11-10T09:51:59.267','https://fracasula.github.io/','London, United Kingdom','<blockquote>\n  <p>Writing clean code is a lot like painting a picture. Most of us know when a picture is painted well or badly. But being able to recognize good art from bad does not mean that we know how to paint.</p>\n</blockquote>\n\n<p><em>Robert Cecil Martin\'s</em> - <strong>The Clean Coder</strong></p>\n','0','2','0','439432');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12277,101,'2016-10-17T14:27:28.027','Always Confused','2017-01-16T15:06:48.173','null','Kolkata, West Bengal, India','<h2>I am in a pause from Stackexchange for few months. Will be back soon.</h2>\n\n<p>I am basically a biology student, and slow learner, however I am obsessed with basics than advance. I have completed a masters degree in Botany around 2015. </p>\n\n<hr>\n\n<p>Now I am in certain course about biology research and advances, which mainly focuses around bioinformatics, molecular biology and microbiology. </p>\n\n<hr>\n\n<hr>\n\n<p><strike>I\'ve submitted <a href=\"http://area51.stackexchange.com/proposals/109460/bangla-or-bengali-language-learners\">a proposal on AREA-51 for SE site on Bangla (=Bengali) language</a>. Right now it\'s starred (*). I.e. <a href=\"https://area51.meta.stackexchange.com/questions/20966/minimum-activity-requirements-for-area-51\">if does not get 5 follows within 3 days of creation; it will be deleted</a>. However it will take a long journey (many more supports) to make it successful. Enthusiast please support us by following the proposal or/and submitting good-questions.</strike>   </p>\n\n<p>UPDATE: </p>\n\n<h2>!   <strong>PSST</strong>  !</h2>\n\n<p>The proposal of an SE about <a href=\"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A6%BE%E0%A6%82%E0%A6%B2%E0%A6%BE_%E0%A6%AD%E0%A6%BE%E0%A6%B7%E0%A6%BE\" rel=\"nofollow noreferrer\">Bangla</a> (=<a href=\"https://en.wikipedia.org/wiki/Bengali_language\" rel=\"nofollow noreferrer\">Bengali</a> (in Eng.) ) language <strong>did not received enough follow within 3 days</strong>; so it has been deleted by system. </p>\n\n<p>I\'ll again propose the site in indefinite future (not right now because I\'m very busy); but If in the mean time anyone else want to take the initiative; they will get the support from me as much as possible for me <strong><em>staying within SE network</em></strong> and not hampering my anyother works. So the site won\'t be duplicated. If anyone wish; go ahead. </p>\n\n<p>On that issue; my recommendation/opinion is; beside grammar and literature (mainstream things); typing and software-rendering related questions could be put under the same umbrella; because typing/software related problems are associated with its users or application. However othes\' opinion would matter. </p>\n\n<p>If SE network do-not have enough server-memory; they may think about expanding and improving that in future. Though it is quite impractical to include all Indian languages under the same proposal \"Indian languages\"; it too should be re-opened for  the general aspects. </p>\n\n<hr>\n\n<p><strong>UPDATE:</strong> At some point at 2017 I have lost the backup copy of questions published in proposed Bengali language SE network; completely accidentally, after a system crash. I\'m sory for this inconvenience. </p>\n\n<p>Up to my recall, there was probably only one question by another user (other than me) pen-named \"Ankoganit\" who asked if the letter \"ঋ\" is pronounced as \"R+i\", then why it is classified traditionally as vowel instead of consonant. </p>\n\n<p>Other questions were by me, and probably I would be able to recall them gradually. </p>\n\n<hr>\n','0','0','0','8307233');
