INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12351,101,'2016-11-03T03:46:02.557','geerlingguy','2016-11-04T03:15:45.740','https://www.jeffgeerling.com/','St Louis, MO','<p>I own <a href=\"https://www.midwesternmac.com/\" rel=\"nofollow noreferrer\">Midwestern Mac, LLC</a>, and am a Technical Architect at <a href=\"https://www.acquia.com/\" rel=\"nofollow noreferrer\">Acquia</a>.</p>\n\n<p>I run many websites, mostly using Drupal/LAMP, and manage a few services:</p>\n\n<ul>\n<li><a href=\"http://hostedapachesolr.com/\" rel=\"nofollow noreferrer\">Hosted Apache Solr Search for Drupal</a></li>\n<li><a href=\"https://servercheck.in/\" rel=\"nofollow noreferrer\">Server Check.in - a simple and inexpensive website and uptime monitor</a></li>\n</ul>\n\n<p>I also spend a lot of time working with infrastructure and cloud servers. I\'m the author of <a href=\"http://www.ansiblefordevops.com/\" rel=\"nofollow noreferrer\">Ansible for DevOps</a>, a book about Ansible, the infrastructure automation software.</p>\n','6','0','0','35361');
