INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12355,101,'2016-11-03T19:31:44.187','Raghu Ariga','2016-11-03T19:31:44.187','https://sharepoint2010blog.wordpress.com/','Winston Salem, NC','<p>I am a Software Engineer. My education has introduced me to the world of Programming. Beginning with C, C++ I explored programming according to requirements.</p>\n\n<p>Working with Clients in Services, Textiles, Finance and Non-Profit molded my self in writing complex code in VB and C#. After using C# in the workplace, it became my language of personal preference.</p>\n\n<p>Now I am working within the immense world of SharePoint with knowledge and expertise on Microsoft Office SharePoint Server 2007/SharePoint 2010/2013/2016, Windows SharePoint Services (WSS) 3.0, SharePoint Designer, Info Path 2007/2010, Workflows, C#.NET, VB.NET, ADO.NET, .NET Framework, Oracle Fusion, Oracle Fusion Cloud, Taleo, Peopleclick, Dynamics GP, Dynamics AX, Dynamics SL and AJAX</p>\n','0','0','0','936613');
