INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12372,1,'2016-11-08T02:11:08.767','Kevin Smith','2016-11-11T04:49:07.840','null','Cocoa Beach, FL','<p>I have over 16 years of experience in the use of web technologies, for small business application and personal productivity.  In addition, over the years, I developed a high-level understanding of IT disciplines and how they come together to create a successful business.  </p>\n\n<p>I specialize in leveraging low cost - no cost IT solutions to facilitate business processes; CRM, eCommerce, bookkeeping, cloud based office administration, mobile applications. social media, email newsletters etc.</p>\n\n<p>I\'ve been exposed to many of the popular languages, however, I have a good working knowledge in HTML, Javascript, CSS, Java, Python, and Android programming.</p>\n\n<p>I am interested in using disruptive technology and new media for results driven strategies.</p>\n','0','0','0','7552245');
