INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12374,101,'2016-11-08T13:55:01.293','andi','2017-07-11T11:49:51.193','http://andilabs.com','Warsaw, Poland','<p>Hi!</p>\n\n<p>My name is Andrzej Kostanski and I am an experienced backend engineer working mostly with <code>python</code>/<code>django</code> stack. Excited about creating new services, which makes people everyday life smarter.</p>\n\n<p>BLOG:\n<a href=\"http://andilabs.github.io\" rel=\"nofollow noreferrer\">http://andilabs.github.io</a></p>\n\n<p>LINKEDIN: <a href=\"https://www.linkedin.com/in/andrzejkostanski\" rel=\"nofollow noreferrer\">https://www.linkedin.com/in/andrzejkostanski</a></p>\n\n<p>Since 2016 I am in love with  <a href=\"http://anditriathlon.com\" rel=\"nofollow noreferrer\">http://anditriathlon.com</a></p>\n','0','3','0','922034');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12375,101,'2016-11-08T15:47:12.093','Marty_in_a_Box','2016-11-08T15:47:12.093','null','Germany','<p>I am a regular guy. Do you know the german football manager / coach Jürgen Klopp? He is that kind of regular guy. In England exists one of the most egocentric but successful man: Jose Mourino.\nAt one day Jose Mourino was so self concentrated that he called himself \"The special One\".</p>\n\n<p>In Reference to this Saying Jürgen Klopp said he is \"something like the normal One\".</p>\n\n<p>So that\'s me: I am also a normal One.</p>\n\n<p>I like Football, Gaming and Programming. And i believe in the saying that you never know everything and that you always find someone who can give you new Input.</p>\n','0','0','0','2973073');
