INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12412,107,'2016-11-15T06:20:19.903','Makoto','2017-12-02T16:58:47.810','null','Denver, CO, United States','<p>Hi!  Nice to meet you.</p>\n\n<p>I am <strong>always happy to help you</strong>.  I will share what knowledge I have of whatever language or tools I\'m familiar with.</p>\n\n<p>I am a <strong>Software Engineer</strong>.</p>\n\n<p>I am comfortable with:</p>\n\n<ul>\n<li>Java (Core, Spring)</li>\n<li>JSP (JSTL)</li>\n<li>Python (2.x and 3.x)</li>\n<li>Ruby</li>\n<li>SQL (MySQL, SQLite)</li>\n</ul>\n\n<p>I have used these tools:</p>\n\n<ul>\n<li>IntelliJ IDEA</li>\n<li>0xDBE</li>\n<li>DB Visualizer</li>\n<li>Git</li>\n</ul>\n\n<p>I am a <strong>Linux Enthusiast</strong>.</p>\n\n<ul>\n<li>Full-time Xubuntu user</li>\n<li>Used Linux in general for over 14 years - Debian and RPM-based</li>\n</ul>\n\n<p>I am an <strong><a href=\"http://anime.stackexchange.com\">Anime and Manga</a> Enthusiast</strong>.</p>\n\n<p>To name a few of my favorite series...</p>\n\n<ul>\n<li>Outlaw Star</li>\n<li>Last Exile</li>\n<li>RahXephon</li>\n<li>Sword Art Online</li>\n<li>Cowboy Bebop</li>\n<li>Samurai Champloo</li>\n<li>Time of Eve</li>\n<li>...and many, many others</li>\n</ul>\n\n<p>I am an <strong>Open Source Advocate</strong>.</p>\n\n<ul>\n<li>Author and maintainer of <a href=\"https://github.com/MakotoTheKnight/codeschool-intellij\" rel=\"nofollow\">codeschool-intellij</a> - a dark theme inspired by AstonJ\'s original work for IntelliJ (and most JetBrains IDEs)</li>\n</ul>\n','0','2','0','1082858');
