INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12489,101,'2016-11-29T00:41:39.530','Erik','2017-12-18T23:03:55.060','http://erikbollinger.com','Idaho, United States','<p>For my day job I\'m a full stack web developer/architect in the Microsoft.NET ecosystem. Currently, my main initiative is developing the back end systems for a mobile social application. </p>\n\n<p>When I\'m not at work I\'m generally spending time with my wife and children, or working on a side project.</p>\n','0','6','0','6735847');
