INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12497,101,'2016-11-29T16:35:59.147','Henry WH Hack v2.1.1','2018-02-08T20:48:35.620','https://stackexchange.com','Stack Exchange','<p><br>I am the ghost of Stack Exchange!\n<br>I am interested in Science,Computers and learning new things everyday.</p>\n\n<hr>\n\n<p>Current Version: v2.1.1<br>\nMajor Future Versions: Mod Edition,<a href=\"https://web.archive.org/web/http://stackoverflow.com/company/team#Community\" rel=\"nofollow noreferrer\">CM Edition</a> and <a href=\"https://web.archive.org/web/http://stackoverflow.com/company/team#Engineering\" rel=\"nofollow noreferrer\">Dev Edition</a></p>\n\n<hr>\n\n<p>I am <strong>trying</strong> to be as helpful as possible on the Stack Exchange network.</p>\n\n<p>Here are the tasks I do on the Stack Exchange sites (v2.1.1):</p>\n\n<ul>\n<li>I flag bad post.</li>\n<li>I do edits on some SE sites.</li>\n<li>I do Close/Reopen reviews on private beta sites.</li>\n<li>I cast Close Votes on Area51.SE example questions that needs to be closed. (<strong>I was running out of ideas so why not.</strong>)</li>\n</ul>\n\n<hr>\n\n<p><strong>Notes</strong>: </p>\n\n<p>If you have to make a complaint about me please do so in <a href=\"https://chat.stackexchange.com/rooms/51035\"><strong>this</strong></a> chat room.</p>\n\n<hr>\n\n<p><strong>FAQ</strong>: </p>\n\n<p>Q: Why are you doing this?<br>\nA: It all started when <strike>I found out about Robert Cartaino</strike>, just kidding it happened long before that I just do them because, I am trying to be helpful. :)</p>\n\n<hr>\n\n<p><a href=\"https://stackexchange.com/users/7238091\">\n<img src=\"https://stackexchange.com/users/flair/7238091.png\"></a></p>\n\n<p>RC ♦ is the man!  </p>\n\n<p><a href=\"https://stackexchange.com/users/34933\">\n<img src=\"https://stackexchange.com/users/flair/34933.png\"></a></p>\n\n<p>Dev Dev Dev! </p>\n\n<p><a href=\"https://stackexchange.com/users/37099\">\n<img src=\"https://stackexchange.com/users/flair/37099.png\"></a></p>\n\n<p>Shadow man!</p>\n\n<p><a href=\"https://stackexchange.com/users/620\">\n<img src=\"https://stackexchange.com/users/flair/620.png\"></a></p>\n\n<hr>\n\n<p><strong>Easter Eggs</strong>: </p>\n\n<p><sub>Count how many grammar mistakes are in my profile\'s about me page.</sub></p>\n','0','0','0','7238091');
