INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12500,85,'2016-11-30T01:52:08.330','Juan Carlos Oropeza','2017-06-21T15:20:04.500','null','Venezuela','<p>Note to all SO beginner:</p>\n\n<p>Please read (and embrace!) Jon Skeet\'s <a href=\"http://blogs.msmvps.com/jonskeet/2010/08/29/writing-the-perfect-question/\" rel=\"nofollow\">helpful hints on how to write a good question</a> (or at least <a href=\"http://blogs.msmvps.com/jonskeet/2012/11/24/stack-overflow-question-checklist/\" rel=\"nofollow\">his short version here</a> ) - one that has a chance that someone can answer it.</p>\n\n<p>Also a good one <a href=\"http://importblogkit.com/2015/05/how-do-you-eat-an-elephant/\" rel=\"nofollow\">How to eat an elephant</a>.</p>\n','1','0','0','3357666');
