INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12861,101,'2017-02-17T12:46:26.053','Anoop H.N','2017-02-17T12:46:26.053','null','Bangalore, Karnataka, India','<p>Full stack web developer. ASP.NET MVC, SqlServer, WEB API, Oracle PL/SQL, Knockout JS, Jquery, Javascript, HTML and CSS are my key skills.</p>\n\n<p>Learning python. Very active on <a href=\"https://www.sololearn.com/Profile/7250182\" rel=\"nofollow noreferrer\">https://www.sololearn.com/Profile/7250182</a></p>\n\n<p>I accept all python, C# and Javascript challenges. Sometimes I win sometimes I lose, But everytime I learn from it.</p>\n\n<p>Apart from coding, I am very much passionate about physical fitness. I do calisthenic workouts.</p>\n','0','0','0','9704915');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12862,116,'2017-02-17T19:50:19.093','TheGuyThatDoesn'tKnowMuch','2017-04-27T16:28:11.930','http://none','Vermont, United States','<p>Business Intelligence Analyst at a tech company.</p>\n\n<p>Huge golf fan.</p>\n','3','2','0','4858676');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12863,101,'2017-02-17T22:44:56.650','Singulaere Entitaet','2017-02-23T12:09:53.327','null','Europe','<p>Lawyer. UK, US and German law.</p>\n\n<p>... and now for something completely different:</p>\n\n<blockquote>\n  <p>This actually did happen to a real person, and the real person is me. I had gone to catch a train. This was April 1976, in Cambridge, U.K. I was a bit early for the train. I’d gotten the time of the train wrong. I went to get myself a newspaper to do the crossword, and a cup of coffee and a packet of cookies. I went and sat at a table. I want you to picture the scene. It’s very important that you get this very clear in your mind. Here’s the table, newspaper, cup of coffee, packet of cookies. There’s a guy sitting opposite me, perfectly ordinary-looking guy wearing a business suit, carrying a briefcase. It didn’t look like he was going to do anything weird. What he did was this: he suddenly leaned across, picked up the packet of cookies, tore it open, took one out, and ate it.\n  Now this, I have to say, is the sort of thing the British are very bad at dealing with. There’s nothing in our background, upbringing, or education that teaches you how to deal with someone who in broad daylight has just stolen your cookies. You know what would happen if this had been South Central Los Angeles. There would have very quickly been gunfire, helicopters coming in, CNN, you know… But in the end, I did what any red-blooded Englishman would do: I ignored it. And I stared at the newspaper, took a sip of coffee, tried to do aclue in the newspaper, couldn’t do anything, and thought, What am I going to do?</p>\n  \n  <p>In the end I thought Nothing for it, I’ll just have to go for it, and I tried very hard not to notice the fact that the packet was already mysteriously opened. I took out a cookie for myself. I thought, That settled him. But it hadn’t because a moment or two later he did it again. He took another cookie. Having not mentioned it the first time, it was somehow even harder to raise the subject the second time around. “Excuse me, I couldn’t help but notice…” I mean, it doesn’t really work.</p>\n  \n  <p>We went through the whole packet like this. When I say the whole packet, I mean there were only about eight cookies, but it felt like a lifetime. He took one, I took one, he took one, I took one. Finally, when we got to the end, he stood up and walked away. Well, we exchanged meaningful looks, then he walked away, and I breathed a sigh of relief and st back.</p>\n  \n  <p>A moment or two later the train was coming in, so I tossed back the rest of my coffee, stood up, picked up the newspaper, and underneath the newspaper were my cookies. The thing I like particularly about this story is the sensation that somewhere in England there has been wandering around for the last quarter-century a perfectly ordinary guy who’s had the same exact story, only he doesn’t have the punch line.</p>\n  \n  <p>-Douglas Adams, The Salmon of Doubt\n  “Cookies”</p>\n</blockquote>\n','0','0','0','4866990');
