INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12874,101,'2017-02-20T21:26:05.790','NobodyNada','2018-01-14T03:56:18.350','null','Portland, OR, United States','<p>I\'m a homeschooled Christian teenager from the Portland, Oregon area.  I enjoy macOS, iOS, Arduino, and Nintendo Entertainment System programming.</p>\n\n<p>I participate in <a href=\"//chat.stackoverflow.com/rooms/41570\">SO Close Vote Reviewers</a>, where we moderate Stack Overflow in any way we can, <a href=\"//chat.stackexchange.com/rooms/11540\">Charcoal HQ</a>, where we detect and flag spam with <a href=\"//github.com/Charcoal-SE/SmokeDetector\" rel=\"nofollow noreferrer\">SmokeDetector</a>, and <a href=\"//chat.stackoverflow.com/rooms/111347\">SOBotics</a>, where we develop bots to help us moderate the site.  Feel free to join us in any of those rooms!  </p>\n\n<p>If you need to contact me for some reason, just ping me in one of the chat rooms listed above or send me an email at <code>&lt;my username&gt;@sobotics.org</code>.</p>\n','0','0','0','4248202');
