INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12932,101,'2017-03-02T19:27:58.353','M.A.R.','2017-05-12T17:25:16.870','null','Tabriz, Iran','<p>I\'ll keep a consistent name from now on. (/¯◡ ‿ ◡)/¯ ~ ┻━┻</p>\n\n<p>BTW, I\'m <strong>neither a chemist nor a linguist</strong>. Never hesitate to take my advice with a grain of salt if you felt you should.</p>\n\n<p>Remarkable previous names: Ϻ.Λ.Ʀ., IͶΔ, TIPS</p>\n\n<hr>\n\n<h3>List of 2016 names:</h3>\n\n<p>IͶΔ, PhMgBr, TIPS, DEAD, Rubisco</p>\n\n<hr>\n\n<h3>Interesting stuff:</h3>\n\n<ul>\n<li><a href=\"http://meta.stackexchange.com/a/263858\">Why does Stack Exchange have to feel so unfriendly now?</a></li>\n<li><a href=\"http://meta.chemistry.stackexchange.com/questions/3044/hidden-points-of-editing-you-probably-dont-know\">Hidden points of editing you probably don\'t know</a> (meta.chem)</li>\n<li>You never know what you can do with Mathjax. <a href=\"http://meta.chemistry.stackexchange.com/q/111/\">Sandbox</a> (meta.chem)</li>\n<li>Surprisingly many don\'t know that a <a href=\"http://data.stackexchange.com/\" rel=\"nofollow noreferrer\">Stack Exchange data explorer</a> exists. Don\'t speculate, go find the stats out!</li>\n<li><a href=\"http://meta.ell.stackexchange.com/q/2630/\">How can I write a better title for my question?</a> (meta.ell, but the rationale goes for all types of questions in all fields)</li>\n<li>For those who take downvotes as death threats: <a href=\"http://meta.stackexchange.com/a/33949\">Second</a> and <a href=\"http://meta.stackexchange.com/a/53297\">third</a> most downvoted posts of all time in Stack Exchange are from Jeff Atwood.</li>\n</ul>\n\n<hr>\n\n<h3>Some things:</h3>\n\n<ul>\n<li><a href=\"http://meta.chemistry.stackexchange.com/questions/2940/the-great-retagging-event-episode-1-the-one-taggers\">TRE</a> (meta.chem)</li>\n<li><a href=\"http://meta.ell.stackexchange.com/questions/2632/title-cleanup-event-tce-an-invitation\">TCE</a> (meta.ell)</li>\n<li><a href=\"http://meta.chemistry.stackexchange.com/a/2968/7448\">The tag test</a></li>\n</ul>\n\n\n','0','0','0','3841881');
