INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12934,101,'2017-03-02T20:32:31.620','CalvT븃','2018-03-11T02:46:51.020','http://browsers.wtf','Buenos Aires','\n\n<p><img src=\"https://stackexchange.com/users/flair/1245478.png\"></p>\n\n<p>Want to talk to me? I\'m most often found in the <a href=\"http://chat.stackexchange.com/rooms/11540/charcoal-hq\">Charcoal HQ</a>.</p>\n\n<p>Why is your post being downvoted? Because of <a href=\"/users/current\">this user</a>.</p>\n\n<p>I do a lot of spam flagging, current stats are <strong>4005 helpful</strong> across the network. <em>9th of January 2018</em></p>\n\n<p>What does the symbol in my name mean? Apparently, it translates to <em>Byus</em>. Here are some more: 뭇믓븃숖숃숁</p>\n\n<p>Just because I was last seen a few hours ago, it doesn\'t mean I\'m around. There are various AI\'s using my account, and not just Smokey. Heck, I may even be AI. We all might be!</p>\n\n<p>If you\'re surprised by my badges, that\'s <a href=\"https://meta.stackexchange.com/questions/296849\">explained here</a>.</p>\n\n<p><a href=\"https://area51.stackexchange.com/proposals/107036/drones?referrer=BP4va8DEJ8elMLc6hgPLhA2\"><img src=\"https://area51.stackexchange.com/ads/proposal/107036.png\" width=\"300\" height=\"250\" alt=\"Stack Exchange Q&amp;A site proposal: Drones\" /></a></p>\n\n<p>I like most things aviation related, but am very much an <em>ignoramus</em> on the subject. I have flown around a bit though:</p>\n\n<p><a href=\"https://my.flightradar24.com/CalvT\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/wGpda.png\" width=\"250\" /></a></p>\n\n<p>The moon is 384,400kms away, and my aim is to cover that distance! Still got quite a way to go though... <em>43% percent complete</em></p>\n\n<p>Editing to test for Secret Hats!</p>\n\n<p>PS: The edit worked ;)</p>\n\n<p><img src=\"https://i.stack.imgur.com/i7o1v.png\" alt=\"\"></p>\n','1','0','0','1245478');
