INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12975,101,'2017-03-09T11:45:15.957','Dominik Car','2017-03-09T11:45:15.957','null','Zagreb, Croatia','<p>Physics student.<br>\nI am the humblest person I know.<br>\nGiven enough time and preparation, I can be quite spontaneous.<br>\nDrummer preferring Rock, Alternative, Blues.<br>\nCan hear the paint dry.<br>\nOnce it was so cold, when you spoke, the words would freeze mid air and you could read them, true story.<br>\nOnce the fog was so thick in Zagreb, you could nail in a screw and hang your coat on it,true story.<br>\nWaiting for the right moment to change physics from ground-up as it is desperately in need of change.<br>\nProgramming in C and Python.<br>\nMaster Blaster.<br>\nPC Gamer in free time.<br>\nVolleyball and handball master; \"ok\" in basketball due to height.<br>\nh=195cm;<br>\nm=105kg;<br>\nNot a boring person, trust me.</p>\n','0','0','0','7622946');
