INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (12987,128,'2017-03-12T12:24:49.680','Саша Черных','2018-02-20T19:01:02.923','http://kristinita.ru','Там, где Саша','<p>Не являюсь Девушкой, но взял в честь Любимой Девушки своё имя. Никогда не собирался выдавать себя за Неё; странно, почему некоторые так думают, ведь говорю исключительно в мужском роде. А некоторые ещё приставать пытались :) .</p>\n\n<hr>\n\n<p>Спрашиваю, только если не нахожу ответа с помощью поисковиков. Стараюсь искать тщательно. Не судите строго. Пожалуйста, если выставляете мне минусы, комментируйте их.</p>\n','2','9','0','7696365');
