INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13066,101,'2017-03-27T16:21:38.060','Jeff.Clark','2017-03-27T16:21:38.060','null','Redmond, OR, United States','<p>After flailing around in college for a few years trying different things, In 2010 I decided to take a summer internship with a small web development company called <a href=\"https://www.fivetalent.com/\" rel=\"nofollow noreferrer\">FiveTalent</a> in beautiful Bend, Oregon. <a href=\"http://www.visitbend.com/\" rel=\"nofollow noreferrer\">It is amazing here in Bend</a>. Erm, uhh, I mean it sucks here, don\'t move here. :) At the internship I immediately fell in love with coding. Sure, it was just HTML and CSS then, but I knew I had finally found something I enjoyed.</p>\n\n<p>After a few Web Development courses, I decided to make the leap and attend Oregon Institute of Technology for their Software Engineering program. OIT was one of the most difficult experiences of my life (Being an Air Traffic Controller in the Marine Corps was easier), but I also came love more structured programming like C++ as well as databases.</p>\n\n<p>Since then I have been working and playing in the world of C# and Sql Server and enjoying every second. It is truly amazing to have a career path that is enjoyable; My wife likes it also--she doesn\'t have to hear me come home from work and complain :)</p>\n','0','0','0','3868655');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13067,36,'2017-03-27T18:11:22.787','Randy Williamson','2017-03-27T18:39:51.720','null','null','null','0','0','0','10553960');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13068,1,'2017-03-27T22:15:11.953','Richard Brockbank','2017-07-25T14:44:24.217','null','Bishop's Stortford, United Kingdom','<p>Welcome! I\'m studying BSc (Hons) Computing &amp; IT at Open University (UK), due to graduate in 2021.  The university pioneered higher education distance learning back in the 1960s and it\'s become one of the most respected universities in the UK, as well as being the largest by far. The courses are delivered online with some face-to-face tutorials or residential schools to complement the online content.</p>\n\n<p>I\'m looking for work and fun projects in IT – so feel free to tweet me a proposal or suggestion. I have 4 months\' experience in tech support with mainly Windows systems but – don\'t be fooled – this limited experience doesn\'t do justice to my knowledge about computing.</p>\n\n<p>I enjoy music with a particular focus on classical and opera and I can sing and play the piano tolerably well, but not spectacularly by any stretch of the imagination. I read all kinds of fiction and non-fiction, take in interest in visual art and films/movies, play games on my iMac, take photos (mainly landscape), go running for fitness, and I like a good party – house, garden, LAN, or why not all three at once!</p>\n','0','0','0','5334244');
