INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13075,101,'2017-03-29T03:48:35.120','Ace','2017-03-29T03:48:35.120','null','Philippines','<p>I love to start with \"Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod\ntempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam,\nquis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo\nconsequat\" in writing and I love it coz everything start with the it before it getting better . I create a responsive website and use different front-end framework. I also knowledgeable in Network administration and Designing via Adobe and Autodesk.</p>\n\n<p>Every year their are new scripting languages and framework release, so it\'s to hard to follow trends if I didn\'t know the previous languages. So I create my wishlist to track.</p>\n\n<ul>\n<li><strong>Databases</strong> | OracleDB, MongoDB, PostgreSQL, <a href=\"http://couchdb.apache.org/\" rel=\"nofollow noreferrer\">CouchDB</a>,  <a href=\"https://pouchdb.com/\" rel=\"nofollow noreferrer\">PouchDB</a>, <a href=\"https://redis.io/\" rel=\"nofollow noreferrer\">Redis</a> </li>\n<li><strong>Front-End Framework</strong> | Semantic UI, Foundation, Material UI, Pure,Skeleton, UIKit, Milligram, Sussy</li>\n<li><strong>Back-End Framework</strong> | <a href=\"https://github.com/laravel/laravel\" rel=\"nofollow noreferrer\">Laravel</a>, <a href=\"https://github.com/django/django\" rel=\"nofollow noreferrer\">Django</a>, <a href=\"https://github.com/rails/rails\" rel=\"nofollow noreferrer\">Rails</a>, <a href=\"https://github.com/symfony/symfony\" rel=\"nofollow noreferrer\">Symfony</a>, <a href=\"https://github.com/cakephp/cakephp\" rel=\"nofollow noreferrer\">CakePhp</a>, Yii2</li>\n<li><strong>Languages</strong> | Python, Rust, Java, Elixir, Go, Ruby on Rails, C#, Swift, TypeScript</li>\n<li><strong>Front-End</strong> | JQuery, Angular.js, Vue.js, Ember, Aurelia, React, SASS, LESS</li>\n<li><strong>Tools</strong> | Node.js, <a href=\"https://yarnpkg.com/\" rel=\"nofollow noreferrer\">Yarn</a> , DevOps, <a href=\"https://www.ansible.com/\" rel=\"nofollow noreferrer\">Ansible</a> , <a href=\"https://www.docker.com/\" rel=\"nofollow noreferrer\">Docker</a> </li>\n<li><strong>Source Code Editor</strong> | <a href=\"https://atom.io/\" rel=\"nofollow noreferrer\">Atom</a></li>\n<li><strong>Cloud</strong> | <a href=\"https://aws.amazon.com/\" rel=\"nofollow noreferrer\">Amazon Web Services</a>, <a href=\"https://cloud.google.com/\" rel=\"nofollow noreferrer\">Google Cloud</a>, <a href=\"https://azure.microsoft.com/\" rel=\"nofollow noreferrer\">Azure</a> </li>\n<li><strong>Artificial Intelligence</strong> | Google’s Tensor Flow and Microsoft’s Cognitive Toolkit</li>\n<li><strong>Version Controller</strong> | <a href=\"https://git-scm.com/\" rel=\"nofollow noreferrer\">Git</a> </li>\n<li><strong>Virtual Reality (VR) and Augmented Reality (AR)</strong> | Facebook (Oculus Rift), Google (Daydream) and Microsoft (Windows Holographic) </li>\n<li>Join Community | <a href=\"https://github.com/\" rel=\"nofollow noreferrer\">Github</a>, <a href=\"https://about.gitlab.com/\" rel=\"nofollow noreferrer\">GitLab</a>,<a href=\"https://bitbucket.org/\" rel=\"nofollow noreferrer\">Bitbucket</a> <br><br>\nAnd learn more on <strong>API</strong> and follow world programmer and web developer trends.</li>\n</ul>\n\n<p><hr>\n<strong>Game Development Wishlist To Learn</strong></p>\n\n<ol>\n<li>Unreal Engine 4</li>\n<li>Unity</li>\n<li>Marmalade</li>\n<li>Project Anarchy</li>\n<li>Valve Hammer , etc..</li>\n</ol>\n\n<p><hr>\n<strong>Other Wishlist</strong></p>\n\n<ul>\n<li><strong>Learn Autodesk Products</strong> | AutoCad, Maya, SketchBook</li>\n<li><strong>Learn Adobe Product</strong> | Illustrator, After Effects, Premiere Pro, InDesign, Flash, Audition, Prelude</li>\n<li><strong>Learn Corel</strong></li>\n<li><strong>Learn Esko</strong>\n<hr>\n<a href=\"https://www.dropbox.com/sh/ns3fgg0twccxx8l/AAAPrBh4v_8emZ_PwisMjZ8Wa?dl=0\" rel=\"nofollow noreferrer\"><strong>SHARE AND DROP YOUR TUTORIAL HERE</strong></a></li>\n</ul>\n','0','0','0','9854611');
