INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13193,356,'2017-04-14T04:55:10.673','The G of GIS','2017-07-03T15:41:58.967','http://www.linkedin.com/in/nevin-valles-226118121','San Diego, CA, United States','<p>I am currently a GIS Analyst for the County of San Diego\'s Health and Human Services Agency.</p>\n','2','2','0','10614944');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13194,1,'2017-04-14T12:23:56.823','Lance Cohen','2017-04-19T13:42:32.297','null','Hewlett, NY, United States','<p>I am a retired teacher of writing and literature. I taught courses on business writing, technical writing, academic writing, creative writing, journalism, world literature, Shakespeare, and computer programming. I helped my students understand transformational grammar, the Snowflake Method, semiology, the you attitude, <em>Aristotle’s Poetics</em>, the willing suspension of disbelief, Oulipo, principles of Web Design, the Dukal edict, recursion, writing satires and parodies, <em>On Formally Undecidable Propositions of Principia Mathematica and Related Systems</em>, Forward-Looking Statements, the anxiety of influence, and the rest. </p>\n\n<p>At the last class before the final while I was teaching literature and writing at a local community college, one of my students approached me at my desk after the class had ended. She told me her mother had just died. The funeral was the next day. I immediately told her she would get an A on her permanent record for her work in my class (the highest grade the community college permitted me to give). I told her she was the best student I ever had: she came to class early; she submitted every homework assignment in triplicate on time; she participated brilliantly in every class; she did five extra credit projects; she produced six essays with only two grammatical errors; she aced every multiple-guess test; she came to three office visits to review my criticisms with her while taking copious notes on her Apple iPhone 7 Plus (and calling ahead to make the appointments); and she baked delicious chocolate chip cookies for the class—twice. I told her to go home and work on the funeral arrangements. I told her to go home and begin the difficult grieving process for her mother. I shook her hand, and I wished her only the best.</p>\n\n<p>The next day she took the final.</p>\n','2','0','0','4343771');
