INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13319,206,'2017-05-05T15:31:02.487','Jon Letko','2017-06-30T15:19:56.303','http://www.jonletko.com/','Milford, NJ, United States','<p>I graduated from York College of Pennsylvania with a Bachelor of Science Degree in Criminal Justice. As the owner of Global Healthcare Management, I am committed to improving and promoting proactive healthcare and wellness options through non-surgical methods. My experience in the field and committed leadership helped US Healthcare Supply to create cutting-edge business techniques.</p>\n\n<p>My company has been awarded exemplary provider accreditation status by Accreditation Commission for Health Care (ACHC). Obtaining accreditation empowered us to display our continued commitment to excellence in patient care and safety, our products, and customer satisfaction. Over 100,000 customers have trusted Global Healthcare Management to provide them with their diabetic supplies.</p>\n','4','0','0','10801358');
