INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13322,101,'2017-05-06T00:39:36.147','DrHouseofSQL','2018-01-28T12:48:54.697','null','VA','<p>Data warehouse developer at school district, kickball junkie.\nIn my spare time I like keeping up on the information security scene.</p>\n\n<p>\'Those who fear the darkness have never seen what the light can do.\' - Selenia (MTG)</p>\n','1','0','0','3175498');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13324,101,'2017-05-07T02:00:40.087','rosesunhill','2017-05-07T02:00:40.087','null','New York, NY, United States','<p>I\'m a freelance writer, editor, creative director, violinist, and puzzle master. I\'ve worked in publishing for years, nay, decades, and, in the past, was first a systems engineer and then a project manager before making the leap from state to church.</p>\n\n<p>I\'ve been an avid reader since I was a small clone. When my second or third grade teacher told me I was reading too many science books and ordered me to stop, I started reading science <em>fiction</em>.</p>\n\n<p>Although I\'m very much an amateur, I love open freshwater swimming. Last summer, I managed one to two miles almost every fair day. My record is a little over three miles. I\'m not particularly fast, but I\'m steady. On my best days, it feels like meditation, as my thoughts fall away and there is just the swimming.</p>\n','0','0','0','7984743');
