INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13471,101,'2017-06-04T08:01:34.937','Rajind Ruparathna','2017-06-04T08:18:30.133','https://notebookbft.wordpress.com/','Colombo, Western Province, Sri Lanka','<p>I\'m working as a Senior Software Engineer at <a href=\"https://www.adroitlogic.com/\" rel=\"nofollow noreferrer\">AdroitLogic</a> and along with work, I\'m studying for Master\'s degree in Cloud Computing at the Department of Computer Science &amp; Engineering, University of Moratuwa, Sri-Lanka.</p>\n\n<p>My interests include Cloud Computing and Big Data. I love capturing scenes, solving algorithmic problems and playing badminton in my free time.</p>\n\n<ul>\n<li>Stack Overflow Developer Story - <a href=\"https://stackoverflow.com/cv/rajind\">https://stackoverflow.com/cv/rajind</a></li>\n<li>Blog - <a href=\"https://notebookbft.wordpress.com/\" rel=\"nofollow noreferrer\">https://notebookbft.wordpress.com/</a> </li>\n<li>LinkedIn - <a href=\"http://lk.linkedin.com/in/rajind\" rel=\"nofollow noreferrer\">http://lk.linkedin.com/in/rajind</a></li>\n<li>Github – <a href=\"https://github.com/Rajind\" rel=\"nofollow noreferrer\">https://github.com/Rajind</a></li>\n</ul>\n','0','3','0','2076045');
