INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13553,101,'2017-06-20T07:59:49.687','Gypsy Spellweaver','2017-06-30T01:13:23.883','https://nationalzoo.si.edu/animals/news/6807','Kentucky, United States','<p><a href=\"http://www.fsf.org/fb\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/88V4R.png\" alt=\"Not f&#39;d - you won&#39;t find me on Facebook\" title=\"Not f&#39;d — you won&#39;t find me on Facebook\"></a><br>\n<sup><em>See code blocks below</em></sup></p>\n\n<p>Ancient computer nerd who likes digging and learning. Cut my teeth on UNIVAC-timeshare and was \'hooked\' for life. Useful results, if any, are secondary to the fun.</p>\n\n<p>First home computer: 1984 home-built IBM-PC/XT 8086, 640KB RAM, MS-DOS 1.25, Dual 5-¼ Floppy, 20MB HDD, Hercules Graphics.</p>\n\n<p>First programming contract: 1986, Borland Turbo Pascal, Cotton gin product tracking (seed to graded bale)</p>\n\n<p>Current main OS: Leap 42.3</p>\n\n<p>Favorite Languages: Pascal, HTML/CSS/JS, Fortran, Perl, Shell script(Bash mostly), PHP</p>\n\n<p>Favorite Hobbies: Learning, Computers, Reading</p>\n\n<p>Fan of <a href=\"https://twitter.com/@RustyThePanda\" rel=\"nofollow noreferrer\">Rusty</a></p>\n\n<hr>\n\n<p><sub>I have recolored the image for my profile. To use this, in the original colors, in your <strong>Stack Exchange</strong> profile, copy this code:</sub></p>\n\n<pre><code>[![Not f\'d - you won\'t find me on Facebook][notfb]][fsf-fb]\n\n  [notfb]: https://static.fsf.org/nosvn/no-facebook-me.png \"Not f\'d — you won\'t find me on Facebook\"\n  [fsf-fb]: http://www.fsf.org/fb\n</code></pre>\n\n<hr>\n\n<p><sub>To use it in a more general fashion, use this code where you have full HTML code access:</sub></p>\n\n<pre><code>&lt;a href=\"http://www.fsf.org/fb\"&gt;&lt;img src=\"http://static.fsf.org/nosvn/no-facebook-me.png\" alt=\"Not f\'d — you won\'t find me on Facebook\" /&gt;&lt;/a&gt;\n</code></pre>\n','0','0','0','9933161');
