INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13564,118,'2017-06-21T22:38:52.040','English Student','2017-08-17T06:39:13.827','null','India','<p>Deeply interested in English &amp; world literature, music, sports, politics, cooking, and fascinated by interpersonal skills. </p>\n\n<p>Dear friends! I was born in India and have always lived here. I was educated in English from earliest childhood at good schools, but I have never been an English grammar-cruncher, preferring to learn the language by feel, usage and a GREAT DEAL OF READING, so that I developed an instinctive tuning for good syntax and grammar without ever having learnt the \'rules and regulations\' of \'correct\' language. In fact they don\'t teach them here, but only teach usage, and students are evaluated by setting them practical tasks in grammar and composition! If my comments or answers are not sufficiently scholarly, please keep that point in mind, and also remember (that) English is a VERY ELASTIC LANGUAGE! </p>\n\n<p>I am also a qualified sociologist, amateur home audio enthusiast and coffee fanatic.</p>\n','1','1','0','10695589');
