INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13584,1,'2017-06-25T14:11:39.687','Rita Granger','2017-06-25T23:23:17.697','','null','<p>I have a blast trying new activities. I read about sports, research nutrition, take introductory lessons and do complimentary exercises before I make any opinions. Swimming is the hardest most technical sport I have ever attempted. It took a year just to get my timing, breathing,two-beat kick and streamlining correct. Right now I just train sprint triathlon specifics.\nMountain biking is exhilarating. I\'d compete If I could convince my road cycling buddies to accompany me. I find it funny but I fear Mtb more than MX.\nHiking, camping, boating, and kayaking are nice. If I lived closer to sites I would participate more frequently. I\'ll try any sport that doesn\'t involve high impact or intense training.\nMy hobbies are Kiln Pottery and sewing.</p>\n','1','0','0','11192097');
