INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13629,121,'2017-07-06T11:36:47.940','user1997744','2017-07-16T07:10:28.323','null','null','<p>I\'m a university student of theoretical physics and mathematics, whilst my own studies focus on gravitational physics (e.g. string theory), differential geometry, and gauge field theories.</p>\n\n<hr>\n\n<p>Recommended Resources:</p>\n\n<ul>\n<li>Quantum Field Theory: <a href=\"http://www.damtp.cam.ac.uk/user/tong/qft.html\" rel=\"nofollow\">http://www.damtp.cam.ac.uk/user/tong/qft.html</a>; <em>Introduction to Quantum Field Theory</em> by Peskin and Schroeder</li>\n<li>String Theory: <a href=\"http://www.damtp.cam.ac.uk/user/tong/string.html\" rel=\"nofollow\">http://www.damtp.cam.ac.uk/user/tong/string.html</a>; <em>String Theory and M-Theory</em> by Becker, Becker and Schwarz; <em>Superstring Theory</em> by Witten; <em>String Theory</em>, course by Prof. Freddy Chachazo, available at: <a href=\"http://perimeterscholars.org/\" rel=\"nofollow\">http://perimeterscholars.org/</a></li>\n<li>Solitons, Topology: <em>Classical Solutions in Quantum Field Theory</em> by Weinberg; <a href=\"http://www.damtp.cam.ac.uk/user/tong/tasi.html\" rel=\"nofollow\">http://www.damtp.cam.ac.uk/user/tong/tasi.html</a></li>\n<li>Advanced General Relativity: <em>Gravitational Physics</em>, course by Prof. Ruth Gregory, video lectures available at: <a href=\"http://perimeterscholars.org/\" rel=\"nofollow\">http://perimeterscholars.org/</a></li>\n<li>Advanced Differential Geometry: <em>A Brief Introduction to Characteristic Classes from the Differential Viewpoint</em> (Free Notes) by Yang Zhang, Cornell University</li>\n<li><em>Calabi-Yau Manifolds: A Bestiary for Physicists</em> by T. Hubsch; an introduction to Calabi-Yau manifolds meant to be accessible to physicists, but requires a substantial background in some algebraic and differential geometry.</li>\n<li>Mannheim\'s <em>Brane-Localized Gravity</em>; discusses branes and fields in the context of general relativity, explicit computations are present throughout, in great detail.</li>\n<li>All volumes of <em>A Comprehensive Introduction to Differential Geometry</em> by Spivak; thorough, excellently written and with great insights.</li>\n</ul>\n\n<p>Profile image: an artist\'s depiction of a two-dimensional slice of a Calabi-Yau manifold, which by definition has vanishing first Chern class or equivalently trivial canonical bundle.</p>\n\n<hr>\n\n<p><em>Nullius in verba</em></p>\n','1','0','0','2270076');
