INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13688,101,'2017-07-17T23:37:53.070','cat','2017-11-11T18:38:36.670','null','','<p><strong>Here\'s a shout-out to the <a href=\"http://stackexchange.com/users/current\">hero of Stack Exchange!</a> You\'re the best!</strong></p>\n\n<p>I like Go, as a statically typed C-style-OOP systems programming language, but it doesn\'t have generics, and doesn\'t encourage functional practices. D encourages functional programming, proper OOP and fixes the problems of C and Go while being a better C++, and more productive / less dumb than Java.</p>\n\n<p>While I love Python, it feels too mundane; for everyday tasks I prefer <a href=\"http://racket-lang.org\" rel=\"nofollow noreferrer\">Racket</a> and <a href=\"http://factor-lang.org\" rel=\"nofollow noreferrer\">Factor</a>.</p>\n\n<pre><code>/*  \n    this bit of chicanery is to prevent me from \n    accidentally dereferencing null pointers\n    you might think it\'s ugly but would you\n    rather have segfault or slightly ugly code?\n*/\n</code></pre>\n\n<p>\n\n<pre><code>// Just trying to create an array of integers for reference \n// because I keep forgetting how integers look like.\n</code></pre>\n\n<p>(<a href=\"http://codegolf.stackexchange.com/a/24503/46231\">from here</a>.)</p>\n\n\n\n<p>\n','0','0','0','5739991');
