INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13785,651,'2017-08-02T06:45:35.237','Logan Baxter','2018-03-10T14:13:36.590','https://fororthodoxy.wordpress.com/','United States','<p>I am a Junior undergraduate student studying religion at The University of Texas at Austin.</p>\n\n<ul>\n<li><p>Reformed Christian who is interested in: Early Church history, Hermeneutics, Church Doctrine, and Apologetics. </p></li>\n<li><p>Strong believer in the infallibility of God\'s Word.</p></li>\n<li>Hoping to one day serve my Lord and Savior as an author, and\nminister.</li>\n</ul>\n','19','40','5','9523966');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13786,101,'2017-08-02T13:29:47.450','SimonS','2017-08-02T13:29:47.450','null','Zurich, Switzerland','<p>Intrested in Windows Security, IIS, Active Directory and MS Azure Services (Office 365, Sharepoint)</p>\n\n<p>Also trying to make my life easier with PowerShell Scripting.</p>\n\n<p>Starting to learn Python &amp; C# - just for fun.</p>\n','0','0','0','6458485');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13787,1,'2017-08-02T14:04:43.280','Rajib Bahar','2017-08-02T14:04:43.280','http://www.rajib-bahar.com','null','<p>Over the course of his 16+year career, Rajib Bahar has been a creative problem solver, finding innovative solutions to clients’ data questions, issues and challenges. He works primarily in Business Intelligence, and Data analytics practice with experience in BigData, DataScience, &amp; Cloud computing environments. His career initially started in the unix world submitting perl and fortran jobs to super-computers back in 2000. This was before Big Data and distributed computing got Big. Later on, he moved on to .NET application development roles, and worked with variety of Database systems such as MS Sql Server, MySQL, PostgresSQL, DB2, &amp; Oracle. Around 2008, he started working in Business Intelligence and/or Datawarehousing practice utilizing both Ralph Kimball and Inmon methodologies. Currently, he is working in Big Data platforms and connecting it with SQL Server 2016, R, Python, and building POCs on Data Science for BI projects. He also enjoys working with visualization tools such as Power BI, Tablue, and QlikView. His recent venture in the Data world includes a podcast on BigData, Data Science, DBMS, analytics, and cloud computing. The podcast is also syndicated across iTunes and YouTube. The link to podcast is <a href=\"http://www.soundcloud.com/data-podcast\" rel=\"nofollow noreferrer\">http://www.soundcloud.com/data-podcast</a>.</p>\n\n<p>He has also served as a Board of Members of directors at KFAI radio, PASSMN, and various other non-profits. His expertise in data have led to savings at KFAI radio on expensive software license costs, reduced paper expense via online voting. Currently, he spends time contributing to the Data Visualization challenge the station faces. </p>\n\n<p>Feel free to connect with Rajib @rajib2k5 or linkedin.com/in/rajibb</p>\n','0','0','0','11468107');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13788,1,'2017-08-02T16:02:28.120','A. Trivedi','2017-08-02T16:02:28.120','null','null','null','0','0','0','11469396');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13789,113,'2017-08-02T19:27:10.590','Jonathan Anctil','2017-12-14T23:59:02.460','https://kreezee.com/','Quebec, Canada','<p>What can I say about me?</p>\n\n<p>I\'m a web software developer and I work in this domain for a long time. I\'m part of a startup who created Kreezee Sports (<a href=\"https://kreezee.com\" rel=\"nofollow\">https://kreezee.com</a>). I like to code. I love learning.</p>\n\n<p>I\'m also a musician (guitar, bass) and a graphist. It is not common to see someone who can write code or create a database and be a pro with Photoshop ;).</p>\n','0','1','0','2741663');
