INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13810,161,'2017-08-07T03:20:48.147','Dean Attali','2017-12-20T05:38:16.217','http://AttaliTech.com','Toronto, ON, Canada','<p>R-Shiny consultant with a MSc in Bioinformatics and a Bachelor of Computer Science. Work experience as a software engineer and web developer. Life experience as a restless traveller with too many homes. Founder of AttaliTech Ltd.</p>\n\n<p>Author of the R packages <a href=\"https://github.com/daattali/shinyjs\" rel=\"nofollow noreferrer\">shinyjs</a>, <a href=\"https://github.com/daattali/timevis\" rel=\"nofollow noreferrer\">timevis</a>, <a href=\"https://github.com/daattali/ggExtra\" rel=\"nofollow noreferrer\">ggExtra</a>, <a href=\"https://github.com/daattali/ezknitr\" rel=\"nofollow noreferrer\">ezknitr</a>, and more. Creator of <a href=\"https://www.datacamp.com/courses/building-web-applications-in-r-with-shiny-case-studies\" rel=\"nofollow noreferrer\">\"Use Cases in Shiny\"</a> course - an interactive, online video course. See my <a href=\"http://deanattali.com/projects\" rel=\"nofollow noreferrer\">projects page</a> for more info or my <a href=\"https://daattali.com/shiny\" rel=\"nofollow noreferrer\">shiny server</a> for some of my R-Shiny apps.</p>\n','5','0','0','4892438');
