INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13858,134,'2017-08-16T15:07:47.210','Ivan Gerasimenko','2017-12-12T08:27:36.403','null','Moscow, Russia','<p>Test automation engineer working in Moscow government organization. Currently extended automation testing in five different environments: </p>\n\n<ul>\n<li>HP UFT 14.00 (end-to-end tests integrated with HP ALM and tests are started from uDeploy)</li>\n<li>Java-tests integrated with uDeploy and Zabbix (jemmy2+TestNG, to perform realtime monitoring of application performance parameters on 12 production servers; smoke tests/build verification tests) </li>\n<li>Sikuli tests integrated with Zabbix (realtime monitoring of application availability through Citrix &amp; security bridge) </li>\n<li>SoapUI (web-service testing)</li>\n<li>Web-application testing (Java + WebDriver + TestNG + Maven)</li>\n</ul>\n\n<p>Having backgrounds in front-end (JavaScript, jQuery) &amp; back-end (C#) web-development, database skills with MS SQL. Technologies I am familiar with: JavaScript (jQuery), HTML, CSS, LESS, SASS, Bootstrap, Visual Studio C#, T-SQL, TFS (also Git, SVN).</p>\n','1','2','0','3191086');
