INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13915,101,'2017-08-27T01:32:19.563','angussidney','2018-03-03T06:15:20.380','null','Australia','\n\n<p>Hobbyist developer, gamer, and RPG player. Currently learning Node.js and Rails.</p>\n\n<p><a href=\"https://stackexchange.com/users/5869449\">\n<img src=\"https://stackexchange.com/users/flair/5869449.png?theme=clean\" width=\"208\" height=\"58\" alt=\"profile for Angus Atkinson on Stack Exchange, a network of free, community-driven Q&amp;A sites\" title=\"profile for Angus Atkinson on Stack Exchange, a network of free, community-driven Q&amp;A sites\">\n</a></p>\n\n<p>You can contact me by emailing the following address (where you replace <code>potato</code> with my username):</p>\n\n<blockquote>\n  <p>potato17 (at) gmail (dot) com</p>\n</blockquote>\n\n<p>Profile pictures by <a href=\"http://lorcblog.blogspot.com/\" rel=\"nofollow noreferrer\">Lorc</a> and <a href=\"http://delapouite.com/\" rel=\"nofollow noreferrer\">Delapouite</a>. Available on <a href=\"http://game-icons.net/\" rel=\"nofollow noreferrer\">game-icons.net</a>.</p>\n','0','0','0','5869449');
