INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13917,101,'2017-08-27T14:28:51.020','Arjun Chaudhary','2017-10-21T15:08:45.810','https://arjun-chaudhary.shinyapps.io/Data_Analytics/','Melbourne, Victoria, Australia','<p>Polyglot developer and data scientist focused on algorithm instead of programming language. Have a strong interest in Cloud Computing and Internet of Things (specially smart cities). Love to explore new technology and tools.</p>\n\n<p>Previously ran my own outsourcing company with successful deployment of numerous Website and Android application. </p>\n\n<p>I\'ve worked with many startup since 2012 and have worked as Software Developer, Android Developer, Data Scientist, Business Analyst,Graphic Designer, Front End and Back End Developer.</p>\n\n<p>I\'m very interested in upcoming technologies and how they change both the way we personally interface with the world, and how organizations operate in an agile space with CI/CD, cloud tech, etc.</p>\n\n<p>I am also interested in research in cloud computing and IoT and been working on research topic like \"Finding mobile  k nearest neighbor query (Still in progress)\",\"Medication management system based on Internet of Things (Still in progress)\" etc.</p>\n','0','0','0','4159877');
