INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13935,101,'2017-08-31T04:20:18.200','B. Clay Shannon','2017-09-03T14:36:12.797','https://www.facebook.com/AdventuresOfMarkTwain/','Monterey, CA, USA','<p>I am in the process of writing a series of creative/alternative histories of the 50 States that make up the Ewe-Knighted States.</p>\n\n<p>I have completed the \"overarching\" one for the country as a whole, as well as the first 15 of the individual States. The following are all available on amazon, as will be the complete set, when finished later this year (2018):</p>\n\n<p><a href=\"https://i.stack.imgur.com/jnpMr.jpg\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/jnpMr.jpg\" alt=\"enter image description here\"></a></p>\n\n<p>@@@@@@@@@@@@@@@@@@@@@@@</p>\n\n<p>I have lived in eight states; besides my native California (where I was born and where I now again reside) in chronological order I have infested: New York, Montana, Alaska, Oklahoma, Wisconsin, Idaho, and Missouri.</p>\n\n<p>I am a writer of both fiction (for which I use the nom de guerre \"Blackbird Crow Raven\", as a nod to my Native American heritage - I am \"½ Cowboy, ½ Indian\") and nonfiction, including a two-volume social and cultural history of the U.S. which covers important events from 1620-2006 and can be downloaded gratis <a href=\"http://www.lulu.com/spotlight/blackbirdcraven\" rel=\"nofollow noreferrer\">here</a>.</p>\n','1','0','0','469009');
