INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (13957,101,'2017-09-04T21:45:49.810','Michael Kjörling','2017-09-04T21:45:49.810','https://michael.kjorling.se/','null','<p><strong><em>That\'s funny; it\'s never done that before.</em></strong> Said likely no theoretical <a href=\"https://xkcd.com/435/\" rel=\"nofollow noreferrer\">mathematician</a> ever.</p>\n\n<hr>\n\n<p>I am a software developer by trade. Most of my professional work is with C#.NET and SQL, with dabbles into Typescript and Java. I also toy with C and poke around with Linux shell scripting.</p>\n\n<p>On Stack Exchange, I\'m a moderator on <a href=\"https://worldbuilding.stackexchange.com/\">Worldbuilding</a> (which hosts the officially <a href=\"https://stackoverflow.blog/2015/09/15/were-changing-our-name-back-to-stack-overflow/\">awesome people</a> of the network) and <a href=\"https://writing.stackexchange.com/\">Writing</a>.</p>\n\n<p><strong>None of what I post anywhere on the Stack Exchange network is to be taken as legal advice in any way, shape or form.</strong> Should you require legal advice, then contact a legal practitioner in your geographical area which specializes in the relevant field. I will sometimes point this out specifically, but lack of such a disclaimer does not cause a post to constitute legal advice.</p>\n\n<p>What I write is not necessarily, but may still be, representative of anyone, including but not limited to my past, present or future self, or any employers of my past, present and future self, in any number of relevant or irrelevant timelines. I reserve the right to change my mind at any time in the presence or non-presence of objectively or subjectively verifiable or unverifiable fact, fiction or opinion. I also reserve the right to maintain my opinion in any subject matter under said circumstances.</p>\n','0','0','0','225818');
