INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14018,101,'2017-09-16T14:58:32.273','rewolf','2017-09-16T14:58:32.273','http://andrew-flower.com','Tokyo, Japan','<p>South African\nLiving in Tokyo\nSoftware Engineer too... But that\'s not why I\'m alive.</p>\n\n<p>Love Jesus. Love people. Learning what Love really is - not being for my own personal gain ever ; never offendable and never hurt - a means of laying one\'s life down for others, that they may come to know their value as God\'s child, worth the death of Jesus, and the peace and hope and joy that is found only through relationship with God by the Holy Spirit through the blood of the Christ!</p>\n\n<p>Bless you!</p>\n','0','0','0','138670');
