INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14025,123,'2017-09-18T00:02:03.620','Micah Epps','2018-01-08T18:41:20.007','null','Charlotte, NC','<h2>Software developer</h2>\n\n<h3>QUALIFICATIONS</h3>\n\n<ul>\n<li>10 years experience in corporate software development </li>\n<li>Manage multiple projects simultaneously</li>\n<li>Learn and apply new technologies quickly</li>\n<li>Command of numerous programming languages including C# and VB.Net</li>\n<li>Excellent organizational and presentation skills</li>\n<li>Work well under pressure</li>\n</ul>\n\n<h3>SOFTWARE DEVELOPMENT SKILLS</h3>\n\n<ul>\n<li><b>Languages:</b> C#, VB.net, .Net Framework 2/ 3.5/ 4</li>\n<li><b>Web:</b> ASP.Net, WebForms, WebServices, AJAX, JQuery, Infragistics</li>\n<li><b>Desktop:</b> WinForms, Windows services, .Net remoting, Threading, IO</li>\n<li><b>Data:</b> SQL Server 2005/ 2008, Oracle 10, XML</li>\n<li><b>Tools:</b> VS 2005/ 2008/ 2010, SSMS 2008, IIS6 /7, TFS, SVN, VSS, CVS</li>\n<li><b>Methodologies:</b> Agile, Waterfall</li>\n</ul>\n','2','0','0','2418606');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14027,101,'2017-09-18T08:35:59.597','Rodia','2017-09-18T10:18:41.927','null','null','<p><strong>Mandatory John Carmack quotes:</strong></p>\n\n<p>“In the big information age, the barriers just aren\'t there. The barriers are self imposed. If you want to set off and go develop some grand new thing, you don\'t need millions of dollars of capitalization. You need enough pizza and Diet Coke to stick in your refrigerator, a cheap PC to work on, and the dedication to go through with it.”</p>\n\n<p>“There\'s something fundamentally interesting about that, about the world in a box. If somebody can be an emperor in a virtual world, with only a cheap computer, is that really a fundamentally bad thing?”</p>\n\n<p><br>\n<a href=\"https://stackoverflow.com/users/3341331/rodia\">\n<img src=\"https://stackoverflow.com/users/flair/3341331.png?theme=default\" width=\"208\" height=\"58\" alt=\"profile for Rodia at Stack Overflow, Q&amp;A for professional and enthusiast programmers\" title=\"profile for Rodia at Stack Overflow, Q&amp;A for professional and enthusiast programmers\">\n</a></p>\n\n<p><sup>- Fighting for the users since 1973.</sup></p>\n\n<h1>☺</h1>\n','0','3','0','4066658');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14028,101,'2017-09-18T10:58:14.450','Ajay Brahmakshatriya','2018-01-22T04:23:11.547','http://ajaybrahmakshatriya.github.io','Bangalore, Karnataka, India','<p>I am a Computer Science student who has finished his Bachelors.\nI work in the field of Programming languages. \nI love to engage in discussions related to design of languages and implementations of compilers.\nC is my favorite language, although I understand the purpose of other languages. \nI love to read and write assembly and study about computer architectures in general.</p>\n\n<p><code>main(O){putchar(17683LL*115163&lt;&lt;010&gt;&gt;O*010)&amp;&amp;main(++O);}</code></p>\n','0','0','0','3408190');
