INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14179,1,'2017-10-21T13:04:49.700','Thomas Wouters','2017-10-21T13:04:49.700','null','null','<h1>----------------------------------------</h1>\n\n<p>Question 24\nLevel 1</p>\n\n<p>Question:\n    Python has many built-in functions, and if you do not know how to use it, you can read document online or find some books. But Python has a built-in document function for every built-in functions.\n    Please write a program to print some Python built-in functions documents, such as abs(), int(), raw_input()\n    And add document for your own function</p>\n\n<p>Hints:\n    The built-in document method is <strong>doc</strong></p>\n\n<p>Solution:\nprint abs.<strong>doc</strong>\nprint int.<strong>doc</strong>\nprint raw_input.<strong>doc</strong></p>\n\n<p>def square(num):\n    \'\'\'Return the square value of the input number.</p>\n\n<pre><code>The input number must be integer.\n\'\'\'\nreturn num ** 2\n</code></pre>\n\n<p>print square(2)\nprint square.<strong>doc</strong></p>\n\n<h1>----------------------------------------</h1>\n\n<h1>----------------------------------------</h1>\n\n<p>Question 25\nLevel 1</p>\n\n<p>Question:\n    Define a class, which have a class parameter and have a same instance parameter.</p>\n\n<p>Hints:\n    Define a instance parameter, need add it in <strong>init</strong> method\n    You can init a object with construct parameter or set the value later</p>\n\n<p>Solution:\nclass Person:\n    # Define the class parameter \"name\"\n    name = \"Person\"</p>\n\n<pre><code>def __init__(self, name = None):\n    # self.name is the instance parameter\n    self.name = name\n</code></pre>\n\n<p>jeffrey = Person(\"Jeffrey\")\nprint \"%s name is %s\" % (Person.name, jeffrey.name)</p>\n\n<p>nico = Person()\nnico.name = \"Nico\"\nprint \"%s name is %s\" % (Person.name, nico.name)</p>\n\n<h1>----------------------------------------</h1>\n\n<h1>----------------------------------------</h1>\n\n<p>Question:\nDefine a function which can compute the sum of two numbers.</p>\n\n<p>Hints:\nDefine a function with two numbers as arguments. You can compute the sum in the function and return the value.</p>\n\n<p>Solution\ndef SumFunction(number1, number2):\n    return number1+number2</p>\n\n<p>print SumFunction(1,2)</p>\n\n<h1>----------------------------------------</h1>\n','0','0','0','10299104');
