INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14333,138,'2017-11-23T04:18:04.180','bytebuster','2018-01-24T15:37:16.807','null','Bangkok, Thailand','<p>I take my chance to place this in my profile:<br>\nSince February 2014, <strong>Ukraine is suffering from Russia\'s armed invasion</strong> and partial occupation. If we fail to stop the Russian tanks in Ukraine, someone would have to stop them in Poland, Baltic states, and finally, in your place.<br>\nWhile there is no doubt that your country\'s army can stop the Russians, think if you want to see <strong>a burning Russian tank on the lawn in front of your home</strong>. Would you wait till that moment or act now (by calling your Senator, for example)?<br>\nThe world has to stay together to stop Russian invasion in Europe as well as the Russian-equipped, Russian-trained, Russian-financed, and Russian-inspired terrorism all over the world.</p>\n\n<p><img src=\"https://i.stack.imgur.com/RCrso.png\" alt=\"Stop russian terrorism\"></p>\n','0','1','0','947951');
