INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14567,101,'2017-12-20T20:33:20.457','Jake Symons','2018-03-10T22:32:11.527','null','England, United Kingdom','<blockquote>\n  <p><strong>I have a Sport Relief giving page <a href=\"https://my.sportrelief.com/sponsor/jakesymons7125064?utm_source=FROST&amp;utm_medium=email&amp;utm_campaign=gp_confirmation_individual\" rel=\"nofollow noreferrer\">here</a> would love if anyone could donate. Its for a good causes, and we are the top fundraising school in the UK. Sport Relief helps so many people in all sorts of situations, more information about that can be found <a href=\"https://www.sportrelief.com/where-your-money-goes\" rel=\"nofollow noreferrer\">here</a>. Thanks for your generosity.</strong></p>\n</blockquote>\n\n<p>Hi Everyone</p>\n\n<p>If you need to contact me then please find me at <a href=\"https://chat.stackexchange.com/rooms/73596/jakes-office\">my office</a> where you are welcome to leave a message.</p>\n\n<p>I am a casual programmer currently studying computer science in Year 11 for GSCE. I prefer to code in python and have knowledge in Java, Ruby and Html&amp;CSS. I do have an account on <a href=\"https://www.codecademy.com/JakeSymons\" rel=\"nofollow noreferrer\">Codecadermy</a> where I am hope to complete many more course at some point</p>\n\n<p>I am a Raspberry Pi enthusiast although I am currently setting it up and haven\'t made much progress with it, when I have more time in the new year I may be undertaking some projects there as well.</p>\n','0','0','0','12007967');
