INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14648,1,'2018-01-12T18:42:18.360','fanbyprinciple','2018-01-12T18:42:18.360','null','New Delhi, Delhi, India','<p>I like making websites even though I have never made one from scratch.<br>\nI like machine learning even though I don\'t know the first thing about sigmoids.<br>\nI like Big data but am not clear whether how big Big in Big data actually is.<br>\nI like programming but hate solving problems or debugging (a cardinal sin I understand).<br>\nI like being successful but hate working hard for it.<br>\nI like to say I have an organised desk but my life is disarray. (first part is a lie).<br>\nI would like to make it into separate paragraphs but I don\'t know any markdown syntax. [I tried html and it works surprisingly.]</p>\n','0','0','0','11094326');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14649,1,'2018-01-12T18:45:55.843','Bert Seale','2018-01-12T18:45:55.843','https://bert-seale.blogspot.com/','Orlando, FL, United States','<p>Bert spends his time traveling and building new relationships worldwide. He has over 15 years experience in consulting, IT, startups, software developing, extremely creative in new product ideas, inventor, author of golf books, inventor app and web platforms.</p>\n\n<p>He is currently the founder of two startups Inkozi “lawyer app non-referral gateway and Egolfviewer a new way to book tee times and view golf courses.</p>\n','0','0','0','12673926');
