INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14651,101,'2018-01-13T01:20:17.447','ArifMustafa','2018-01-13T01:20:17.447','http://www.whodesire.com','India','<p>Working on computers applications with more than a decade, but these days I am trying to learn <a href=\"https://www.javascript.com/\" rel=\"nofollow noreferrer\"><kbd><strong><code>JavaScript</code></strong></kbd></a> <em>seriously</em> and other related frameworks like <a href=\"https://angularjs.org/\" rel=\"nofollow noreferrer\"><kbd><strong><code>AngularJS</code></strong></kbd></a> for better grip on <em>Web Applications</em>.</p>\n','0','0','0','4835491');
