INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14653,101,'2018-01-13T19:11:12.553','GeekWithGlasses','2018-01-22T06:55:30.357','http://shreyash.tech','Bhopal, India','<ul>\n<li><p>Hardcore Gamer.</p></li>\n<li><p>Works with JAVA, Android, MEAN Stack, PHP, MySQL, Phantom.js</p></li>\n<li><p>Android Developer &amp; Enthusiast.</p></li>\n<li><p>Electronic and DIY-Circuit Geek.</p></li>\n<li><p>Technophile.</p></li>\n<li><p>Neophile.</p></li>\n<li><p>Gearhead, Especially for bikes.</p></li>\n<li><p>Loves Music</p></li>\n</ul>\n\n<blockquote>\n  <p>Have a great mind which can convert anything raw to something\n  productive.</p>\n</blockquote>\n\n<p>Part time Mechanic, Electrician, Biker and Computer Repair guy </p>\n\n<p>Mmm wait... Did I forgot something? Oh yes. <code>I\'am Batman</code></p>\n\n<p>For contact and anything else visit : <a href=\"http://shreyash.tech/\" rel=\"nofollow noreferrer\">http://shreyash.tech/</a></p>\n','0','0','0','7028148');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14655,101,'2018-01-14T03:55:57.773','paper1111','2018-01-27T08:58:51.553','null','Hong Kong','<p>I love <a href=\"https://ceylon-lang.org/\" rel=\"nofollow noreferrer\">Ceylon</a> very much! You can also try it out!</p>\n\n<p>I am active in these tags:</p>\n\n<p><a href=\"/questions/tagged/swift\" class=\"post-tag\" title=\"show questions tagged &#39;swift&#39;\" rel=\"tag\">swift</a><a href=\"/questions/tagged/ceylon\" class=\"post-tag\" title=\"show questions tagged &#39;ceylon&#39;\" rel=\"tag\">ceylon</a><a href=\"/questions/tagged/java\" class=\"post-tag\" title=\"show questions tagged &#39;java&#39;\" rel=\"tag\">java</a><a href=\"/questions/tagged/html\" class=\"post-tag\" title=\"show questions tagged &#39;html&#39;\" rel=\"tag\">html</a><a href=\"/questions/tagged/bash\" class=\"post-tag\" title=\"show questions tagged &#39;bash&#39;\" rel=\"tag\">bash</a></p>\n\n<p>I participate in <a href=\"https://chat.stackoverflow.com/rooms/111347/sobotics\">SOBotics</a>.</p>\n\n<p><a href=\"https://i.stack.imgur.com/d0IZm.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/d0IZm.png\" alt=\"My profile\"></a></p>\n\n<p>Remeber 吃得苦中苦 方為人上人!</p>\n\n<p><sub>(No pain no gain)</sub></p>\n','0','0','0','9926590');
INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14656,101,'2018-01-14T06:20:58.570','Eliah Kagan','2018-01-14T06:20:58.570','https://launchpad.net/~degeneracypressure','Syracuse, NY','<h3>Contact Info</h3>\n\n<ul>\n<li><p><em><a href=\"http://askubuntu.com/\">Here</a> on <a href=\"http://en.wikipedia.org/wiki/Ask_Ubuntu\" rel=\"nofollow\">Ask Ubuntu</a> / <a href=\"http://en.wikipedia.org/wiki/Stack_Exchange_Network\" rel=\"nofollow\">Stack Exchange</a>:</em> If you have <a href=\"http://askubuntu.com/faq#reputation\">enough rep</a> to talk in <a href=\"http://chat.stackexchange.com/\">chat</a> (<a href=\"http://chat.stackexchange.com/faq#talk\">20 network-wide</a>), you can <a href=\"http://chat.stackexchange.com/faq#notifications\">ping</a> me in <a href=\"http://chat.stackexchange.com/rooms/201/ask-ubuntu-general-room\">main chat</a>, even if I\'m not there. <em>If I\'ve been in the room in the last 3 days</em>, I\'ll be notified (but I may not see or reply immediately). To do this, include <strong>@EliahKagan</strong> in your message. You may also invite me to another chat room.</p></li>\n<li><p><em><a href=\"http://en.wikipedia.org/wiki/Email\" rel=\"nofollow\">Email</a>:</em> <strong>degeneracypressure@gmail.com</strong></p></li>\n<li><p><em><a href=\"https://launchpad.net/\" rel=\"nofollow\">Launchpad</a> [<a href=\"https://launchpad.net/~degeneracypressure\" rel=\"nofollow\">profile</a>]:</em> <a href=\"https://launchpad.net/~degeneracypressure/+contactuser\" rel=\"nofollow\"><strong>degeneracypressure / Eliah Kagan</strong></a><br>\n(This will probably yield better results than email if I haven\'t heard from your address before.)</p></li>\n</ul>\n\n<p>If you message me on any of the following, and I don\'t reply, <em>please don\'t</em> assume I received it.</p>\n\n<ul>\n<li><p><em><a href=\"http://en.wikipedia.org/wiki/Google_Talk\" rel=\"nofollow\">Google Talk</a> (<a href=\"http://en.wikipedia.org/wiki/Extensible_Messaging_and_Presence_Protocol\" rel=\"nofollow\">XMPP</a>):</em> <strong>degeneracypressure@gmail.com</strong></p></li>\n<li><p><em><a href=\"http://en.wikipedia.org/wiki/AOL_Instant_Messenger\" rel=\"nofollow\">AIM</a>:</em> <strong>Code Executioner</strong></p></li>\n<li><p><em><a href=\"http://en.wikipedia.org/wiki/MSN_Messenger\" rel=\"nofollow\">MSN Messenger / Windows Live Messenger</a>:</em> <strong>degeneracypressure@gmail.com</strong></p></li>\n<li><p><em><a href=\"http://en.wikipedia.org/wiki/Yahoo_messenger\" rel=\"nofollow\">Yahoo! Messenger</a>:</em> <strong>drfrobe</strong></p></li>\n<li><p><em><a href=\"http://en.wikipedia.org/wiki/Skype\" rel=\"nofollow\">Skype</a>:</em> <strong>eliah.kagan / Eliah Kagan</strong></p></li>\n<li><p><em><a href=\"http://en.wikipedia.org/wiki/Xfire\" rel=\"nofollow\">Xfire</a>:</em> <a href=\"http://beta.xfire.com/users/drfrobe\" rel=\"nofollow\"><strong>drfrobe</strong> / <strong>Fro(less)</strong></a></p></li>\n<li><p><em><a href=\"http://en.wikipedia.org/wiki/Steam_%28software%29\" rel=\"nofollow\">Steam</a> chat</em>: <a href=\"http://steamcommunity.com/profiles/76561197975297840/\" rel=\"nofollow\"><strong>EkWingburn / Dangerfield Newby</strong></a></p></li>\n</ul>\n\n<h3>I\'m Occasionally Asked For My Comments (but not in the way you think <em>;-)</em> )</h3>\n\n<p>Please feel free to use my <a href=\"http://stackapps.com/q/2116/11150\">pro-forma comments</a>, most of which are derived from the defaults or <a href=\"http://meta.askubuntu.com/q/1323/22949\">the ones shared here</a> rather than being written from scratch by me (some are even <em>identical</em>):</p>\n\n<ul>\n<li>Import/access them in <a href=\"http://paste.ubuntu.com/5836257/\" rel=\"nofollow\">plaintext</a> or <a href=\"http://paste.ubuntu.com/5836259/\" rel=\"nofollow\">jsonp</a> (last updated 2 July 2013).</li>\n</ul>\n\n<p>I do not claim original authorship of them, but if any of them turn out to be wrong or not very good, that is possibly my fault. <strong><em>:-)</em></strong></p>\n','0','0','0','519526');
