INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14849,101,'2018-02-14T12:45:43.480','Tinkeringbell','2018-02-14T12:45:43.480','null','Netherlands','<p>BY DAY: I\'m a java software developer, hiding between three monitors and a pair of noise-cancelling headphones. Love the job, wouldn\'t want to do anything else. I\'m on StackOverflow, Workplace, and SoftwareEngineering mostly to just upvote the useful answers (for me, that is). </p>\n\n<p>BY NIGHT: I\'m a people person. That\'s why I\'m active on Interpersonal Skills. Gives me a chance to interact and stay in bed! </p>\n\n<p>FOR FUN: Too much to handle. (Card)-Weaving, crocheting, needle-binding, reading, listening to relaxing music, bathing, watching television shows, working on my Arduino, calligraphy, drawing, and being a crazy person in general.</p>\n','0','0','0','8510281');
