INSERT INTO Users (Id, Reputation, CreationDate, DisplayName, LastAccessDate, WebsiteUrl, Location, AboutMe,Views, UpVotes, DownVotes, AccountId) VALUES (14927,101,'2018-03-04T18:14:06.630','Gene Parcellano','2018-03-07T19:17:01.627','https://twitter.com/geneparcellano','Chicago, IL','<p>I\'m a designer with developer skills. If you are in need of someone who can design and build web applications quickly, without compromising the UX, feel free to get in touch.</p>\n\n<hr>\n\n<p>A product designer and front-end developer with 10+ years of experience in the trading/investing field. In my previous positions, I have worked as a print designer, visual designer, interaction designer, user experience designer, and front-end web developer. I have led the design of portfolio managers, charting tools, and various financial tools for individual and institutional investors.</p>\n\n<p>Outside of my profession, I also have 6+ years of experiences as an individual investor; Investing in equities, mutual funds, and exchange traded funds.</p>\n\n<p>Currently, I am working as a product designer and front-end developer. In my current role, I am responsible for the full design of the user interface, user experience, and front-end of web applications supporting desktops and mobile devices.</p>\n','0','1','0','2004647');
